0000    Purely mechanical steering transmission - A steering transmission in which the steering forces are transmitted entirely by mechanical means.

0001    Purely hydraulic steering transmission - A steering transmission in which the steering forces, somewhere in the transmission, are transmitted only by hydraulic means.

0010    Purely electric steering transmission - A steering transmission in which the steering forces, somewhere in the transmission, are transmitted only through electric means.

0011    Hybrid steering transmission - A steering transmission in which part of the steering forces is transmitted through one and the other part through another of the above mentioned means.  However, in the case where any mechanical part of the transmission is designed only to give position feedback and is too weak to transmit the total sum of the steering forces, this system shall be considered to be purely hydraulic or purely electric steering transmission.','Electronic Steering Control','6.1','20 ms','bit','0','8');



