Notes:



Voltage droop compensation is used to minimize the amount of reactive current that flows between generators when they are parallelled together.  Excessive reactive current will result in the eventual failure of the generator exciter.



IR line compensation increases the generator output voltage as the load increases so the voltage measured at the load will remain constant.  Without IR compensation, the voltage measured at the load drops due the IR losses in the power line.','Voltage Regulator Operating Mode','1.1','1 sec','bit','0','8');



