Underfrequency compensation is when the generator voltage is adjusted based on the generator frequency.  Typically generator voltage decreases as frequency decreases.  A frequency decrease occurs when load is increased on the genset.  Underfrequency compensation decreases the load by reducing the voltage as frequency decreases until a point is reached where the engine can accept more load.  Load is applied to the engine when the voltage increases with frequency.','Voltage Regulator Operating Mode','1.7','1 sec','bit','0','8');



