INSERT INTO experimenteditor_spnpgnentry VALUES(1,0,695,'Engine Override Control Mode',2,'The override control mode defines which sort of command is used:
INSERT INTO experimenteditor_spnpgnentry VALUES(2,0,696,'Engine Requested Speed Control Conditions',2,'This mode tells the engine control system the governor characteristics that are desired during speed control.  The four characteristics defined are:
INSERT INTO experimenteditor_spnpgnentry VALUES(3,0,897,'Override Control Mode Priority',2,'This field is used as an input to the engine or retarder to determine the priority of the Override Control Mode received in the Torque/Speed Control message (see PGN 0).  The default is 11 (Low priority).  It is not required to use the same priority during the entire override function.  For example, the transmission can use priority 01 (High priority) during a shift, but can set the priority to 11 (Low priority) at the end of the shift to allow traction control to also interact with the torque limit of the engine.
INSERT INTO experimenteditor_spnpgnentry VALUES(4,0,518,'Engine Requested Torque/Torque Limit',8,'Parameter provided to the engine or retarder in the torque/speed control message for controlling or limiting the output torque.
INSERT INTO experimenteditor_spnpgnentry VALUES(5,0,3349,'TSC1 Transmission Rate',3,'This parameter indicates the transmission rate at which the sending device will transmit the TSC1 message.  The engine shall adjust its timeout for TSC1 messages accordingly. Variable TSC1 transmission rates shall only apply to messages sent to the engine.  
INSERT INTO experimenteditor_spnpgnentry VALUES(6,0,3350,'TSC1 Control Purpose',5,'State signal which indicates which control mode the sending device is using to generate the TSC1 command.  Note that the modes are not in prioritized order. Not all modes may be relevant for a given device. Some devices may not implement all functions. For typical priorities refer to Figures SPN512_A, SPN512_B for engine control and Figure SPN695_A.  The TSC1 control purpose shall only apply to messages sent to the engine.  
INSERT INTO experimenteditor_spnpgnentry VALUES(7,0,4191,'Engine Requested Torque -  High Resolution',4,'This parameter displays an additional torque in percent of the reference engine torque. 
INSERT INTO experimenteditor_spnpgnentry VALUES(8,0,4206,'Message Counter',4,'The message counter is used to detect situations where the transmitting ECU malfunction repeats the same frame all the time.  The receiver of the information may use the counter parameter to detect this situation.  The transmitting device will increase the message counter in every cycle. The message counter will count from 0 to 7 and then wrap. 
INSERT INTO experimenteditor_spnpgnentry VALUES(9,0,4207,'Message Checksum',4,'The message checksum is used to verify the signal path from the transmitting device to the receiving device.
INSERT INTO experimenteditor_spnpgnentry VALUES(10,0,898,'Engine Requested Speed/Speed Limit',16,'Parameter provided to the engine from external sources in the torque/speed control message.  This is the engine speed which the engine is expected to operate at if the speed control mode is active or the engine speed which the engine is not expected to exceed if the speed limit mode is active.','Torque/Speed Control 1','2-3','To engine: Control Purpose dependent or 10 ms
INSERT INTO experimenteditor_spnpgnentry VALUES(11,256,681,'Transmission Gear Shift Inhibit Request',2,'Command signal to inhibit gear shifts.
INSERT INTO experimenteditor_spnpgnentry VALUES(12,256,682,'Transmission Torque Converter Lockup Disable Request',2,'Command signal to prevent torque converter lockup, which may cause problems in certain circumstances for ASR.
INSERT INTO experimenteditor_spnpgnentry VALUES(13,256,683,'Disengage Driveline Request',2,'Command signal used to simply disengage the driveline, e.g., to prevent engine drag torque from causing high wheel slip on slippery surfaces.
INSERT INTO experimenteditor_spnpgnentry VALUES(14,256,4242,'Transmission Reverse Gear Shift Inhibit Request',2,'Allows devices external to the normal transmission shift selector system to request the transmission to inhibit shifts into any Reverse gear and force the transmission into Neutral if it is currently in Reverse or attempting to shift to Reverse.  These transmission responses occur regardless of shift selector (Forward, Neutral or Reverse) position at the time the request is received.
INSERT INTO experimenteditor_spnpgnentry VALUES(15,256,684,'Requested Percent Clutch Slip',8,'Parameter which represents the percent clutch slip requested by a device.','Transmission Control 1','2','When active; 50 ms to transmission and axles','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(16,256,525,'Transmission Requested Gear',8,'Gear requested by the operator, ABS, or engine.
INSERT INTO experimenteditor_spnpgnentry VALUES(17,256,685,'Disengage Differential Lock Request - Front Axle 1',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(18,256,686,'Disengage Differential Lock Request - Front Axle 2',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(19,256,687,'Disengage Differential Lock Request - Rear Axle 1',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(20,256,688,'Disengage Differential Lock Request - Rear Axle 2',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(21,256,689,'Disengage Differential Lock Request - Central',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(22,256,690,'Disengage Differential Lock Request - Central Front',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(23,256,691,'Disengage Differential Lock Request - Central Rear',2,'Command signal used to disengage the various differential locks, e.g., to allow an undistributed individual wheel control by ABS.  The differential locks are located as defined in Figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(24,256,5762,'Transmission load reduction inhibit request',2,'Request signal to the transmission to inhibit activation of load reduction functions.
INSERT INTO experimenteditor_spnpgnentry VALUES(25,256,1852,'Transmission Mode 1',2,'Indicates whether transmission mode 1 is enabled.  Modes are manufacturer specific and are not necessarily mutually exclusive.  See also SPN 2536.
INSERT INTO experimenteditor_spnpgnentry VALUES(26,256,1853,'Transmission Mode 2',2,'Indicates whether transmission mode 2 is enabled.  Modes are manufacturer specific and are not necessarily mutually exclusive.  See also SPN 2537.
INSERT INTO experimenteditor_spnpgnentry VALUES(27,256,1854,'Transmission Mode 3',2,'Indicates whether transmission mode 3 is enabled.  Modes are manufacturer specific and are not necessarily mutually exclusive.  See also SPN 2538.
INSERT INTO experimenteditor_spnpgnentry VALUES(28,256,1855,'Transmission Mode 4',2,'Indicates whether transmission mode 4 is enabled.  Modes are manufacturer specific and are not necessarily mutually exclusive.  See also SPN 2539.
INSERT INTO experimenteditor_spnpgnentry VALUES(29,256,4255,'Transmission Requested Launch Gear',4,'Initial gear for the transmission to start out in when the vehicle is launched from a standing stop, as specified by the vehicle operator or vehicle system.  Automatic transmissions typically default to starting out in 1st gear.  However, in applications such as those with very low gearing, it is desirable to launch the vehicle in a range higher than 1st.   For example, when the vehicle has little or no payload, the operator may wish to launch from 2nd or 3rd gear to avoid stacked, unnecessary shifts in the lower ranges.
INSERT INTO experimenteditor_spnpgnentry VALUES(30,256,2985,'Transmission Shift Selector Display Mode Switch',2,'Status of the operator’s switch used to ‘toggle’ through multiple display modes of a shift selector display.  
INSERT INTO experimenteditor_spnpgnentry VALUES(31,256,4246,'Transmission Mode 5',2,'Indicates whether transmission mode 5 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4250.
INSERT INTO experimenteditor_spnpgnentry VALUES(32,256,4247,'Transmission Mode 6',2,'Indicates whether transmission mode 6 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4251.
INSERT INTO experimenteditor_spnpgnentry VALUES(33,256,4248,'Transmission Mode 7',2,'Indicates whether transmission mode 7 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4252.
INSERT INTO experimenteditor_spnpgnentry VALUES(34,256,4249,'Transmission Mode 8',2,'Indicates whether transmission mode 8 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4253.
INSERT INTO experimenteditor_spnpgnentry VALUES(35,512,NULL,'',NULL,'','Reserved for ISO 11992','1','10 ms +/- 1 ms','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(36,768,NULL,'',NULL,'','Reserved for ISO 11992','1','10 ms +/- 1 ms','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(37,1024,2914,'XBR EBI Mode',2,'The XBR EBI (Endurance Brake Integration) Mode is used as an input for the brake system to prescribe the use of endurance brakes like retarders or engine brakes.
INSERT INTO experimenteditor_spnpgnentry VALUES(38,1024,2915,'XBR Priority',2,'The XBR Priority is used as an input to the brake system to manage the priority of overlapping external and internal requests.
INSERT INTO experimenteditor_spnpgnentry VALUES(39,1024,2916,'XBR Control Mode',2,'The XBR Control Mode is used as an input to the brake system and defines how the external acceleration demand has to be realized.
INSERT INTO experimenteditor_spnpgnentry VALUES(40,1024,4099,'XBR urgency',8,'The idea of the urgency value is to adjust the endurance brake integration behavior in the EBS system according to the traffic situation.
INSERT INTO experimenteditor_spnpgnentry VALUES(41,1024,3189,'XBR Message Counter',4,'The XBR message counter is to verify the signal path from the demanding device to the brake controller on electronic brake systems..  The support of this parameter is mandatory.
INSERT INTO experimenteditor_spnpgnentry VALUES(42,1024,3188,'XBR Message Checksum',4,'The XBR message checksum is used to verify the signal path from the demanding device to the brake controller on electronic brake systems.  The support of this parameter is mandatory if PGN 1024 is supported as there is no means to indicate “not available”.
INSERT INTO experimenteditor_spnpgnentry VALUES(43,1024,2920,'External Acceleration Demand',16,'Parameter provided to the brake system from external sources. This is the acceleration which the brake system is expected to realize. It is specified as an absolute acceleration in reference to the road.  Positive values lead to increasing vehicle speed, negative values lead to decreasing vehicle speed.  Note: Normally only the negative data range is used, but e.g. in case of downhill driving also positive values are possible.','External Brake Request','1-2','When active: 20 ms; else 200 ms','m/s²','-15.687','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(44,1280,NULL,'',NULL,'','Reserved for CANopen','1','50 ms','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(45,1536,NULL,'',NULL,'','Reserved for CANopen','1','50 ms','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(46,1792,4087,'Valve Pilot Pressure',8,'Pressure of a valve''s pilot supply port.','General Purpose Valve Pressure','3','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(47,1792,4086,'Valve Load Sense Pressure',16,'The maximum of the currently measured pressures of a valve''s work port A and work port B.','General Purpose Valve Pressure','1-2','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(48,1792,4088,'Valve Assembly Load sense Pressure',16,'The maximum pressure of a valve assembly''s current collective load sense pressures where a valve assembly can consist of two or more valves.','General Purpose Valve Pressure','4-5','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(49,1792,4089,'Valve Assembly Supply Pressure',16,'Pressure of the hydraulic supply port to a valve assembly.','General Purpose Valve Pressure','6-7','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(50,2048,4155,'Auxiliary I/O Channel #6',16,'Identifies the current value of auxiliary input/output channels that are configured uniquely per application.','Auxiliary Input/Output Status 5','1-2','Manufacturer defined, not faster than 20 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(51,2048,4156,'Auxiliary I/O Channel #5',16,'Identifies the current value of auxiliary input/output channels that are configured uniquely per application.','Auxiliary Input/Output Status 5','3-4','Manufacturer defined, not faster than 20 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(52,2048,4157,'Auxiliary I/O Channel #4',16,'Identifies the current value of auxiliary input/output channels that are configured uniquely per application.','Auxiliary Input/Output Status 5','5-6','Manufacturer defined, not faster than 20 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(53,2048,4158,'Auxiliary I/O Channel #3',16,'Identifies the current value of auxiliary input/output channels that are configured uniquely per application.','Auxiliary Input/Output Status 5','7-8','Manufacturer defined, not faster than 20 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(54,2304,5582,'Static Roll Angle',8,'The measured static roll angle between the vehicle y-axis and the ground plane about the X-axis.  The sign of the roll angle is determined in accordance to the right-hand rule about the X-axis, as specified in SAE J670.  Roll angle is the same for both Z-Down and Z-Up axis system, as specified in SAE J670, since both systems have positive X forward.','Static Roll Angle Sensor Information','1','100 ms','deg','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(55,2304,5583,'Static Roll Angle Status',3,'Status of the transmitted roll angle data.
INSERT INTO experimenteditor_spnpgnentry VALUES(56,2560,5603,'Cruise Control Disable Command',2,'This parameter is used to disable cruise control from a source other than the driver controlled switch if cruise control is active.  It is also used to inhibit cruise control from becoming active if it is not currently active.  If this parameter is used to disable cruise control, then cruise control will need to be re-initialized and the previous set speed will not be retained.  
INSERT INTO experimenteditor_spnpgnentry VALUES(57,2560,5604,'Cruise Control Resume Command',2,'This parameter is used to request the cruise control to resume operation from a source other than the driver controlled switch.  Implementers may wish to restrict the conditions in which cruise control will be resumed due to this parameter.  Possible restrictions include only honoring this request if it is received within a certain time period after cruise control has been disabled, a vehicle speed differential has been exceeded since cruise control has been cancelled, etc. 
INSERT INTO experimenteditor_spnpgnentry VALUES(58,2560,5605,'Cruise Control Pause Command',2,'This parameter is used to temporarily disable cruise control from a source other than the driver controlled switch if cruise control is active.  If this parameter is used to disable cruise control, then cruise control will not need to be re-initialized and the previous set speed will be retained.  In order for the cruise control system to resume to the previous set speed, a valid command must be received.  Valid commands include (1) the Cruise Control Resume Switch (SPN 601), (2) the Cruise Control Set Switch (SPN 599), or (3) Cruise Control Resume Command (SPN 5604).
INSERT INTO experimenteditor_spnpgnentry VALUES(59,2816,5681,'Driver activation demand for Advanced Emergency Braking System',2,'According to the Vienna world convetion on road traffic the driver must be provided with means to deactivate an Advanced Emergency Braking System. This command is to be transmitted from the respective HMI unit to the AEBS unit.
INSERT INTO experimenteditor_spnpgnentry VALUES(60,2816,5682,'AEBS2 message Counter',4,'The message counter is increased with every transmitted AEBS2 message.  After reaching a value of 0xF the next value will be 0.','Advanced Emergency Braking System 2','8.1','Every 50ms and if new SPN \'Driver activation demand for Advanced Emergency Braking System\' has changed but no faster than every 10 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(61,2816,5683,'AEBS2 message checksum',4,'Used to check the message checksum of the transmitting (HMI) unit within the AEBS2 system.
INSERT INTO experimenteditor_spnpgnentry VALUES(62,34560,5793,'Desired Engine Fueling State',2,'Devices send this request to the engine controller to:
INSERT INTO experimenteditor_spnpgnentry VALUES(63,34816,5755,'Radio Beacon Direction',2,'Indicates the function of a particular instance of the Radio Beacon Request message. The ''Beacon Request'' state indicates the message is sent to a wireless transceiver to request a transmit of the special beacon message. The ''Beacon Received Acknowledgement'' is sent from a wireless transceiver to report the reception of a special beacon message.
INSERT INTO experimenteditor_spnpgnentry VALUES(64,34816,5757,'Wireless Signal Strength 2',8,'The absolute received signal strength of the special beacon signal received from the off-board transmitter. The signal strength is reported as a Received Signal Strength Indicator (RSSI) value in dBm. This measurement method is identical to SPN 5753 [Wireless Signal Strength].','Radio Beacon Request','7','On request','dBm','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(65,34816,5754,'Unique Beacon Message Identifier Number',16,'The number is used to identify a wireless message originating from a device on a particular machine. Within a beacon request message (see SPN 5755 [Radio Beacon Direction]), this number is included in the transmitted beacon signal. Within a beacon request acknowledge (see SPN 5755 [Radio Beacon Direction]), this number is the number from the received beacon signal.','Radio Beacon Request','1-2','On request','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(66,34816,5756,'Transmitter ID 2',24,'The ID of the off-board transmitter that sent the incoming special beacon message received by the wireless transceiver.','Radio Beacon Request','4-6','On request','ID','0','8');
