INSERT INTO experimenteditor_spnpgnentry VALUES(72,36352,NULL,'',NULL,'','Sequence Control Master-to-Sequence Control Client','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(73,36608,5565,'Coolant Level Engine Protection Shutdown Override Command',2,'Overrides the engine protection shutdown functionality due to low coolant level.  
INSERT INTO experimenteditor_spnpgnentry VALUES(74,36864,5552,'Supplemental Fan Enable Command',2,'Enable/Disable command to Supplemental Fan.
INSERT INTO experimenteditor_spnpgnentry VALUES(75,36864,5553,'Supplemental Fan Direction Command',2,'Direction command to the Supplemental Fan. Fan can be commanded to run forward or reverse.
INSERT INTO experimenteditor_spnpgnentry VALUES(76,36864,5555,'Supplemental Fan Power Hold',2,'Command to allow the supplemental fan controller to remain alive independently of the electrical enable input to the fan. This allows the fan controller to remain alive after the keyswitch has disabled the electrical enable pin on the fan controller. For example, the fan can continue to run after a machine has been shutdown to provide cooling when the machine is no longer running
INSERT INTO experimenteditor_spnpgnentry VALUES(77,36864,5554,'Supplemental Fan Speed Command',16,'Speed command to Supplemental Fan.','Supplemental Fan Command','2-3','1 second','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(78,37120,5510,'Lubrication Cycle Mode Lock Command',2,'Command signal to lock or unlock the ability to change the lubrication cycle mode.  Locking the lubrication mode would prevent the changing of the lubrication cycle mode, perhaps by an operator.
INSERT INTO experimenteditor_spnpgnentry VALUES(79,37120,5511,'Lubrication Cycle Set Command',3,'Command signal to change the lubrication cycle. It gives the operator or technician the ability to the change the frequency of lubrication.
INSERT INTO experimenteditor_spnpgnentry VALUES(80,37120,5512,'Lubrication Operation Mode Set Command',3,'Command signal to change lubrication system operational mode. The mode set command gives the operator and/or technician the ability to change the operational mode when diagnosing and servicing of the system is required.
INSERT INTO experimenteditor_spnpgnentry VALUES(81,37120,5513,'Lubrication Pump Enable Command',2,'Command signal to reset the lubrication pump.  It allows the operator and/or technician to reset the paused lubrication pump and clear lubrication system faults. This shall enable the lubrication system to resume its normal operation. 
INSERT INTO experimenteditor_spnpgnentry VALUES(82,37120,5514,'Lubrication Timing Cycle Command',2,'Command signal to enable or pause the lubrication activation clock 
INSERT INTO experimenteditor_spnpgnentry VALUES(83,37376,5506,'HC Doser Status',3,'Indicates whether the HC Doser/ HC Dosing system is enabled or is waiting for regeneration.
INSERT INTO experimenteditor_spnpgnentry VALUES(84,37376,5507,'HC Doser Injecting Status',2,'Indicates whether the Hydrocarbon Doser (HCD) is presently injecting diesel fuel into the exhaust pipe.
INSERT INTO experimenteditor_spnpgnentry VALUES(85,37376,5508,'Diagnostic Status of HC Doser',3,'Indicates whether an error is active in the Hydrocarbon Doser (HCD) or whether the internal cyclic system test of the HCD is presently active.  
INSERT INTO experimenteditor_spnpgnentry VALUES(86,37376,5509,'Hydrocarbon Doser Purging Needed',2,'Purging of the Hydrocarbon Doser (HCD) is needed.  Request could come from the HCD system.
INSERT INTO experimenteditor_spnpgnentry VALUES(87,37376,5505,'Requested Fuel Mass Rate',16,'Requested fuel dosing quantity from hydrocarbon doser.','Aftertreatment 1 Hydrocarbon Doser Information 1','1-2','100 ms','g/m','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(88,37632,5657,'NAME Checksum / Error Code',8,'This paraleter is used when the mode is “Set Pending NAME”.  NAME checksum is used as a check to ensure the NM message has been sent to the correct CA. It is a guard against the possibility of the SA of the target CA having been claimed by another CA through the address arbitration process since the commanding CA started the NAME change process. The NAME checksum byte contains the arithmetic sum of the 8 bytes of the target CAs original NAME truncated to 8 least significant bits.
INSERT INTO experimenteditor_spnpgnentry VALUES(89,37632,5658,'Manufacturer Code Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Manufacturer Code field is used to replace the Manufacturer Code field currently being used by the CA. When the flag is set to “1”, the Manufacturer Code shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(90,37632,5659,'ECU Instance Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded ECU Instance is used to replace the ECU Instance currently being used by the CA. When the flag is set to “1”, the ECU Instance shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(91,37632,5660,'Function Instance Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Function Instance is used to replace the Function Instance currently being used by the CA. When the flag is set to “1”, the Function Instance shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(92,37632,5661,'Function Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Function is used to replace the Function currently being used by the CA. When the flag is set to “1”, the Function shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(93,37632,5662,'Vehicle System Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Vehicle System is used to replace the Vehicle System currently being used by the CA. When the flag is set to “1”, the Vehicle System field shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(94,37632,5663,'Vehicle System Instance Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Vehicle System Instance is used to replace the Vehicle System Instance currently being used by the CA. When the flag is set to “1”, the Vehicle System shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(95,37632,5664,'Industry Group Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Industry Group is used to replace the Industry Group currently being used by the CA. When the flag is set to “1”, the Industry Group field shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(96,37632,5665,'Arbitrary Address Capable Qualifier Flag',1,'When this qualifier flag is set to “0” in the NM message, the Commanded Arbitrary Address Capable field should be used to replace the Arbitrary Address Capable field currently being used by the CA. When the flag is set to “1”, the Arbitrary Address Capable field shall not be changed.
INSERT INTO experimenteditor_spnpgnentry VALUES(97,37632,5666,'NM Control Mode Indicator',4,'This four bit parameter is used to define the purpose of the NM message as follows:
INSERT INTO experimenteditor_spnpgnentry VALUES(98,37632,5668,'Commanded ECU Instance',3,'The target CA shall use this 3 bit value for its ECU Instance field if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','5.1','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(99,37632,5669,'Commanded Function Instance',5,'The target CA shall use this 5 bit value for its Function Instance if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','5.4','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(100,37632,5670,'Commanded Function',8,'The target CA shall use this 8 bit value for its Function field if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','6','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(101,37632,5671,'Commanded Vehicle System',7,'The target CA shall use this 7 bit value for its Vehicle System field if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','7.2','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(102,37632,5672,'Commanded Vehicle System Instance',4,'The target CA shall use this 4 bit value for its Vehicle System Instance field if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','8.1','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(103,37632,5673,'Commanded Industry Group',3,'The target CA shall use this 3 bit value for its Industry Group field if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','8.5','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(104,37632,5674,'Commanded Arbitrary Address Capable',1,'The target CA shall use this 1 bit value for its Arbitrary Address Capable field if the corresponding qualifier flag in Byte 2 is set to “0”.','NAME Management Message','8.8','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(105,37632,5667,'Commanded Manufacturer Code',11,'The target CA shall use this 11 bit value for the Manufacturer Code if the corresponding qualifier flag in Byte 2 is set to “0”.
INSERT INTO experimenteditor_spnpgnentry VALUES(106,37888,5495,'Aftertreatment 1 Diesel Particulate Filter Soot Mean Calibration Offset',16,'Calibration offset for the soot Mean for Aftertreatment 1 Diesel Particulate Filter soot sensor.','Aftertreatment 1 Diesel Particulate Filter Soot Sensor Calibration','1-2','On powerup and on request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(107,37888,5496,'Aftertreatment 1 Diesel Particulate Filter Soot Standard Deviation Calibration Offset',16,'Calibration offset for the soot standard deviation for Aftertreatment 1 Diesel Particulate Filter soot sensor.','Aftertreatment 1 Diesel Particulate Filter Soot Sensor Calibration','3-4','On powerup and on request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(108,38144,5497,'Aftertreatment 2 Diesel Particulate Filter Soot Mean Calibration Offset',16,'Calibration offset for the soot Mean for Aftertreatment 2 Diesel Particulate Filter soot sensor.','Aftertreatment 2 Diesel Particulate Filter Soot Sensor Calibration','1-2','On powerup and on request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(109,38144,5498,'Aftertreatment 2 Diesel Particulate Filter Soot Standard Deviation Calibration Offset',16,'Calibration offset for the soot standard deviation for Aftertreatment 2 Diesel Particulate Filter soot sensor.','Aftertreatment 2 Diesel Particulate Filter Soot Sensor Calibration','3-4','On powerup and on request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(110,38400,5149,'Low Voltage Disconnect Desired Operating Mode',4,'Desired Operating Mode of the LVD.  Used to issue a J1939 request to the LVD to change modes.
INSERT INTO experimenteditor_spnpgnentry VALUES(111,38656,5059,'Cab Noise Control Status',2,'This parameter returns the current status of the Cab Noise Control system.
INSERT INTO experimenteditor_spnpgnentry VALUES(112,38656,5060,'Cab Noise Control Tuning Status',4,'This parameter returns the current status of tuning function of the Cab Noise Control system.    When the tuning state is active, the Cab Noise Control System adjusts certain system characteristics (e.g. to account for sensor and/or transducer degradation over time). This adjustment may be automatic or under manual control.
INSERT INTO experimenteditor_spnpgnentry VALUES(113,38912,5057,'Cab Noise Control Command',2,'Command signal to change the state of the Cab Noise Control System to on-line or off-line
