INSERT INTO experimenteditor_spnpgnentry VALUES(169,40704,987,'Protect Lamp',2,'This lamp is used to relay trouble code information that is reporting a problem with a vehicle system that is most probably not electronic subsystem related. For instance, engine coolant temperature is exceeding its prescribed temperature range.
INSERT INTO experimenteditor_spnpgnentry VALUES(170,40704,624,'Amber Warning Lamp',2,'This lamp is used to relay trouble code information that is reporting a problem with the vehicle system but the vehicle need not be immediately stopped. 
INSERT INTO experimenteditor_spnpgnentry VALUES(171,40704,623,'Red Stop Lamp',2,'This lamp is used to relay trouble code information that is of a severe enough condition that it warrants stopping the vehicle.
INSERT INTO experimenteditor_spnpgnentry VALUES(172,40704,1213,'Malfunction Indicator Lamp',2,'A lamp used to relay only emissions-related trouble code information. This lamp is only illuminated when there is an emission-related trouble code active.
INSERT INTO experimenteditor_spnpgnentry VALUES(173,40704,3041,'Flash Protect Lamp',2,'This parameter provides the capability to flash the engine protect lamp
