INSERT INTO experimenteditor_spnpgnentry VALUES(176,40704,3038,'Flash Malfunction Indicator Lamp (MIL)',2,'This parameter provides the capability to flash the MIL
INSERT INTO experimenteditor_spnpgnentry VALUES(177,40704,1215,'Failure Mode Identifier',5,'The FMI defines the type of failure detected in the subsystem identified by an SPN.  Note that the failure may not be an electrical failure but may instead be a subsystem failure or condition needing to be reported to the service technician and maybe also to the operator. Conditions can include system events or status that need to be reported.  The FMI, SPN, SPN Conversion Method and Occurrence Count fields combine to form a given diagnostic trouble code.','Immediate Fault Status','5.1','On request','binary','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(178,40704,1216,'Occurrence Count',7,'The 7-bit occurrence count field contains the number of times a fault has been independently detected.  The occurrence count is reported as 1 the first time the DTC is detected. The occurrence count is not incremented again, until after the DTC has gone to the previously active state and then back active the DTC state when subsequently detected.  At this point the occurrence count would be reported as 2. This continues until the DTC has been independently detected 126 times. The occurrence count shall not be incremented from 126 to 127 -- it shall remain at 126 until cleared by DM3 or DM11.
INSERT INTO experimenteditor_spnpgnentry VALUES(179,40704,1706,'SPN Conversion Method',1,'When this 1-bit field is equal to a zero, the SPN should be converted as it is defined.  The February 1996 version of J1939-73 contained inadequate definitions to assure consistent implementations. Products implementing to February 1996 version of the document will always have this bit set to a one. When this is the case, the SPN is in either Version 1, 2 or 3 format. The original publication of this recommended practice defined that this bit be set to one. This particular implementation is no longer permitted. It provides context for some implementations prior to the adoption of the recommended setting as zero (version 4 definition).
INSERT INTO experimenteditor_spnpgnentry VALUES(180,40704,1214,'Suspect Parameter Number',19,'This 19-bit number is used to identify the item for which diagnostics are being reported.  The SPN is used for multiple purposes, some of those that are specific to diagnostics are:
INSERT INTO experimenteditor_spnpgnentry VALUES(181,40960,4129,'NOx NTE Deficiency Area Status',NULL,'Status of engine operation within the NOx NTE Deficiency Area.  The NOx NTE Deficiency Area is defined as bounded regions or conditions within the NTE control area for NOx where the manufacturer has received a deficiency.  If the application does not have, then the application shall report \'Not Available\'.  If supported and the engine is operating outside of the NOx NTE Control Area (SPN YY1), then this status shall be reported as \'Outside Area \'.','NTE Status','1.3','On request','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(182,40960,4128,'Manufacturer-specific NOx NTE Limited Testing Region Status',NULL,'Status of engine operation within the manufacturer specific NOx NTE limited testing region.  The manufacturer specific NOx NTE  limited testing region is defined as bounded regions within the NTE control area for NOx where the manufacturer has limited NTE testing.  If the application does not have a manufacturer specific NOx NTE  limited testing region, then the application shall report \'Not Available\'.  If supported and the engine is operating outside of the NOx NTE Control Area (SPN YY1), then this status shall be reported as \'Outside Area\'.','NTE Status','1.5','On request','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(183,40960,4127,'NOx NTE Control Area Status',NULL,'Status of engine operation within the bounded region of the engine’s torque and speed map where emissions must not exceed a specific emission cap for NOx under the NTE requirement.','NTE Status','1.7','On request','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(184,40960,4132,'PM NTE Deficiency Area Status',NULL,'Status of engine operation within the PM NTE Deficiency Area.  The PM NTE Deficiency Area is defined as bounded regions or conditions within the NTE control area for PM where the manufacturer has received a deficiency.  If the application does not have, then the application shall report \'Not Available\'.  If supported and the engine is operating outside of the PM NTE Control Area (SPN YY1), then this status shall be reported as \'Outside Area \'.','NTE Status','2.3','On request','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(185,40960,4131,'Manufacturer-specific PM NTE Limited Testing Region Status',NULL,'Status of engine operation within the manufacturer specific PM NTE limited testing region.  The manufacturer specific PM NTE  limited testing region is defined as bounded regions within the NTE control area for PM where the manufacturer has limited NTE testing.  If the application does not have a manufacturer specific PM NTE  limited testing region, then the application shall report \'Not Available\'.  If supported and the engine is operating outside of the PM NTE Control Area (SPN YY4), then this status shall be reported as \'Outside Area\'.','NTE Status','2.5','On request','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(186,40960,4130,'PM NTE Control Area Status',NULL,'Status of engine operation within the bounded region of the engine’s torque and speed map where emissions must not exceed a specific emission cap for PM under the NTE requirement.','NTE Status','2.7','On request','','','Variable');
