INSERT INTO experimenteditor_spnpgnentry VALUES(288,43008,3614,'Text Display Index',8,'Used for overwriting consecutive bytes of a displayed string when byte 1 \'Text Display Instructions\' state is set for \'overwrite substring\' mode.  When used, this byte declares where in the text string that the new text will start overwriting, this number is also known as the start byte.  As usual for the transmitted text string, the Text Display Characters will be sent and then terminated by the null character, this will be the stop byte indicator to declare when to stop overwriting.
INSERT INTO experimenteditor_spnpgnentry VALUES(289,43008,3615,'Text Display Character',1600,'From 1 up to 200 characters to be presented on a display. Up to 4 characters can be displayed without using Transport Protocol. The Display Text characters will follow the standard J1939-71 display method. Control characters can be used but not displayed.  The characters are to be terminated with a 00h which is the \'null\' or \'/0\'  character.
