INSERT INTO experimenteditor_spnpgnentry VALUES(390,53760,1720,'Damper Stiffness Request Lift / Tag Axle',8,'Demand value for the shock absorber control at the lift or tag axle','Air Suspension Control 2','6','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(391,53760,1830,'Kneeling Command - Front Axle',2,'Command signal to activate the kneeling functionality at the front axle of the vehicle
INSERT INTO experimenteditor_spnpgnentry VALUES(392,53760,1829,'Kneeling Command - Rear Axle',2,'Command signal to activate the kneeling functionality at the rear axle of the vehicle.
INSERT INTO experimenteditor_spnpgnentry VALUES(393,53760,3215,'Prohibit air suspension control',2,'This parameter is an external request to the air suspension control system to prohibit all air suspension control.  If the request is accepted,  response intended to be sent in  ASC1 (additional status requested in ASC1), there will be no control either for height changes or axle load distribution changes, i.e. hold current pressures in all suspension devices.
INSERT INTO experimenteditor_spnpgnentry VALUES(394,53760,5293,'Allow Level Control During Braking Command',2,'This parameter overides the inhibit of level control during braking.
INSERT INTO experimenteditor_spnpgnentry VALUES(395,53760,5295,'Speed Dependent Level Control Request',2,'This parameter activates speed dependent level control in suspension system.
INSERT INTO experimenteditor_spnpgnentry VALUES(396,53760,5274,'Prohibit Automatic Air Suspension Control',2,'This parameter is an internal request to the air suspension control system to prohibit automatic air suspension control.  If the request is accepted,  response intended to be sent in  ASC1 (additional status requested in ASC1), there will be no automatic control either for height changes or axle load distribution changes, i.e. hold current pressures in all suspension devices.
INSERT INTO experimenteditor_spnpgnentry VALUES(397,53760,5433,'Memory level request',4,'Signal which indicates that the air suspension control requests a memory level or a memory level shall be stored.
INSERT INTO experimenteditor_spnpgnentry VALUES(398,54016,1634,'Calibration Verification Number',32,'Checksum of entire calibration, including code and data.  Excludes RAM parameters, nonvolatile parameters that change during the life cycle of the module (hours of operation, freeze frame data, etc), or non emissions related parameters that may be changed','Calibration Information','1-4','On request','count','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(399,54016,1635,'Calibration Identification',128,'Sixteen-byte calibration identification number. Uniquely identifies the software installed in the control module. The calibration ID must be unique, but does not need to be 16 bytes long. If the Calibration ID is less than 16 bytes, those unused bytes are reported at the end of the calibration ID as 0x00 (the 0x00 pad is placed in the least significant bytes of the Calibration Identifier when needed). The 0x00 if needed is added to the end of the ASCII character string for Calibration Identification.
INSERT INTO experimenteditor_spnpgnentry VALUES(400,54272,1479,'Security Entity Type',4,'This 4-bit parameter that indicates whether the data in the following Security Entity parameter is to be used as a Long Seed, Long Key, Session Key, or Certificate.','Data Security','2.1','As needed','bit','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(401,54272,1596,'Security Entity Length',12,'This 12-bit parameter contains the length, in bytes, of the Data Security Parameter.','Data Security','1, 2.5','As needed','bit','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(402,54272,1597,'Data Security Parameter',8,'This Parameter is used to send the data for the Data Security message. There are presently four different items defined. The Data Security Parameter shall be sent least significant byte first.','Data Security','3-n','As needed','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(403,54528,1603,'Adjust seconds',8,'The seconds component for setting the current time of day.  This should be reported as the seconds component of the current time according to the time of day standard indicated with the Local Hour Offset parameter (SPN 1602).  The time of day should be reported as the current time at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the current time at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the time of day (SPNs 959, 960, and 961) is the current UTC time or a local time zone time.  Refer to SPN 1602 for details.','Time/Date Adjust','1','As needed','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(404,54528,1604,'Adjust minutes',8,'The minutes component for setting the current time of day.  This should be reported as the minutes component of the current time according to the time of day standard indicated with the Local Hour Offset parameter (SPN 1602).  The time of day should be reported as the current time at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the current time at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the time of day (SPNs 959, 960, and 961) is the current UTC time or a local time zone time.  Refer to SPN 1602 for details.','Time/Date Adjust','2','As needed','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(405,54528,1605,'Adjust hours',8,'The hours component for setting the current time of day.  This should be reported as the hours component of the current time according to the time of day standard indicated with the Local Hour Offset parameter (SPN 1602).  The time of day should be reported as the current time at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the current time at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the time of day (SPNs 959, 960, and 961) is the current UTC time or a local time zone time.  Refer to SPN 1602 for details.','Time/Date Adjust','3','As needed','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(406,54528,1606,'Adjust month',8,'The month component for setting the current calendar date.  This should be reported as the month component of the current date according to the calendar date standard indicated with the Local Hour Offset parameter (SPN 1602).  The calendar date should be reported as the current date at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the current date at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the calendar date (SPNs 962, 963, and 964) is the current UTC date or a local time zone date.  Refer to SPN 1602 for details.
INSERT INTO experimenteditor_spnpgnentry VALUES(407,54528,1607,'Adjust day',8,'The day component for setting the current calendar date.  This should be reported as the day component of the current date according to the calendar date standard indicated with the Local Hour Offset parameter (SPN 1602).  The calendar date should be reported as the current date at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the current date at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the calendar date (SPNs 962, 963, and 964) is the current UTC date or a local time zone date.  Refer to SPN 1602 for details.
INSERT INTO experimenteditor_spnpgnentry VALUES(408,54528,1608,'Adjust year',8,'The year component for setting the current calendar date.  This should be reported as the year component of the current date according to the calendar date standard indicated with the Local Hour Offset parameter (SPN 1602).  The calendar date should be reported as the current date at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the current date at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the calendar date (SPNs 962, 963, and 964) is the current UTC date or a local time zone date.  Refer to SPN 1602 for details.
INSERT INTO experimenteditor_spnpgnentry VALUES(409,54528,1609,'Adjust local minute offset',8,'The minute component for setting the offset between the UTC (Universal Time Coordinate) time and date and a the local time zone time and date.  This is the number of minutes to add to UTC, a.k.a. GMT, time and date to convert to the time and date in the Local Time Zone.  The Local Offset is a positive value for time zones East of the Prime Meridian to the International Date Line.  The Local Offset is a negative value for time zones West of the Prime Meridian to the International Date Line.
INSERT INTO experimenteditor_spnpgnentry VALUES(410,54528,1610,'Adjust local hour offset',8,'The hour component for setting the offset between the UTC (Universal Time Coordinate) time and date and a the local time zone time and date.  This is the number of minutes to add to UTC, a.k.a. GMT, time and date to convert to the time and date in the Local Time Zone.  The Local Offset is a positive value for time zones East of the Prime Meridian to the International Date Line.  The Local Offset is a negative value for time zones West of the Prime Meridian to the International Date Line.
INSERT INTO experimenteditor_spnpgnentry VALUES(411,54784,1652,'Boot Load Data',8,'This is a 1-byte parameter using the same SLOT as the Raw Binary Data. There shall be 8 occurrences of this parameter in the message. The meaning of this parameter is proprietary. The structure used to reference the program and verify the data is also proprietary.','Boot Load Data','1-8','As needed','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(412,55040,1650,'Number of Occurrences of Raw Binary Data',8,'This is an 8-bit (1-byte) parameter to be sent within the Binary Data Transfer PGN to provide information on the number of Raw Binary Data parameters which will follow when the message is single packet. Its value is between 1 and 7 when the Binary Data Transfer PGN is not multipacketed.','Binary Data Transfer','1','As needed','count','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(413,55040,1651,'Raw Binary Data',8,'This is a 1-byte parameter representing the value for 1 byte of memory. It can have any value between 0 and 255 (0 and 0xFF) with no reserved values.','Binary Data Transfer','2-8','As needed','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(414,55040,1651,'Raw Binary Data',8,'This is a 1-byte parameter representing the value for 1 byte of memory. It can have any value between 0 and 255 (0 and 0xFF) with no reserved values.','Binary Data Transfer','9-n','As needed','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(415,55296,1646,'Status (for DM 15)',3,'This is a 3-bit parameter which allows the Device to return its Status. All Memory Access Requests originate at a Tool and are considered Commands. All Memory Access Responses originate at a Device and are considered Status. The device may choose to send further information on its status within the Error Indicator/EDC Parameter','Memory Access Response','2.2','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(416,55296,1647,'EDCP Extension',8,'This is an 8-bit parameter used to identify how to handle the data in the Error Indicator/ EDC Parameter. This EDCP Extension parameter is used within the Memory Access Response message (Device to Tool). Meaning must be determined from a table of predefined values. If there is no Error Indicator/EDC Parameter being sent then this (EDCP Extension) parameter must be properly set (0b11111111).','Memory Access Response','6','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(417,55296,1648,'Error Indicator/EDC Parameter',24,'This is a 24-bit parameter which has two uses. One is to transfer a checksum, CRC or other type of EDC parameter (or any segment thereof) from a device to a Tool within the Memory Access Response message. The second use is to send an Error Indicator any time the Device is not able to complete or act upon a Tool’s request.','Memory Access Response','3-5','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(418,55296,1599,'Seed',16,'This is a 16-bit parameter which is used by the Device primarily to send a Seed to a Tool, when using a Seed/Key type security system. It is also used by the Device to signal the Tool that the Device is satisfied that a complete Key has been received or that the Data Security message is expected to contain the Seed data. This parameter can also contain an expected time to completion when the EDCP Extension is 7. The Seed is to be the mathematical basis upon which any Key is calculated. The Device verifies the validity of the Key {Seed} from the Tool and enable memory access operations appropriately.','Memory Access Response','7-8','As needed','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(419,55296,1649,'Length/Number Allowed',11,'When the Status of the Memory Access Response message is a Proceed, an 11-bit parameter identifies the amount of memory (i.e. the range of memory) over which the Device is willing to allow a particular operation to be carried out. For ‘Proceed’ the length value is either in bytes or objects. When the Status of the Memory Access Request is Busy, Operation Failed, or Operation Completed the length is meaningless. The Device should therefore send it as ''0'' and the Tool should treat it as ‘DO NOT CARE’.','Memory Access Response','1, 2.6','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(420,55552,1642,'Command',3,'This is a 3-bit parameter which allows the Tool to send Commands to the Device. All Memory Access Requests originate at a Tool and are considered Commands. Some of the values within the Command have been overlaid with the same values in Status so perhaps a similar variable can be used.','Memory Access Request','2.2','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(421,55552,1641,'Pointer Type',1,'Indicates whether the Pointer and Pointer Extension are direct memory addresses (Pointer Type identifier = 0) or if the Pointer Extension is identifying a particular SPACE with the Pointer referencing a specific OBJECT within that particular SPACE (Pointer Type identifier = 1).
INSERT INTO experimenteditor_spnpgnentry VALUES(422,55552,1643,'Pointer Extension',8,'This parameter is either the high order 8 bits of a complete direct memory address or the identifier of a particular spacial address.','Memory Access Request','6','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(423,55552,1644,'Pointer ',24,'If Pointer Type 0 is used, this 24-bit parameter, which has a value of 0 to 16,777,215 (0 to 0xFFFFFF) with no reserved ranges, is concatenated with the 8-bit Pointer Extension to form a direct memory address. The address thus formed represents the first address to be accessed within the memory in units of bytes. If Pointer Type 1 is used, the Pointer is to provide the identification of the specific OBJECT within whatever particular SPACE is being identified by the Pointer Extension. The direct memory address should be parsed as outlined below if the device memory width is other than 1 byte.','Memory Access Request','3-5','As needed','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(424,55552,1645,'Key/User_Level',16,'This is a 2-byte parameter which is used by the Tool to primarily send a Key to the Device, but which can also be used by the Tool to provide a Password or a User_Level to the Device if desired (see  APPENDIX C).  This Key/User_Level parameter can be used to send these independent variables since they will never be transmitted within the same message (a Password or User_Level parameter would be sent at the beginning of an operation, while a Key CANNOT be sent until after the receipt of a Seed).','Memory Access Request','7-8','As needed','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(425,55552,1640,'Length/Number Requested',11,'This is an 11-bit parameter which identifies the amount of memory (i.e. the range within the memory) over which the Tool desires an operation to be carried out when the Command of the Memory Access Request message is a Read, Write, Boot Load, or Error Detection and/or Correction Parameter (EDCP) Generation.','Memory Access Request','1, 2.6','As needed','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(426,55808,NULL,'',NULL,'','Reserved for ISO 15765','1','','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(427,56064,NULL,'',NULL,'','Reserved for ISO 15765','1','','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(428,56320,1194,'Anti-theft Encryption Seed Present Indicator',2,'Indicates the presence of the encryption seed random number.
INSERT INTO experimenteditor_spnpgnentry VALUES(429,56320,1195,'Anti-theft Password Valid Indicator',2,'Indicates the presence of a validated password.
INSERT INTO experimenteditor_spnpgnentry VALUES(430,56320,1196,'Anti-theft Component Status States',2,'Indicates whether or not the component can be started.  
INSERT INTO experimenteditor_spnpgnentry VALUES(431,56320,1197,'Anti-theft Modify Password States',2,'This parameter is used to indicate whether a password request was successfully performed, or if the request could not be perform due to system constraints or if the request was not a valid request.  
INSERT INTO experimenteditor_spnpgnentry VALUES(432,56320,1198,'Anti-theft Random Number',56,'A seven byte random numeric code provided by the component in response to an anti-theft request.  This parameter is sent as a numeric value utilizing the full range of 0 to 0xFFFFFFFFFFFFFF.  The most significant byte is sent first, not following the rules of Table 1.','Anti-theft Status','2-8','This message is transmitted in response to an Anti-Theft Request message. This message is also sent when the component has an abnormal power interruption.  In this situation the Anti-Theft Status Report is sent without the Anti-Theft Request.','ASCII','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(433,56576,1199,'Anti-theft Encryption Indicator States',2,'This parameter is used to indicate if a random number seed is being requested, or if an encrypted password is being provided to the component. 
INSERT INTO experimenteditor_spnpgnentry VALUES(434,56576,1200,'Anti-theft Desired Exit Mode States',2,'This parameter is used to specify the desired triggers that are to be used by the component in deciding when to transition to the Locked state. 
INSERT INTO experimenteditor_spnpgnentry VALUES(435,56576,1201,'Anti-theft Command States',3,'This parameter is used to identify the specific requests being sent to the component. 
INSERT INTO experimenteditor_spnpgnentry VALUES(436,56576,1202,'Anti-theft Password Representation',56,'This parameter is the seven byte numeric code (i.e., ‘encrypted password’ or ‘key’) that is generated based on the encryption algorithm, the password supplied by the end user, and the random number seed given by the component.  This parameter is sent as a numeric value utilizing the full range of 0 to 0xFFFFFFFFFFFFFF.  The most significant byte is sent first, not following the rules of Table 1.','Anti-theft Request','2-8','Transmission of this message is interrupt driven.  This message is also transmitted upon power-up of the interfacing device sending this message.','ASCII','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(437,56832,988,'Trip Group 1',2,'Command signal used to reset the PGNs and parameters as defined in Table SPN988_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(438,56832,989,'Trip Group 2 - Proprietary',2,'Command signal used to reset proprietary parameters associated with a trip but not defined within this document.
