INSERT INTO experimenteditor_spnpgnentry VALUES(441,56832,3600,'Steering Straight Ahead Position Reset',2,'Used to reset the straight ahead position for a steering sensor in the steering column or a steering controller''s straight ahead position on any steerable axle.
