INSERT INTO experimenteditor_spnpgnentry VALUES(451,57088,2618,'Suspend Signal',4,'Indicator to all nodes that the current communication port broadcast messages are being suspended due to commands other than J1939 DM13. Therefore, the receiving nodes should suspend timeout diagnostics for all messages from the transmitting device. The suspend signal is to be broadcast once, but may be repeated at the option of the transmitting device (if it is capable of doing so) to increase the chances of proper reception by repeating one or two times within the first second of the suspension. If it is able, the transmitter may also send a DM13 message with the suspend signal set to “1110” to indicate that it is returning to full broadcast status.
INSERT INTO experimenteditor_spnpgnentry VALUES(452,57088,1236,'Hold Signal',4,'Indicator to all nodes that the communication ports that have been acted upon by the Stop Start Broadcast PGN are remaining in the modified state. Therefore all nodes should act accordingly. The Hold signal is required to be broadcast every 5 seconds plus or minus one second.
INSERT INTO experimenteditor_spnpgnentry VALUES(453,57088,2619,'Suspend Duration',16,'Indicates the duration of a suspension of broadcast messages when that duration is known by the transmitting device. If the DM13 message is sent with thee suspend signal value of 2 or 3, the value of this parameter will represent the duration of suspension in seconds. For the suspend signal values of 0 to 1, the suspend duration will be sent as Not Available and the duration will be indeterminate. Receivers will know when the suspension is over by the renewed presence of messages from the transmitter either for indefinite suspension or in the case where the transmitter is permitted by an outside command to return to full broadcast status. If it is able, the transmitter may also send a DM13 message with the suspend signal set to “1110” to indicate that it is returning to full broadcast status.','Stop Start Broadcast','5-6','Sent when ever a Stop or Start broadcast event is necessary. To maintain the modified state of the vehicle network(s) the commanding device must send the Hold Signal once every 5 seconds.','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(454,57344,986,'Requested Percent Fan Speed',8,'Fan speed as a ratio of the actual fan drive (current speed) to the fully engaged fan drive (maximum fan speed).  A two state fan (off/on) will use 0% and 100% respectively.  A three state fan (off/intermediate/on) will use 0%, 50% and 100% respectively.  A variable speed fan will use 0% to 100%. Multiple fan systems will use 0 to 100% to indicate the percent cooling capacity being provided.  Feedback to this request is provided using the estimated fan speed (see SPN 975).
INSERT INTO experimenteditor_spnpgnentry VALUES(455,57344,1684,'Auxiliary Heater Coolant Pump Request',2,'Indicates whether to activate the auxiliary heater coolant water pump.
INSERT INTO experimenteditor_spnpgnentry VALUES(456,57344,1682,'Battery Main Switch Hold Request',2,'Request to hold the battery main switch.
