INSERT INTO experimenteditor_spnpgnentry VALUES(458,57344,1856,'Seat Belt Switch',2,'State of switch used to determine if Seat Belt is buckled
INSERT INTO experimenteditor_spnpgnentry VALUES(459,57344,5630,'Park Brake Command',2,'Request by a secondary device to command the Park Brake.  The Park Brake controller should treat this as a request and should apply the Park Brake as determined by the controller. 
