INSERT INTO experimenteditor_spnpgnentry VALUES(466,57344,1656,'Engine Automatic Start Enable Switch',2,'Switch signal which enables the idle management system to be enabled. When this system is enabled with the engine in an idle mode and safe operating conditions existing, then the engine may be started or stopped automatically.
INSERT INTO experimenteditor_spnpgnentry VALUES(467,57344,1683,'Auxiliary Heater Mode Request',4,'Request to activate the auxiliary heater.
