INSERT INTO experimenteditor_spnpgnentry VALUES(470,57344,2596,'Selected Maximum Vehicle Speed Limit',8,'User selected maximum vehicle speed.  If one is selected, then this SPN must equal one of the maximum vehicle speeds #1-#7 from PGN 64997 - Maximum Vehicle Speed Limit Status . If different maximum vehicle speed requests are present from different devices, the lowest requested value should be used.
INSERT INTO experimenteditor_spnpgnentry VALUES(471,57344,1691,'Cab Interior Temperature Command',16,'Parameter used to command a certain cab interior temperature.
