INSERT INTO experimenteditor_spnpgnentry VALUES(473,57856,NULL,'',NULL,'','Reserved for ISO 11992','1','','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(474,58112,1224,'Test Identifier',8,'The TID has 2 methods to designate the test to be run. The first method uses the TID alone and these test identifiers are manufacturer-defined test identifiers. For this first use there are 64 valid test identifiers, 1 to 64. The second method uses the TID and the SPN / FMI to identify the test.','Command Non-continuously Monitored Test','1','Sent whenever a test is desired','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(475,58112,4149,'FMI Identifying Component / System Specific Test',5,'This parameter identifies the failure mode identifier which represents the test(s) that shall be run on the component / system that will be tested.','Command Non-continuously Monitored Test','4.1','Sent whenever a test is desired','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(476,58112,4148,'SPN Identifying Component / System',19,'','Command Non-continuously Monitored Test','2-3, 4.6','Sent whenever a test is desired','binary','0','8');
