INSERT INTO experimenteditor_spnpgnentry VALUES(482,59392,2542,'Group Function Value (ACK)',8,'see PGN 59,392 description.','Acknowledgment Message','0x00;2','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(483,59392,2543,'Parameter Group Number (ACK)',24,'See paragraph 5.1.2','Acknowledgment Message','0x00;6-8','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
