INSERT INTO experimenteditor_spnpgnentry VALUES(485,59392,2545,'Parameter Group Number (NACK)',24,'see PGN 59,392 description.','Acknowledgment Message','0x01;6-8','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(486,59392,2546,'Group Function Value (NACK_AD)',8,'see PGN 59,392 description.','Acknowledgment Message','0x02;2','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(487,59392,2547,'Parameter Group Number  (NACK_AD)',24,'see PGN 59,392 description.','Acknowledgment Message','0x02;6-8','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(488,59392,2548,'Group Function Value (NACK_Busy)',8,'see PGN 59,392 description.','Acknowledgment Message','0x03;2','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(489,59392,2549,'Parameter Group Number (NACK_Busy)',24,'see PGN 59,392 description.','Acknowledgment Message','0x03;6-8','Upon reception of a Parameter Group Number that requires this form of acknowledgment.','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(490,59904,2540,'Parameter Group Number (RQST)',24,'Whenever it is necessary to identify a Parameter Group in the data field of a CAN data frame, it will be expressed in 24 bits.  The Parameter Group Number is a 24 bit value that has the following constituent components:  Reserved bit, Data Page bit, PDU Format Field (8 bits), and Group Extension Field (8 bits).
INSERT INTO experimenteditor_spnpgnentry VALUES(491,60160,2572,'Sequence Number (TP.DT)',8,'Sequence Number (TP.DT)','Transport Protocol - Data Transfer','1','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(492,60160,2573,'Packetized Data (TP.DT)',14272,'Relevant data for this PGNs unique use.','Transport Protocol - Data Transfer','2-x','Per the Parameter Group to be transferred','Request Dependent','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(493,60416,2556,'Control Byte (TP.CM)',8,'Control byte (I.e. Group Function) associated with the Transport Protocol - Connection Management (PGN 60,416)
INSERT INTO experimenteditor_spnpgnentry VALUES(494,60416,2557,'Total Message Size (TP.CM_RTS)',16,'Total message size (in bytes) for RTS/CTS message.  Messages shorter than 9 data bytes should be sent without utilizing the transport protocol.  Messages longer than 1785 can not use the RTS/CTS transport protocol.','Transport Protocol - Connection Mgmt','0x10;2-3','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(495,60416,2558,'Total Number of Packets (TP.CM_RTS)',8,'Total number of packets for RTS/CTS message.  Zero and one are not valid values.','Transport Protocol - Connection Mgmt','0x10;4','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(496,60416,2559,'Maximum Number of Packets (TP.CM_RTS)',8,'Maximum number of packets for RTS/CTS message.  zero through four are not allowed','Transport Protocol - Connection Mgmt','0x10;5','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(497,60416,2560,'Parameter Group Number of the packeted message (TP.CM_RTS)',24,'Requested PGN in the TP.CM_RTS message','Transport Protocol - Connection Mgmt','0x10;6-8','Per the Parameter Group to be transferred','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(498,60416,2561,'Number of Packets that can be sent (TP.CM_CTS)',8,'Number of Packets that can be sent (TP.CM_CTS)','Transport Protocol - Connection Mgmt','0x11;2','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(499,60416,2562,'Next Packet Number to be sent (TP.CM_CTS)',8,'Next Packet Number to be sent (TP.CM_CTS)','Transport Protocol - Connection Mgmt','0x11;3','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(500,60416,2563,'Parameter Group Number of the packeted message (TP.CM_CTS)',24,'PGN of requested information in the TP.CM_CTS message','Transport Protocol - Connection Mgmt','0x11;6-8','Per the Parameter Group to be transferred','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(501,60416,2557,'Total Message Size (TP.CM_RTS)',16,'Total message size (in bytes) for RTS/CTS message.  Messages shorter than 9 data bytes should be sent without utilizing the transport protocol.  Messages longer than 1785 can not use the RTS/CTS transport protocol.','Transport Protocol - Connection Mgmt','0x13;2-3','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(502,60416,2564,'Total Message Size (TP.CM_EndofMsgACK)',16,'Total message size (in bytes) received for RTS/CTS message.  Messages shorter than 9 data bytes should be sent without utilizing the transport protocol.  Messages longer than 1785 can not use the RTS/CTS transport protocol.','Transport Protocol - Connection Mgmt','0x13;2-3','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(503,60416,2565,'Total Number of Packets (TP.CM_EndofMsgACK)',8,'Total number of packets received for RTS/CTS message.  Zero and one are not valid values.','Transport Protocol - Connection Mgmt','0x13;4','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(504,60416,2566,'Parameter Group Number of the packeted message (TP.CM_EndofMsgACK)',24,'Requested PGN in the TP.CM_RTS message','Transport Protocol - Connection Mgmt','0x13;6-8','Per the Parameter Group to be transferred','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(505,60416,2567,'Total Message Size (TP.CM_BAM)',16,'Total message size (in bytes) for BAM  message.  Messages shorter than 9 data bytes should be sent without utilizing the transport protocol.  Messages longer than 1785 can not use the BAM transport protocol.','Transport Protocol - Connection Mgmt','0x20;2-3','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(506,60416,2568,'Total Number of Packets (TP.CM_BAM)',8,'Total number of packets for BAM message.  Zero and one are not valid values.','Transport Protocol - Connection Mgmt','0x20;4','Per the Parameter Group to be transferred','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(507,60416,2569,'Parameter Group Number of the packeted message (TP.CM_BAM)',24,'Requested PGN in the TP.CM_BAM message','Transport Protocol - Connection Mgmt','0x20;6-8','Per the Parameter Group to be transferred','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(508,60416,2570,'Connection Abort Reason',8,'Reason for connection abort message.
INSERT INTO experimenteditor_spnpgnentry VALUES(509,60416,2571,'Parameter Group Number of packeted message (TP.CM_Conn_Abort)',24,'Requested PGN in the TP.CM_Conn_Abort message','Transport Protocol - Connection Mgmt','0xFF;6-8','Per the Parameter Group to be transferred','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(510,60672,NULL,'',NULL,'','Network Layer','1','100 ms','','','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(511,60928,2848,'NAME of Controller Application (for address claimed)',64,'An 8-byte value which uniquely identifies the primary function of an ECU and its instance on the network. A device''s NAME must be unique, no two devices may share the same NAME value on a given vehicle network.','Address Claimed','1-8','As required','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(512,61184,2550,'Manufacturer Specific Information (PropA_PDU1)',14280,'','Proprietary A','1-8','Per user requirements','Manufacturer Determined','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(513,61440,900,'Retarder Torque Mode',4,'State signal which indicates which retarder torque mode is currently generating, limiting, or controlling the torque.  Note that the modes are not in prioritized order. Not all modes may be relevant for a given device.  Some devices may not implement all functions.  For typical priorities refer to Tables SPN518_A to SPN518_B for retarder control.  The data type of this parameter is measured. 
INSERT INTO experimenteditor_spnpgnentry VALUES(514,61440,571,'Retarder Enable - Brake Assist Switch',2,'Switch signal which indicates whether the operator wishes the retarder to be enabled for vehicle braking assist. The retarder does not check this switch, nor does the enabling of this switch engage the retarder. When this switch is “enabled,” the devices constructing TSC1 – destination retarder messages may command retarder torque for braking. For example, the cruise control should not request retarder torque if this switch is not “enabled.” The switch exists to prevent the engine retarder from being asked to be engaged via TSC1 in a noise sensitive area. See also SPN 572
INSERT INTO experimenteditor_spnpgnentry VALUES(515,61440,572,'Retarder Enable - Shift Assist Switch',2,'Switch signal which indicates whether the operator wishes the retarder to be enabled for transmission shift assist.  The retarder does not check this switch, nor does the enabling of this switch engage the retarder.  When this switch is “enabled,” the transmission may activate the retarder (via the TSC1 message) to increase the rate of engine deceleration to assist in shift control.  The switch exists to prevent the engine retarder from being asked to be engaged via TSC1 in a noise sensitive area.  See SPN 571.
INSERT INTO experimenteditor_spnpgnentry VALUES(516,61440,520,'Actual Retarder - Percent Torque',8,'Actual braking torque of the retarder as a percent of retarder configuration reference torque SPN 556.
INSERT INTO experimenteditor_spnpgnentry VALUES(517,61440,1085,'Intended Retarder Percent Torque',8,'Braking torque of retarder that the retarder is currently trying to achieve.  This value takes into account all static limitations, but not the limitations due to the dynamic behavior of the retarder.  This value, if unchanged over a certain time, can and will be reached by the actual retarder - percent torque (See SPN 520).','Electronic Retarder Controller 1','3','100 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(518,61440,1082,'Engine Coolant Load Increase',2,'Status of an event, external to the engine, that may increase the nominal temperature of the engine coolant liquid.
INSERT INTO experimenteditor_spnpgnentry VALUES(519,61440,1667,'Retarder Requesting Brake Light',2,'Indicates that whether the retarder is requesting that the brake lights are illuminated.
INSERT INTO experimenteditor_spnpgnentry VALUES(520,61440,4233,'Retarder Road Speed Limit Switch',2,'Retarder road speed limit switch states:
INSERT INTO experimenteditor_spnpgnentry VALUES(521,61440,4234,'Retarder Road Speed Exceeded Status',2,'Retarder Road Speed Exceeded Status:
INSERT INTO experimenteditor_spnpgnentry VALUES(522,61440,1480,'Source Address of Controlling Device for Retarder Control',8,'The source address of the SAE J1939 device currently controlling the retarder.  It is used to expand the torque mode parameter (see SPN 899) in cases where control is in response to an ECU that is not listed in Table SPN899_A.  Its value may be the source address of the ECU transmitting the message (which means that no external SAE J1939 message is providing the active command) or the source address of the SAE J1939 ECU that is currently providing the active command in a TSC1 (see PGN 0) or similar message.  Note that if this parameter value is the same as the source address of the device transmitting it, the control may be due to a message on a non-SAE J1939 data link such as SAE J1922 or a proprietary link.','Electronic Retarder Controller 1','5','100 ms','SA','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(523,61440,1715,'Drivers Demand Retarder -  Percent Torque',8,'The Drivers demand retarder – percent torque is the maximum torque selected by the driver when one or more modes  are selected by the driver, such as hand lever, switch, constant torque, constant velocity, etc.','Electronic Retarder Controller 1','6','100 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(524,61440,1716,'Retarder Selection, non-engine',8,'The “Retarder Selection, non-engine” is the position of the driver’s selector for retarders that are not part of the engine system, expressed as percent and determined by the ratio of current position to the maximum possible position. The physical device may be a lever, rotary dial, combination of switches, or other device that the driver can use to select the type or amount of retardation needed.','Electronic Retarder Controller 1','7','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(525,61440,1717,'Actual Maximum Available Retarder - Percent Torque',8,'This is the maximum amount of torque that the retarder can immediately deliver.   It is the same as the maximum torque shown in the Retarder’s Configuration message, but allows for a much faster rate of change than could be communicated by reissuing the configuration message. 
INSERT INTO experimenteditor_spnpgnentry VALUES(526,61441,561,'ASR Engine Control Active',2,'State signal which indicates that ASR engine control has been commanded to be active. Active means that ASR actually tries to control the engine. This state signal is independent of other control commands to the engine (e.g., from the transmission) which may have higher priority.
INSERT INTO experimenteditor_spnpgnentry VALUES(527,61441,562,'ASR Brake Control Active',2,'State signal which indicates that ASR brake control is active. Active means that ASR actually controls wheel brake pressure at one or more wheels of the driven axle(s).
INSERT INTO experimenteditor_spnpgnentry VALUES(528,61441,563,'Anti-Lock Braking (ABS) Active',2,'State signal which indicates that the ABS is active.  The signal is set active when wheel brake pressure actually starts to be modulated by ABS and is reset to passive when all wheels are in a stable condition for a certain time.  The signal can also be set active when driven wheels are in high slip  (e.g., caused by retarder).  Whenever the ABS system is not fully operational (due to a defect or during off-road ABS operation) , this signal is only valid for that part of the system that is still working.  When ABS is switched off completely, the flag is set to passive regardless of the current wheel slip conditions.
INSERT INTO experimenteditor_spnpgnentry VALUES(529,61441,1121,'EBS Brake Switch',2,'Switch signal which indicates that the brake pedal is being pressed.  The EBS brake switch is independent of the brake light switch and has no provisions for external connections.
INSERT INTO experimenteditor_spnpgnentry VALUES(530,61441,521,'Brake Pedal Position',8,'Ratio of brake pedal position to maximum pedal position.  Used for electric brake applications. 0% means no braking. Also when there are two brake pedals on the machine (Left Brake Pedal Position SPN 3033 and Right Brake Pedal Position SPN 3032) the maximum of the two should be transmitted for Brake Pedal Position.','Electronic Brake Controller 1','2','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(531,61441,575,'ABS Off-road Switch',2,'Switch signal which indicates the position of the ABS off-road switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(532,61441,576,'ASR Off-road Switch',2,'Switch signal which indicates the position of the ASR off-road switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(533,61441,577,'ASR \'Hill Holder\' Switch',2,'Switch signal which indicates the position of the ASR “hill holder” switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(534,61441,1238,'Traction Control Override Switch',2,'Switch signal which indicates the position of the traction control override switch.  The traction control override signal disables the automatic traction control function allowing the wheels to spin.
INSERT INTO experimenteditor_spnpgnentry VALUES(535,61441,972,'Accelerator Interlock Switch',2,'Switch signal used to disable the accelerator and remote accelerator inputs, causing the engine to return to idle.
INSERT INTO experimenteditor_spnpgnentry VALUES(536,61441,971,'Engine Derate Switch',2,'Switch signal used to activate the torque limiting feature of the engine.  The specific nature of torque limiting should be verified with the manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(537,61441,970,'Engine Auxiliary Shutdown Switch',2,'Switch signal which requests that all engine fueling stop.
INSERT INTO experimenteditor_spnpgnentry VALUES(538,61441,969,'Remote Accelerator Enable Switch',2,'Switch signal which indicates that the remote accelerator has been enabled and controls the engine.  
INSERT INTO experimenteditor_spnpgnentry VALUES(539,61441,973,'Engine Retarder Selection',8,'The position of the operator controlled selector, expressed as a percentage and determined by the ratio of the current position of the selector to its maximum possible position. Zero percent means no braking torque is requested by the operator from the engine while 100% means maximum braking.','Electronic Brake Controller 1','5','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(540,61441,1243,'ABS Fully Operational',2,'Signal which indicates whether an ABS system is fully operational or whether its functionality is reduced by a defect or by an intended action (e.g., by activation of an ABS-off-road switch or during special diagnostic procedures).  There are cases where the signal is necessary to fulfill legal regulations for special applications (e.g., switching off integrated retarders).
INSERT INTO experimenteditor_spnpgnentry VALUES(541,61441,1439,'EBS Red Warning Signal',2,'This parameter commands the EBS red optical warning signal
INSERT INTO experimenteditor_spnpgnentry VALUES(542,61441,1438,'ABS/EBS Amber Warning Signal (Powered Vehicle)',2,'This parameter commands the ABS/EBS amber/yellow optical warning signal
INSERT INTO experimenteditor_spnpgnentry VALUES(543,61441,1793,'ATC/ASR Information Signal',2,'This parameter commands the ATC/ASR driver information signal, for example a dash lamp.
INSERT INTO experimenteditor_spnpgnentry VALUES(544,61441,1481,'Source Address of Controlling Device for Brake Control',8,'The source address of the SAE J1939 device currently controlling the brake system. Its value may be the source address of the ECU transmitting the message (which means that no external SAE J1939 message is providing the active command) or the source address of the SAE J1939 ECU that is currently providing the active command in a TSC1 (see PGN 0) or similar message.  Note that if this parameter value is the same as the source address of the device transmitting it, the control may be due to a message on a non-SAE J1939 data link such as SAE J1922 or a proprietary link.','Electronic Brake Controller 1','7','100 ms','SA','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(545,61441,2911,'Halt brake switch',2,'Switch signal which indicates the position of the halt brake switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(546,61441,1836,'Trailer ABS Status',2,'State signal which indicates that ABS in the trailer is actively controlling the brakes.  A message is sent to the tractor from the trailer (i.e. by PLC). The receiving device in the tractor transfers this information to the J1939 network.  At the beginning of power on the message is sent by the trailer to indicate if this status information is supported. Timeout of the trailer ABS active can be done by monitoring of the Trailer warning light information.
INSERT INTO experimenteditor_spnpgnentry VALUES(547,61441,1792,'Tractor-Mounted Trailer ABS Warning Signal',2,'This parameter commands the tractor-mounted trailer ABS optical warning signal.
INSERT INTO experimenteditor_spnpgnentry VALUES(548,61442,560,'Transmission Driveline Engaged',2,'Driveline engaged indicates the transmission controlled portion of the driveline is engaged sufficiently to allow a transfer of torque through the transmission.  Driveline engaged is ACTIVE whenever the transmission is in gear and the clutch (if controlled by the transmission controller) is less than 100% clutch slip (clutch able to transfer torque).  This parameter should be used in conjunction with the parameter “Shift in Process” (SPN 574).  While a shift is in process, the receiver should not assume that the driveline is either fully engaged or disengaged (i.e., cruise control).
INSERT INTO experimenteditor_spnpgnentry VALUES(549,61442,573,'Transmission Torque Converter Lockup Engaged',2,'State signal which indicates whether the torque converter lockup is engaged.
INSERT INTO experimenteditor_spnpgnentry VALUES(550,61442,574,'Transmission Shift In Process',2,'Indicates that the transmission is in process of shifting from the current gear to the selected gear.  This state is generally ACTIVE during the entire time that the transmission controls the vehicle.  This includes any transmission clutch control, all engine control sequences, pulling to transmission neutral, and engaging the destination gear (e.g., until it is no longer sending commands and/or limits to the engine).  See also SPN 560.  (See Figure SPN574_A)
INSERT INTO experimenteditor_spnpgnentry VALUES(551,61442,4816,'Transmission Torque Converter Lockup Transition in Process',2,'State signal indicating whether or not the transmission torque converter lock up clutch is transitioning between being applied and being released.  The broadcast value should be set to 01 as soon as an apply or release of the lockup clutch is initiated, and then set to 00 once the given transition is complete.  This parameter is a companion to SPN 573 Transmission Torque Converter Lockup Engaged.
INSERT INTO experimenteditor_spnpgnentry VALUES(552,61442,522,'Percent Clutch Slip',8,'Parameter which represents the ratio of input shaft speed to current engine speed (in percent).
INSERT INTO experimenteditor_spnpgnentry VALUES(553,61442,606,'Engine Momentary Overspeed Enable',2,'Command signal used to indicate that the engine speed may be boosted up to the maximum engine overspeed value to accommodate transmission downshifts.  The maximum time for overspeed is limited by the time defined in the engine configuration message (see PGN 65,251).  The transmission module must command a “override disabled” state at least once before the engine will accept a subsequent request for overspeed.
INSERT INTO experimenteditor_spnpgnentry VALUES(554,61442,607,'Progressive Shift Disable',2,'Command signal used to indicate that progressive shifting by the engine should be disallowed.
INSERT INTO experimenteditor_spnpgnentry VALUES(555,61442,5015,'Momentary Engine Maximum Power Enable',2,'Momentarily Requesting highest torque map from the engine control
INSERT INTO experimenteditor_spnpgnentry VALUES(556,61442,1482,'Source Address of Controlling Device for Transmission Control',8,'The source address of the SAE J1939 device currently controlling the transmission. Its value may be the source address of the ECU transmitting the message (which means that no external SAE J1939 message is providing the active command) or the source address of the SAE J1939 ECU that is currently providing the active command in a TSC1 (see PGN 0) or similar message.  Note that if this parameter value is the same as the source address of the device transmitting it, the control may be due to a message on a non-SAE J1939 data link such as SAE J1922 or a proprietary link.','Electronic Transmission Controller 1','8','10 ms','SA','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(557,61442,191,'Transmission Output Shaft Speed',16,'Calculated speed of the transmission output shaft.','Electronic Transmission Controller 1','2-3','10 ms','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(558,61442,161,'Transmission Input Shaft Speed',16,'Rotational velocity of the primary shaft transferring power into the transmission.  When a torque converter is present, it is the output of the torque converter.','Electronic Transmission Controller 1','6-7','10 ms','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(559,61443,558,'Accelerator Pedal 1 Low Idle Switch',2,'Switch signal which indicates the state of the accelerator pedal 1 low idle switch.  The low idle switch is defined in SAE Recommended Practice J1843.
INSERT INTO experimenteditor_spnpgnentry VALUES(560,61443,559,'Accelerator Pedal Kickdown Switch',2,'Switch signal which indicates whether the accelerator pedal kickdown switch is opened or closed.  The kickdown switch is defined in SAE J1843.
INSERT INTO experimenteditor_spnpgnentry VALUES(561,61443,1437,'Road Speed Limit Status',2,'Status (active or not active) of the system used to limit maximum vehicle velocity.
INSERT INTO experimenteditor_spnpgnentry VALUES(562,61443,2970,'Accelerator Pedal 2 Low Idle Switch',2,'Switch signal which indicates the state of the accelerator pedal 2 low idle switch.  The low idle switch is defined in SAE J1843.
INSERT INTO experimenteditor_spnpgnentry VALUES(563,61443,91,'Accelerator Pedal Position 1',8,'The ratio of actual position of the analog engine speed/torque request input device (such as an accelerator pedal or throttle lever) to the maximum position of the input device.  This parameter is intended for the primary accelerator control in an application.  If an application has only one accelerator control, use SPN 91.    
INSERT INTO experimenteditor_spnpgnentry VALUES(564,61443,92,'Engine Percent Load At Current Speed',8,'The ratio of actual engine percent torque (indicated) to maximum indicated torque available at the current engine speed, clipped to zero torque during engine braking.','Electronic Engine Controller 2','3','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(565,61443,974,'Remote Accelerator Pedal Position',8,'The ratio of actual position of the remote analog engine speed/torque request input device (such as an accelerator pedal or throttle lever) to the maximum position of the input device.     
INSERT INTO experimenteditor_spnpgnentry VALUES(566,61443,29,'Accelerator Pedal Position 2',8,'The ratio of actual position of the second analog engine speed/torque request input device (such as an accelerator pedal or throttle lever) to the maximum position of the input device.  This parameter is intended for secondary accelerator control in an application.  If an application has only one accelerator control, use SPN 91.    
INSERT INTO experimenteditor_spnpgnentry VALUES(567,61443,2979,'Vehicle Acceleration Rate Limit Status',2,'Status (active or not active) of the system used to limit maximum forward  vehicle acceleration.
INSERT INTO experimenteditor_spnpgnentry VALUES(568,61443,5021,'Momentary Engine Maximum Power Enable Feedback',2,'Momentarily requesting Engine Maximum Power Enable - feature support feedback
INSERT INTO experimenteditor_spnpgnentry VALUES(569,61443,5399,'DPF Thermal Management Active',2,'Indicates that the exhaust temperatures have been elevated for regeneration of the diesel particulate filter aftertreatment system or in preparation of regeneration of the diesel particulate aftertreatment system.
INSERT INTO experimenteditor_spnpgnentry VALUES(570,61443,5400,'SCR Thermal Management Active',2,'Indicates that the exhaust temperatures have been elevated for regeneration of the SCR aftertreatment system or in preparation of regeneration of the SCR aftertreatment system.
INSERT INTO experimenteditor_spnpgnentry VALUES(571,61443,3357,'Actual Maximum Available Engine - Percent Torque',8,'This is the maximum amount of torque that the engine can immediately deliver as a percentage of the reference engine torque (SPN 544).  The Actual Maximum Available Engine - Percent Torque shall take into consideration all engine torque derates (e.g. air fuel ratio control (AFC), noise control, etc.) that could potentially be active in the system.  This parameter differentiates itself from the engine percent torque points 1 through 5 of the engine configuration map because it takes into account all dynamic internal inputs such as  AFC and that it is updated on a 50ms basis.','Electronic Engine Controller 2','7','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(572,61443,5398,'Estimated Pumping - Percent Torque',8,'The calculated torque that indicates the estimated amount of torque loss due to the engine air handling system. The value transmitted in this parameter is included in SPN 514 (Nominal Friction - Percent Torque).  The data is transmitted as a percent of reference engine torque (see the engine configuration message, PGN 65251).','Electronic Engine Controller 2','8','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(573,61444,899,'Engine Torque Mode',4,'State signal which indicates which engine torque mode is currently generating, limiting, or controlling the torque.  Note that the modes are not in prioritized order. Not all modes may be relevant for a given device.  Some devices may not implement all functions.  For typical priorities refer to Figures SPN512_A and SPN512_B for engine control.  The data type of this parameter is measured.  
INSERT INTO experimenteditor_spnpgnentry VALUES(574,61444,4154,'Actual Engine - Percent Torque High Resolution',4,'This parameter displays an additional torque in percent of the reference engine torque. 
INSERT INTO experimenteditor_spnpgnentry VALUES(575,61444,512,'Driver''s Demand Engine - Percent Torque',8,'The requested torque output of the engine by the driver. It is based on input from the following requestors external to the powertrain: operator (via the accelerator pedal), cruise control and/or road speed limit governor. Dynamic commands from internal powertrain functions such as smoke control, low- and high-speed engine governing; ASR and shift control are excluded from this calculation. The data is transmitted in indicated torque as a percent of the reference engine torque. See PGN 65251 for the engine configuration message. Several status bits are defined separately to indicate the request which is currently being honored. This parameter may be used for shift scheduling.','Electronic Engine Controller 1','2','engine speed dependent','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(576,61444,513,'Actual Engine - Percent Torque',8,'The calculated output torque of the engine.  The data is transmitted in indicated torque as a percent of reference engine torque (see the engine configuration message, PGN 65251).  The engine percent torque value will not be less than zero and it includes the torque developed in the cylinders required to overcome friction.','Electronic Engine Controller 1','3','engine speed dependent','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(577,61444,1483,'Source Address of Controlling Device for Engine Control',8,'The source address of the SAE J1939 device currently controlling the engine.  It is used to expand the torque mode parameter (see SPN 899) in cases where control is in response to an ECU that is not listed in Table SPN899_A.  Its value may be the source address of the ECU transmitting the message (which means that no external SAE J1939 message is providing the active command) or the source address of the SAE J1939 ECU that is currently providing the active command in a TSC1 (see PGN 0) or similar message.  Note that if this parameter value is the same as the source address of the device transmitting it, the control may be due to a message on a non-J1939 data link such as SAE J1922 or a proprietary link.','Electronic Engine Controller 1','6','engine speed dependent','SA','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(578,61444,1675,'Engine Starter Mode',4,'There are several phases in a starting action and different reasons why a start cannot take place.
INSERT INTO experimenteditor_spnpgnentry VALUES(579,61444,2432,'Engine Demand – Percent Torque',8,'The requested torque output of the engine by all dynamic internal inputs, including smoke control, noise control and low and high speed governing.','Electronic Engine Controller 1','8','engine speed dependent','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(580,61444,190,'Engine Speed',16,'Actual engine speed which is calculated over a minimum crankshaft angle of 720 degrees divided by the number of cylinders.','Electronic Engine Controller 1','4-5','engine speed dependent','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(581,61445,524,'Transmission Selected Gear',8,'The gear that the transmission will attempt to achieve during the current shift if a shift is in progress, or the next shift if one is pending (i.e., waiting for torque reduction to initiate the shift).','Electronic Transmission Controller 2','1','100 ms','gear value','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(582,61445,523,'Transmission Current Gear',8,'The gear currently engaged in the transmission or the last gear engaged while the transmission is in the process of shifting to the new or selected gear.  Transitions toward a destination gear will not be indicated.  Once the selected gear has been engaged then Transmission Current Gear (SPN 525) will reflect that gear.','Electronic Transmission Controller 2','4','100 ms','gear value','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(583,61445,526,'Transmission Actual Gear Ratio',16,'Actual ratio of input shaft speed to output shaft speed.','Electronic Transmission Controller 2','2-3','100 ms','Ratio','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(584,61445,162,'Transmission Requested Range',16,'Range selected by the operator.  Characters may include P, Rx, Rx-1...R2, R1, R, Nx, Nx-1...N2, N1, N, D, D1, D2..., Dx, L, L1, L2..., Lx-1, 1, 2, 3,...  If only one displayed character is required, the second character shall be used and the first character shall be a space (ASCII 32) or a control character (ASCII 0 to 31).  If the first character is a control character, refer to the manufacturer’s application document for definition.','Electronic Transmission Controller 2','5-6','100 ms','ASCII','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(585,61445,163,'Transmission Current Range',16,'Range currently being commanded by the transmission control system. Characters may include P, Rx, Rx-1...R2, R1, R, Nx, Nx-1...N2, N1, N, D, D1, D2..., Dx, L, L1, L2..., Lx-1, 1, 2, 3,... If only one displayed character is required, the second character shall be used and the first character shall be a space (ASCII 32) or a control character (ASCII 0 to 31).  If the first character is a control character, refer to the manufacturer’s application document for definition.','Electronic Transmission Controller 2','7-8','100 ms','ASCII','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(586,61446,927,'Location',8,'To identify to which of several similar devices (such as tires or fuel tanks) the information applies.
INSERT INTO experimenteditor_spnpgnentry VALUES(587,61446,567,'Differential Lock State - Front Axle 1',2,'State used which indicates the condition of the front axle 1 differential lock.  The differential locks are located as defined in figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(588,61446,568,'Differential Lock State - Front Axle 2',2,'State used which indicates the condition of the front axle 2 differential lock. The differential locks are located as defined in figure SPN 564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(589,61446,569,'Differential Lock State - Rear Axle 1',2,'State used which indicates the condition of the rear axle 1 differential lock.  The differential locks are located as defined in figure SPN 564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(590,61446,570,'Differential Lock State - Rear Axle 2',2,'State used which indicates the condition of the rear axle 2 differential lock.  The differential locks are located as defined in figure SPN 564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(591,61446,564,'Differential Lock State - Central',2,'State used which indicates the condition of the central differential lock.  The differential locks are located as defined in attached figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(592,61446,565,'Differential Lock State - Central Front',2,'State used which indicates the condition of the central front differential lock.  The differential locks are located as defined in figure SPN564_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(593,61446,566,'Differential Lock State - Central Rear',2,'State used which indicates the condition of the central rear differential lock.  The differential locks are located as defined in figure SPN564_A.
