INSERT INTO experimenteditor_spnpgnentry VALUES(596,61447,3565,'Lane Departure Left',2,'Indicates that the middle of vehicle departs the lane on the left side. The parameter indicates that the vehicle is changing the lane to the left.
INSERT INTO experimenteditor_spnpgnentry VALUES(597,61447,3566,'Lane Departure Right',2,'Indicates that the middle of vehicle departs the lane on the right side. The parameter indicates that the vehicle is changing the lane to the right.
INSERT INTO experimenteditor_spnpgnentry VALUES(598,61447,1701,'Lane Departure Imminent, Right Side',2,'Indicates departure imminent on right side of lane.
INSERT INTO experimenteditor_spnpgnentry VALUES(599,61447,1700,'Lane Departure Imminent, Left Side',2,'Indicates departure imminent on left side of lane.
INSERT INTO experimenteditor_spnpgnentry VALUES(600,61448,1763,'Engine Hydraulic Pressure Governor Mode Indicator',2,'Mode for governor operation is hydraulic pressure control.
INSERT INTO experimenteditor_spnpgnentry VALUES(601,61448,1764,'Engine Hydraulic Pressure Governor Switch',2,'Switch that sets the  mode of hydraulic governor
INSERT INTO experimenteditor_spnpgnentry VALUES(602,61448,2599,'Fire Apparatus Pump Engagement',2,'The measured status of the pump used to provide water in fire fighting apparatus for distribution of water through water cannons or fire hoses.
INSERT INTO experimenteditor_spnpgnentry VALUES(603,61448,1762,'Hydraulic Pressure',16,'Hydraulic pressure measured at the output of the hydraulic pump.','Hydraulic Pressure Governor Info','1-2','50 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(604,61449,1811,'Steering Wheel Turn Counter',6,'Indicates number of steering wheel turns, absolute position or relative position at ignition on. Positive values indicate left turns.','Vehicle Dynamic Stability Control 2','3.1','10 ms','count','-32','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(605,61449,1812,'Steering Wheel Angle Sensor Type',2,'Indicates whether the steering wheel angle sensor is capable of absolute measuring of the number of steering wheel turns or not (relative measuring to position at ignition on).
INSERT INTO experimenteditor_spnpgnentry VALUES(606,61449,1810,'Longitudinal Acceleration',8,'Indicates the longitudinal acceleration of the vehicle. A positive longitudinal acceleration signal results when the vehicle speed increases, regardless of driving the vehicle forward or backward.  This parameter is applicable to vehicle speed measurement systems, such as passive wheel speed sensors, that are not capable of determining the direction of the vehicle motion.  See SPN 5348 for an alternate longitudinal acceleration.','Vehicle Dynamic Stability Control 2','8','10 ms','m/s²','-12.5','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(607,61449,1807,'Steering Wheel Angle',16,'The main operator`s steering wheel angle (on the steering column, not the actual wheel angle).  The vehicle being steered to the left (counterclockwise) results in a positive steering wheel angle.  This is the yaw angle of the steering wheel with the z-axis along the centerline of the steering column. This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.','Vehicle Dynamic Stability Control 2','1-2','10 ms','rad','-31.374','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(608,61449,1808,'Yaw Rate',16,'Indicates the rate of rotation about the vertical axis (i.e. the z-axis).  A positive yaw rate signal results when the vehicle turns counter-clockwise.   This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.  See SPN 4985 for an alternate range and resolution using a Z-Down Axis System.','Vehicle Dynamic Stability Control 2','4-5','10 ms','rad/s','-3.92','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(609,61449,1809,'Lateral Acceleration',16,'Indicates a lateral acceleration of the vehicle (the component of vehicle acceleration vector along the Y-axis). A positive lateral acceleration signal results when the vehicle is accelerated to the left.  This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.  See SPN 5347 for an alternate range and resolution.','Vehicle Dynamic Stability Control 2','6-7','10 ms','m/s²','-15.687','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(610,61450,2659,'Engine Exhaust Gas Recirculation 1 (EGR1) Mass Flow Rate',16,'Flow rate of gas through the EGR system. Flow rate of the exhaust gas being recirculated into the combustion air.','Engine Gas Flow Rate','1-2','50 ms','kg/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(611,61450,132,'Engine Intake Air Mass Flow Rate',16,'Mass flow rate of fresh air entering the engine air intake, before any EGR mixer, if used.  Flow rate of fresh air conducted to the engine cylinders to support combustion.','Engine Gas Flow Rate','3-4','50 ms','kg/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(612,61450,5257,'Engine Exhaust Gas Recirculation 2 (EGR2) Mass Flow Rate',16,'Flow rate of gas through the second EGR system. Flow rate of the exhaust gas being recirculated from the 2nd EGR system into combustion air.','Engine Gas Flow Rate','5-6','50 ms','kg/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(613,61451,2928,'Axle Location',8,'To identify to which of several similar devices (such as tires or fuel tanks) the information applies.
INSERT INTO experimenteditor_spnpgnentry VALUES(614,61451,2923,'Status of Steering Axle',4,'A signal which indicates different states of the steering axle
INSERT INTO experimenteditor_spnpgnentry VALUES(615,61451,2922,'Steerable Lift Axle Lowering Inhibit',2,'A signal which indicates if lowering of lifted axle is allowed or inhibited.
INSERT INTO experimenteditor_spnpgnentry VALUES(616,61451,2924,'Steering Type',4,'Indicates the different types of steering systems (ref. ECE Regulation 79 paragraph 2.5)
INSERT INTO experimenteditor_spnpgnentry VALUES(617,61451,2925,'Type of Steering Forces',4,'Type of Steering Forces (Ref. ECE Regulation 79 paragraph 2.5)
INSERT INTO experimenteditor_spnpgnentry VALUES(618,61451,2926,'Type of Steering Transmission',4,'Type of Steering Transmission (Ref. ECE Regulation 79 paragraph 2.6)
INSERT INTO experimenteditor_spnpgnentry VALUES(619,61451,2927,'Actual Inner wheel steering angle',16,'Signal which indicates the actual inner wheel steering angle.  The steering angle is the angle of wheel turn relative to the vehicle x-axis (yaw angle of inner wheel). See Figure SPN2927_A for explanation of positive and negative angles.  This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.','Electronic Steering Control','1-2','20 ms','deg','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(620,61452,3030,'Transmission Torque Converter Ratio',16,'Ratio of the transmissions torque converter output torque to torque converter input torque at current speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(621,61452,5052,'Transmission Clutch/Converter Input Speed',16,'Rotational velocity of the input to a transmission''s master clutch or torque converter. In most cases the rotational velocity will be the same as engine flywheel speed unless there is an intermediate device, such as a power divider, between the engine and the clutch/converter.','Electronic Transmission Controller #8','3-4','20 ms when torque converter unlocked, 100 ms when torque converter locked','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(622,61453,3156,'Blade Control Mode Switch',4,'This parameter indicates the blade control mode switch state the user has set for the land leveling system.  The switch value directly correlates to the current switch state, regardless of the switch being used.  This parameter is intended for use in systems using only one parameter to control the blade movement (i.e. elevation).  Systems using two independent parameters to control blade position, i.e. one blade edge maintains a constant elevation and the other blade edge maintains a constant blade angle, should use parameters specific to that usage. Only one of the following states will be active at a time.   Below are the data values defined for each switch type that may be used in this application.  The purpose of the following switch information is to define what data should be reported based on what type of switch is used.
INSERT INTO experimenteditor_spnpgnentry VALUES(623,61453,3157,'Desired Grade Offset Switch',4,'This parameter indicates the grade offset switch state the user has set for the land leveling system.  The desired grade offset value is the vertical offset measured from a given elevation reference point to the bottom edge of the blade.  This parameter is intended for use in systems using only elevation offset to control the blade movement (i.e. elevation).  Systems using two independent parameters to control blade position, i.e. one edge maintains a constant elevation and the other blade edge maintains a constant angle, should use parameters specific to that usage. Only one of the following states will be active at a time.   Below are the data values defined for each switch type that may be used in this application.  The purpose of the following switch information is to define what data should be reported based on what type of switch is used.
INSERT INTO experimenteditor_spnpgnentry VALUES(624,61453,3158,'Blade Auto Mode Command',4,'Allows other controllers to command to the primary control system what they think is the appropriate auto control mode to be engaged in, based on the information they have available to them.  When in automatic mode, the blade automatically adjusts its position to the center of the blade to maintain a desired grade offset.  Only one of the following states will be active at a time.  Below is extended information describing each command.  The purpose of this information is to define what command state should be reported based on what auto control mode command is deemed appropriate by the operational specifications of the system.
INSERT INTO experimenteditor_spnpgnentry VALUES(625,61453,3334,'Left Blade Control Mode Operator Control',4,'This parameter indicates the left blade control mode operator control state the user has set for the land leveling system.  The operator control value directly relates to the current operator control state correlating to the left edge of the blade.  The purpose of this parameter is to set the control mode (auto/manual) for the left side of the blade. For this system, the left and right side of the blade can be adjusted independently of each other to either change the elevation from a given reference point or the blade angle (also known as blade tilt)/cross slope depending on the function requested by the operator.
INSERT INTO experimenteditor_spnpgnentry VALUES(626,61453,3335,'Right Blade Control Mode Operator Control',4,'This parameter indicates the right blade control mode operator control state the user has set for the land leveling system.  The operator control value directly relates to the current operator control state correlating to the left edge of the blade.  The purpose of this parameter is to set the control mode (auto/manual) for the left side of the blade. For this system, the left and right side of the blade can be adjusted independently of each other to either change the elevation from a given reference point or the blade angle (also known as blade tilt)/cross slope depending on the function requested by the operator.
INSERT INTO experimenteditor_spnpgnentry VALUES(627,61453,3336,'Left Desired Blade Offset Operator Control',4,'This parameter indicates the left blade offset operator control state the user has set for the land leveling system.  The left desired blade offset value is the offset measured from a given reference point to the bottom left edge of the blade. This parameter will only be used when the control mode for land leveling system has been set to auto. The purpose of this parameter is to adjust the elevation from a given reference point or the blade angle(also known as blade tilt)/cross slope depending on the function being requested by the operator for the left side of the blade.
INSERT INTO experimenteditor_spnpgnentry VALUES(628,61453,3337,'Right Desired Blade Offset Operator Control',4,'This parameter indicates the right blade offset operator control state the user has set for the land leveling system.  The right desired blade offset value is the offset measured from a given reference point to the bottom right edge of the blade. This parameter will only be used when the control mode for land leveling system has been set to auto. The purpose of this parameter is to adjust the elevation from a given reference point or the blade angle(also known as blade tilt)/cross slope depending on the function being requested by the operator for the left side of the blade.
INSERT INTO experimenteditor_spnpgnentry VALUES(629,61453,3338,'Side-shift Blade Control Mode Operator Control',4,'This parameter indicates the side-shift offset operator control state the user has set for the land leveling system. When an implement moves in a side-shift direction, it moves from side to side, usually along its longitudinal axis. The desired side-shift offset value is the offset measured from a given vertical reference point to the center of the blade.
INSERT INTO experimenteditor_spnpgnentry VALUES(630,61453,3339,'Side-shift Desired Blade Offset Operator Control',4,'This parameter indicates the side-shift blade control mode operator control state the user has set for the land leveling system.  When an implement moves in a side-shift direction, it moves from side to side, usually along its longitudinal axis.
INSERT INTO experimenteditor_spnpgnentry VALUES(631,61453,5405,'Set Elevation Sensor #1 Reference Elevation',2,'Command from a display or other external device (i.e. remote switch) to the land leveling system controller instructing the controller to set the reference elvation based on data received from the corresponding land leveling sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(632,61453,5406,'Set Elevation Sensor #2 Reference Elevation',2,'Command from a display or other external device (i.e. remote switch) to the land leveling system controller instructing the controller to set the reference elvation based on data received from the corresponding land leveling sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(633,61454,3218,'Aftertreatment 1 Intake Gas Sensor Power Status',2,'Indicates that the power supplied to the aftertreatment intake gas sensor, either NOx or O2, is within the manufacturer’s specification in exhaust bank 1.  This parameter reports the status as reported by the sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(634,61454,3219,'Aftertreatment 1 Intake Gas Sensor at Temperature',2,'Indicates that the heater element of the aftertreatment intake gas sensor, either NOx or O2, is within the manufacturer’s specified range for accurate measurements in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(635,61454,3220,'Aftertreatment 1 Intake NOx Reading Stable',2,'Indicates that the NOx reading of the aftertreatment intake NOx sensor is stable as determined by the manufacturer’s control software in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(636,61454,3221,'Aftertreatment 1 Intake Wide-Range % O2 Reading Stable',2,'Indicates that the %O2 reading of the aftertreatment intake gas sensor, either NOx or O2, is stable as determined by the manufacturer''s control software in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(637,61454,3222,'Aftertreatment 1 Intake Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the intake exhaust gas sensor, either NOx or O2, by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Intake Gas 1','6.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(638,61454,3223,'Aftertreatment 1 Intake Gas Sensor Heater Control',2,'Indicates the heater status in the warm-up process.  Upon receiving a power-up command, the gas sensor ramps up according to a manufacturer defined profile.  The Preheat 1, Preheat 2, and Automatic messages are regions within this profile in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(639,61454,3224,'Aftertreatment 1 Intake NOx Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment intake NOx sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Intake Gas 1','7.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(640,61454,5713,'NOx Sensor ATO1 Self-diagnosis Status',3,'Self-diagnosis result status for NOx sensor ATO1
INSERT INTO experimenteditor_spnpgnentry VALUES(641,61454,3225,'Aftertreatment 1 Intake Oxygen Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment intake oxygen sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Intake Gas 1','8.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(642,61454,3216,'Aftertreatment 1 Intake NOx',16,'The amount of combined NO and NO2 in the exhaust entering the aftertreatment system measured by a NOx sensor at the aftertreatment intake, represented in NOx molecule parts per million non-NOx molecules in exhaust bank 1.','Aftertreatment 1 Intake Gas 1','1-2','50 ms','ppm','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(643,61454,3217,'Aftertreatment 1 Intake O2',16,'The actual oxidation factor (%O2) of the gas within the exhaust stream.  For positive values, the parameter represents the percent oxygen in excess of the amount required for stoichiometric combustion.  For negative values, the parameter is proportional to the amount of oxygen being pumped by the sensor.  This value is measured by a sensor at the aftertreatment intake in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(644,61455,3228,'Aftertreatment 1 Outlet Gas Sensor Power Status',2,'Indicates that the power supplied to the aftertreatment outlet gas sensor, either NOx or O2, is within the manufacturer’s specification in exhaust bank 1. This parameter reports the status as reported by the sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(645,61455,3229,'Aftertreatment 1 Outlet Gas Sensor at Temperature',2,'Indicates that the heater element of the aftertreatment outlet gas sensor, either NOx or O2, is within the manufacturer’s specified range for accurate measurements in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(646,61455,3230,'Aftertreatment 1 Outlet NOx Reading Stable',2,'Indicates that the NOx reading of the aftertreatment outlet NOx sensor is stable as determined by the manufacturer’s control software in exhaust bank 1.
