INSERT INTO experimenteditor_spnpgnentry VALUES(659,61456,3261,'Aftertreatment 2 Intake Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the intake exhaust gas sensor, either NOx or O2, by the manufacturer’s sensor control software in exhaust bank 2.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated. (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)','Aftertreatment 2 Intake Gas 1','6.1','50 ms','binary','0','8');
