INSERT INTO experimenteditor_spnpgnentry VALUES(664,61456,3255,'Aftertreatment 2 Intake NOx',16,'The amount of combined NO and NO2 in the exhaust entering the aftertreatment system measured by a NOx sensor at the aftertreatment intake, represented in NOx molecule parts per million non-NOx molecules in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247.)','Aftertreatment 2 Intake Gas 1','1-2','50 ms','ppm','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(665,61456,3256,'Aftertreatment 2 Intake O2',16,'The actual oxidation factor (%O2) of the gas within the exhaust stream.  For positive values, the parameter represents the percent oxygen in excess of the amount required for stoichiometric combustion.  For negative values, the parameter is proportional to the amount of oxygen being pumped by the sensor.  This value is measured by a sensor at the aftertreatment intake in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(666,61457,3267,'Aftertreatment 2 Outlet Gas Sensor Power Status',2,' Indicates that the power supplied to the aftertreatment outlet gas sensor, either NOx or O2, is within the manufacturer’s specification in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(667,61457,3268,'Aftertreatment 2 Outlet Gas Sensor at Temperature',2,'Indicates that the heater element of the aftertreatment outlet gas sensor, either NOx or O2, is within the manufacturer’s specified range for accurate measurements in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(668,61457,3269,'Aftertreatment 2 Outlet NOx Reading Stable',2,'Indicates that the NOx reading of the aftertreatment outlet NOx sensor is stable as determined by the manufacturer’s control software in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(669,61457,3270,'Aftertreatment 2 Outlet Wide-Range % O2 Reading Stable',2,'Indicates that the %O2 reading of the aftertreatment outlet gas sensor, either NOx or O2, is stable as determined by the manufacturer''s control software in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(670,61457,3271,'Aftertreatment 2 Outlet Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the outlet exhaust gas sensor, either NOx or O2, by the manufacturer’s sensor control software in exhaust bank 2.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)','Aftertreatment 2 Outlet Gas 1','6.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(671,61457,3272,'Aftertreatment 2 Outlet Gas Sensor Heater Control',2,'Indicates the heater status in the warm-up process.  Upon receiving a power-up command, the gas sensor ramps up according to a manufacturer defined profile.  The Preheat 1, Preheat 2, and Automatic messages are regions within this profile in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(672,61457,3273,'Aftertreatment 2 Outlet NOx Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment outlet NOx sensor by the manufacturer’s sensor control software in exhaust bank 2.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)','Aftertreatment 2 Outlet Gas 1','7.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(673,61457,5716,'NOx Sensor ATI2 Self-diagnosis Status',3,'Self-diagnosis result status for NOx sensor ATI2
INSERT INTO experimenteditor_spnpgnentry VALUES(674,61457,3274,'Aftertreatment 2 Outlet Oxygen Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment outlet oxygen sensor by the manufacturer’s sensor control software in exhaust bank 2.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)','Aftertreatment 2 Outlet Gas 1','8.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(675,61457,3265,'Aftertreatment 2 Outlet NOx',16,'The amount of combined NO and NO2 in the exhaust entering the aftertreatment system measured by a NOx sensor at the aftertreatment outlet, represented in NOx molecule parts per million non-NOx molecules in exhaust bank 2. (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)','Aftertreatment 2 Outlet Gas 1','1-2','50 ms','ppm','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(676,61457,3266,'Aftertreatment 2 Outlet O2',16,'The actual oxidation factor (%O2) of the gas within the exhaust stream.  For positive values, the parameter represents the percent oxygen in excess of the amount required for stoichiometric combustion.  For negative values, the parameter is proportional to the amount of oxygen being pumped by the sensor.  This value is measured by a sensor at the aftertreatment outlet in exhaust bank 2.  (For a single exhaust bank system, refer to parameters in PGNs 61454, 61455,  64946, 64947, 64948, and 65247)
INSERT INTO experimenteditor_spnpgnentry VALUES(677,61458,3317,'Fifth Wheel Roll Warning Indicator',2,'Indicates to the vehicle operator that the roll moment has exceeded a preset limit. 
INSERT INTO experimenteditor_spnpgnentry VALUES(678,61458,3308,'Fifth Wheel Vertical Force',16,'The amount of load being applied to the fifth wheel by the trailer. Zero load is indicated without a trailer.','Fifth Wheel Smart Systems 1','1-2','50 ms','N','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(679,61458,3309,'Fifth Wheel Drawbar Force',16,'Fifth wheel drawbar force, with the trailer held stationary a positive force is generated by the vehicle pulling forward.','Fifth Wheel Smart Systems 1','3-4','50 ms','N','-320000','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(680,61458,3310,'Fifth Wheel Roll Moment ',16,'Fifth wheel roll moment force - If the moment is positive, the trailer is rolling clockwise relative to the normal vehicle forward motion.','Fifth Wheel Smart Systems 1','5-6','50 ms','N','-320000','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(681,61459,3323,'Pitch Angle Figure of Merit',2,'Figure of merit for pitch angle measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(682,61459,3324,'Roll Angle Figure of Merit',2,'Figure of merit for roll angle measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(683,61459,3325,'Pitch Rate Figure of Merit',2,'Figure of merit for the pitch rate measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(684,61459,3326,'Pitch and Roll Compensated',2,'Compensated mode for the pitch and roll measurements.  Compensation is the use of multiple sensors together to enhance the output of pitch and roll measurements.
INSERT INTO experimenteditor_spnpgnentry VALUES(685,61459,3327,'Roll and Pitch Measurement Latency',8,'The estimated measurement latency of the measurement.  NOTE: This is only the sensor latency and does not include any additional latencies that might exist because of the CAN Bus or overall system implementation. 
INSERT INTO experimenteditor_spnpgnentry VALUES(686,61459,3318,'Pitch Angle',16,'The angle between the vehicle x-axis and the ground plane (i.e. rotation about the vehicle Y-axis).  The pitch angle for an angle of ascent is reported with a positive value. This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.  See SPN 4976 for an alternate range and resolution.','Slope Sensor Information','1-2','10 ms','deg','-64','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(687,61459,3319,'Roll Angle',16,'The angle between the vehicle y-axis and the ground plane (i.e. rotation about the X-axis).  The roll angle for a roll to the right is reported with a positive value. Roll angle is the same for both Z-Down and Z-Up axis systems, since both systems have positive X axis directed forward.  The sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  See SPN 4977 for an alternate range and resolution.','Slope Sensor Information','3-4','10 ms','deg','-64','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(688,61459,3322,'Pitch Rate',16,'Pitch rate is the rate-of-change of the pitch angle over time, where the pitch angle vector is in the direction of travel of the vehicle. The pitch rate for increasing ascent over time is reported with a positive value. This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.  See SPN 4983 for an alternate range and resolution.','Slope Sensor Information','5-6','10 ms','deg/sec','-64','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(689,61460,3366,'Relative Blade Height and Blade Rotation Angle Measurement Latency',8,'The estimated measurement latency of the measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(690,61460,3367,'Relative Blade Height Figure of Merit',2,'Figure of merit for blade height measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(691,61460,3332,'Blade Rotation Angle Figure of Merit',2,'Figure of merit for blade rotation measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(692,61460,3365,'Relative Blade Height',16,'The measured vertical distance from a fixed location on the machine blade to a ground-based reference (i.e. relative height).  Examples of a ground based reference include a curb, a stringline or the ground itself.  The measurement may be positive or negative based on the initial reference used.','Blade Information','1-2','50 ms','m','-3.2','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(693,61460,3331,'Blade Rotation Angle',16,'The blade rotation angle measurement around the yaw (z-axis).  The Blade Rotation Angle is defined to be the angle from the null position on the machine.  The null position is orthogonal from the z-axis along the x-axis.  A positive blade angle results when the blade is rotated clockwise from the null position. This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.','Blade Information','3-4','50 ms','deg','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(694,61461,3385,'Requested Generator Overall Power Factor Lagging',2,'The requested lead/lag status for the generator average AC power factor
INSERT INTO experimenteditor_spnpgnentry VALUES(695,61461,3383,'Requested Generator Total AC Reactive Power',32,'The total reactive power requested to be delivered by the generator','Requested Generator Total AC Reactive Power','1-4','100 ms','VA','-2000000000','8');
