INSERT INTO experimenteditor_spnpgnentry VALUES(745,61466,3464,'Engine Throttle Actuator 1 Control Command',16,'The control command to throttle actuator 1, normalized to percent, where 0% represents fully closed and 100% represents fully open.  Typically, this throttle actuator is used to regulate air or air / fuel mix to the engine. Using the standard convention for determining the position.  Left/front is #1 and right/rear is #2 (SPN 3465).','Engine Throttle / Fuel Actuator Control Command','1-2','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(746,61466,3465,'Engine Throttle Actuator 2 Control Command',16,'The control command to throttle actuator 2, normalized to percent, where 0% represents fully closed and 100% represents fully open.  Typically, this throttle actuator is used to regulate air or air / fuel mix to the engine. Using the standard convention for determining the position.  Left/front is #1 (SPN 3464) and right/rear is #2.','Engine Throttle / Fuel Actuator Control Command','3-4','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(747,61466,633,'Engine Fuel Actuator 1 Control Command',16,'The control command to fuel actuator 1, normalized to percent, where 0% represents fully closed and 100% represents fully open.  Typically, this fuel actuator is used to regulate low pressure natural gas flow rate, mixing into the air flow, which together then come into the engine. Using the standard convention for determining the position.  Left/front is #1 and right/rear is #2 (SPN 1244).','Engine Throttle / Fuel Actuator Control Command','5-6','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(748,61466,1244,'Engine Fuel Actuator 2 Control Command',16,'The control command to fuel actuator 2, normalized to percent, where 0% represents fully closed and 100% represents fully open.  Typically, this fuel actuator is used to regulate low pressure natural gas flow rate, mixing into the air flow, which together then come into the engine. Using the standard convention for determining the position.  Left/front is #1 (SPN 633) and right/rear is #2.','Engine Throttle / Fuel Actuator Control Command','7-8','50 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
