INSERT INTO experimenteditor_spnpgnentry VALUES(750,61468,3386,'Requested Generator Average Line-Line AC RMS Voltage',32,'The requested average AC RMS voltage to be delivered by the generator.','Requested Generator Average Basic AC Quantities','1-4','100 ms','Volts','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(751,61469,3684,'Steering Wheel Angle Range Counter',6,'The signal indicates the number of steering wheel angle range overflows if the operating range of steering wheel is greater than the measuring range of sensor element. Positive values indicate left turns (counterclockwise). If the steering wheel angle range is +/-180 degrees this signal is equivalent to a steering wheel turn counter.  This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.','Steering Angle Sensor Information','3.1','10 ms','range','-32','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(752,61469,3685,'Steering Wheel Angle Range Counter Type',2,'The signal indicates whether the steering wheel angle sensor is capable of absolute measuring of the number of steering wheel angle ranges or not.  Absolute measuring means that the steering wheel angle range counter signal indicates the real position of steering wheel at ignition on.  Relative measuring means that the steering wheel angle range counter signal is zero at ignition on independent of the real position of steering wheel.
INSERT INTO experimenteditor_spnpgnentry VALUES(753,61469,3687,'Steering Angle Sensor Active Mode',2,'This signal indicates the operational mode of the steering angle sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(754,61469,3688,'Steering Angle Sensor Calibrated',2,'This signal indicates the calibration status of the steering angle sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(755,61469,3689,'Message Counter',4,'The message counter is to verify the signal path from the demanding device to the steering controller.  The support of this parameter is mandatory.
INSERT INTO experimenteditor_spnpgnentry VALUES(756,61469,3690,'Message Checksum',4,'The message checksum is used to verify the signal path from the demanding device to the steering controller.  The support of this parameter is mandatory if PGN 61469 is supported as there is no means to indicate “not available”.
INSERT INTO experimenteditor_spnpgnentry VALUES(757,61469,3683,'Steering Wheel Angle',16,'The main operator`s steering wheel angle (on the steering column, not the actual wheel angle). The vehicle being steered to the left (counterclockwise) results in a positive steering wheel angle.  This is the yaw angle of the steering wheel with the z-axis along the centerline of the steering column. This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.','Steering Angle Sensor Information','1-2','10 ms','rad','-31.374','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(758,61469,3686,'Steering Wheel Angle Range',16,'The signal indicates the range of  the steering wheel angle the sensor element is capable to measure. The steering wheel angle signal ranges between the negative and the positive value of the steering wheel angle range.
INSERT INTO experimenteditor_spnpgnentry VALUES(759,61470,3938,'Generator Governing Bias',16,'Control signal used to govern the genset''s speed or load (depending on isochronous or utility parallel operation, respectively)
INSERT INTO experimenteditor_spnpgnentry VALUES(760,61471,NULL,'',NULL,'','Electronic Brake System #2/6','1','10 ms +/- 1 ms','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(761,61472,NULL,'',NULL,'','Electronic Brake System #2/5','1','10 ms +/- 1 ms','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(762,61473,4205,'Engine Speed Sensor 3 Timing Pattern Status',2,'This is the timing pattern status of the engine speed sensor signal for sensor 3.  The sensor may be sending a speed signal but the pattern may not be valid.  Since the speed is considered valid, the error indicator will not be used in the engine speed parameter (SPN 4202).
INSERT INTO experimenteditor_spnpgnentry VALUES(763,61473,4204,'Engine Speed Sensor 2 Timing Pattern Status',2,'This is the timing pattern status of the engine speed sensor signal for sensor 2.  The sensor may be sending a speed signal but the pattern may not be valid.  Since the speed is considered valid, the error indicator will not be used in the engine speed parameter (SPN 723).
INSERT INTO experimenteditor_spnpgnentry VALUES(764,61473,4203,'Engine Speed Sensor 1 Timing Pattern Status',2,'This is the timing pattern status of the engine speed sensor signal for sensor 1.   The sensor may be sending a speed signal but the pattern may not be valid.  Since the speed is considered valid, the error indicator will not be used in the engine speed parameter (SPN 4201).  The sensor does give a speed but the pattern is not matched.  In this condition, the position of the crank has not been determined so injection is not enabled.  The engine speed signal provides both engine speed and crankshaft location information to the engine control.  A \'Not OK\' status may be caused by extra or missing teeth, gear runout, etc.
INSERT INTO experimenteditor_spnpgnentry VALUES(765,61473,4201,'Engine Speed 1',16,'The engine speed as measured by speed sensor 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(766,61473,723,'Engine Speed 2',16,'The engine speed as measured by speed sensor 2
INSERT INTO experimenteditor_spnpgnentry VALUES(767,61473,4202,'Engine Speed 3',16,'The engine speed as measured by speed sensor 3.
