INSERT INTO experimenteditor_spnpgnentry VALUES(769,61474,4308,'Machine selected speed source',3,'Indicates the speed source that is currently being reported in the machine speed parameter.
INSERT INTO experimenteditor_spnpgnentry VALUES(770,61474,4307,'Persistent limit status',3,'Reports the tractor ECU''s present limit status associated with a parameter whose commands are presistent  (i.e. hitch position).
INSERT INTO experimenteditor_spnpgnentry VALUES(771,61474,4305,'Machine selected speed',16,'Reports the value of one of the currently available machine speeds (wheel, ground, or navigational-based) which the machine has determined to best represent the machine''s speed.','Machine Selected Speed','1-2','100 ms','m/s','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(772,61474,4306,'Machine selected distance',32,'Actual distance traveled by the machine based on the value of selected machine speed.  When distance exceeds 4211081.215 m, the value should be reset to zero and incremented as additional distance accrues.','Machine Selected Speed','3-6','100 ms','m','0','8');
