INSERT INTO experimenteditor_spnpgnentry VALUES(779,61476,4350,'Aftertreatment 1 Diesel Exhaust Fluid Requested Quantity of Integrator',16,'Represents the command for the diesel exhaust fluid quantity integrator in the dosing control unit','Aftertreatment 1 SCR Dosing System Requests 1','4-5','50 ms','g','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(780,61477,4378,'Aftertreatment 1 Outlet NH3 Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment outlet NH3 sensor by the manufacturer’s sensor control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 SCR Ammonia Information','3.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(781,61477,4379,'Aftertreatment 1 Outlet NH3 Reading Stable',2,'Indicates that the NH3 reading of the aftertreatment outlet NH3 sensor is stable as determined by the manufacturer’s control software in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(782,61477,4380,'Aftertreatment 1 Outlet NH3 Gas Sensor Power In Range',2,'Indicates that the power supplied to the aftertreatment outlet NH3 gas sensor is within the manufacturer’s specification in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(783,61477,4381,'Aftertreatment 1 Outlet NH3 Gas Sensor at Temperature',2,'Indicates that the heater element of the aftertreatment outlet NH3 gas sensor is within the manufacturer’s specified range for accurate measurements in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(784,61477,4382,'Aftertreatment 1 Outlet NH3 Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the outlet NH3 exhaust gas sensor by the manufacturer’s sensor control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 SCR Ammonia Information','5.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(785,61477,4383,'Aftertreatment 1 Outlet NH3 Gas Sensor Heater Control',2,'Indicates the heater status in the warm-up process. Upon receiving a power-up command, the NH3 gas sensor ramps up according to a manufacturer defined profile. The Preheat 1, Preheat 2, and Automatic messages are regions within this profile in exhaust bank 1. 
INSERT INTO experimenteditor_spnpgnentry VALUES(786,61477,4377,'Aftertreatment 1 Outlet NH3',16,'The amount of NH3 in the exhaust exiting the aftertreatment system measured by a NH3 sensor at the aftertreatment outlet, represented in NH3 molecule parts per million non-NH3 molecules in exhaust bank 1.','Aftertreatment 1 SCR Ammonia Information','1-2','50 ms','ppm','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(787,61478,4385,'Aftertreatment 2 SCR System State',4,'Actual state of SCR system
INSERT INTO experimenteditor_spnpgnentry VALUES(788,61478,4387,'Aftertreatment 2 Diesel Exhaust Fluid Dosing Absolute Pressure',8,'The SCR dosing diesel exhaust fluid absolute pressure (measured closest to dosing valve) for aftertreatment system 2 (exhaust bank 2).','Aftertreatment 2 SCR Dosing System Information 1','6','50 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(789,61478,4384,'Aftertreatment 2 Diesel Exhaust Fluid Actual Dosing Quantity',16,'Actual reducing agent quantity of SCR system.','Aftertreatment 2 SCR Dosing System Information 1','1-2','50 ms','g/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(790,61478,4386,'Aftertreatment 2 Diesel Exhaust Fluid Actual Quantity of Integrator',16,'The SCR requested diesel exhaust fluid integrator total quantity for aftertreatment system 2 (exhaust bank 2).','Aftertreatment 2 SCR Dosing System Information 1','4-5','50 ms','g','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(791,61479,4402,'Aftertreatment 2 SCR System Requested State',4,'Requested state of SCR system for aftertreatment system 2 (exhaust bank 2).
INSERT INTO experimenteditor_spnpgnentry VALUES(792,61479,4401,'Aftertreatment 2 Diesel Exhaust Fluid Dosing Requested Quantity',16,'Actual requested dosing quantity of diesel exhaust fluid.','Aftertreatment 2 SCR Dosing System Requests 1','1-2','50 ms','g/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(793,61479,4403,'Aftertreatment 2 Diesel Exhaust Fluid Requested Quantity of Integrator',16,'Represents the command for the diesel exhaust fluid quantity integrator in the dosing control unit','Aftertreatment 2 SCR Dosing System Requests 1','4-5','50 ms','g','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(794,61480,4444,'Aftertreatment 2 Outlet NH3 Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment outlet NH3 sensor by the manufacturer’s sensor control software in exhaust bank 2. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 2 SCR Ammonia Information','3.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(795,61480,4445,'Aftertreatment 2 Outlet NH3 Reading Stable',2,'Indicates that the NH3 reading of the aftertreatment outlet NH3 sensor is stable as determined by the manufacturer’s control software in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(796,61480,4446,'Aftertreatment 2 Outlet NH3 Gas Sensor Power In Range',2,'Indicates that the power supplied to the aftertreatment outlet NH3 gas sensor is within the manufacturer’s specification in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(797,61480,4447,'Aftertreatment 2 Outlet NH3 Gas Sensor at Temperature',2,'Indicates that the heater element of the aftertreatment outlet NH3 gas sensor is within the manufacturer’s specified range for accurate measurements in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(798,61480,4448,'Aftertreatment 2 Outlet NH3 Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the outlet NH3 exhaust gas sensor by the manufacturer’s sensor control software in exhaust bank 2. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 2 SCR Ammonia Information','5.1','50 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(799,61480,4449,'Aftertreatment 2 Outlet NH3 Gas Sensor Heater Control',2,'Indicates the heater status in the warm-up process. Upon receiving a power-up command, the NH3 gas sensor ramps up according to a manufacturer defined profile. The Preheat 1, Preheat 2, and Automatic messages are regions within this profile in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(800,61480,4443,'Aftertreatment 2 Outlet NH3',16,'The amount of NH3 in the exhaust exiting the aftertreatment system measured by a NH3 sensor at the aftertreatment outlet, represented in NH3 molecule parts per million non-NH3 molecules in exhaust bank 2.','Aftertreatment 2 SCR Ammonia Information','1-2','50 ms','ppm','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(801,61481,4978,'Pitch Angle Extended Range Compensation',2,'Compensated mode for the pitch measurement.  Compensation is the use of multiple sensors together to enhance the output of the pitch measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(802,61481,4979,'Pitch Angle Extended Range Figure of Merit',2,'Figure of merit for pitch angle measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(803,61481,4980,'Roll Angle Extended Range Compensation',2,'Compensated mode for the roll angle measurement.  Compensation is the use of multiple sensors together to enhance the output of the roll angle measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(804,61481,4981,'Roll Angle Extended Range Figure of Merit',2,'Figure of merit for roll angle measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(805,61481,4982,'Roll and Pitch Extended Range Measurement Latency',8,'Time between start of sensor processing and CAN transmission','Slope Sensor Information 2','8','10 ms','Milliseconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(806,61481,4976,'Pitch Angle Extended Range',24,'The angle between the vehicle x-axis and the ground plane (i.e. rotation about the vehicle Y-axis).  The pitch angle for an angle of ascent is reported with a positive value. This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.  See SPN 3318 for an alternate range and resolution.','Slope Sensor Information 2','1-3','10 ms','deg','-250','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(807,61481,4977,'Roll Angle Extended Range',24,'The angle between the vehicle y-axis and the ground plane (i.e. rotation about the X-axis).  The roll angle for a roll to the right is reported with a positive value. Roll angle is the same for both Z-Down and Z-Up axis systems, since both systems have positive X axis directed forward.  The sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  See SPN 3319 for an alternate range and resolution.','Slope Sensor Information 2','4-6','10 ms','deg','-250','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(808,61482,4986,'Pitch Rate Extended Range Figure of Merit',2,'Figure of merit for pitch rate measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(809,61482,4987,'Roll Rate Extended Range Figure of Merit',2,'Figure of merit for roll rate measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(810,61482,4988,'Yaw Rate Extended Range Figure of Merit',2,'Figure of merit for yaw angle measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(811,61482,4989,'Angular Rate Measurement Latency',8,'The estimated measurement latency of the measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(812,61482,4983,'Pitch Rate Extended Range',16,'Pitch rate is the rate-of-change of the pitch angle over time, where the pitch angle vector is in the direction of travel of the vehicle. The pitch rate for increasing ascent over time is reported with a positive value. This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.  See SPN 3322 for an alternate range and resolution.','Angular Rate Information','1-2','10 ms','deg/sec','-250','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(813,61482,4984,'Roll Rate Extended Range',16,'Roll rate is the rate-of-change of the roll angle over time.  The roll rate for increasing roll to the right is reported with a positive value. Roll angle is the same for both Z-Down and Z-Up axis systems, since both systems have positive X axis directed forward.  The sign of the value is in accordance to the right-hand rule, as specified in SAE J670.','Angular Rate Information','3-4','10 ms','deg/sec','-250','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(814,61482,4985,'Yaw Rate Extended Range',16,'Yaw rate is the rate-of-change of the yaw angle over time.  A positive yaw rate signal results when the object turns clockwise.  This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.  See SPN 1808 for Yaw Rate with an alternate range and resolution using a Z-Up Axis System.','Angular Rate Information','5-6','10 ms','deg/sec','-250','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(815,61483,4973,'Crash Type',5,'Type of crash event. 
INSERT INTO experimenteditor_spnpgnentry VALUES(816,61483,4974,'Crash Counter',4,'The Crash Counter prevents other ECUs from reacting to a faulty transmission of the Crash Notification PGN and serves as a safety mechanism. The Crash Counter becomes incremented by 1 for every sent message, starting with \'0\'. (15 follows 0)','Crash Notification','8.1','Transmitted every 20 msec for the first 100 msec and then broadcast every 1 sec for 10 sec in case of a crash event','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(817,61483,4975,'Crash Checksum',4,'The Crash Checksum is used to verify the signal path from the airbag ECU to other devices in case of a crash.
INSERT INTO experimenteditor_spnpgnentry VALUES(818,61484,5009,'Magnet Reverse Current',8,'A reverse current being supplied to the electric magnet to reduce the forward current generated magnet field as quick as possible so that the magnet can release material as fast as possible.','Magnet Status Information 2','3','50 ms','Amps','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(819,61484,5010,'Material Lift Switch',2,'This is a switch that can be used to enable the lift functionality of the Material Handler machine. When it is activated, the magnet is energized to pick up material.
INSERT INTO experimenteditor_spnpgnentry VALUES(820,61484,5011,'Material Drop Switch',2,'This is a switch that can be used to enable the drop functionality of the Material Handler machine.
INSERT INTO experimenteditor_spnpgnentry VALUES(821,61484,5012,'Generator Current Boost Active Status',2,'Status of generator current boost relay that can boost the generator output current for picking-up material operations. When this relay is \'on\', the generator is generating the maximum current for the material handler machine to pick-up material. When the relay is off, the genetator is generating normal current for the material handler machine to hold material.
INSERT INTO experimenteditor_spnpgnentry VALUES(822,61484,5013,'Material Lift Active Status',2,'The status of Material Lift Relay. When it is on, the generator generates forward direction current so that the material handler machine can pick up material.
INSERT INTO experimenteditor_spnpgnentry VALUES(823,61484,5014,'Material Drop Active Status',2,'The status of Material Drop Relay. When it is on, the generator generates reverse direction current so that the material handler machine can release material.
INSERT INTO experimenteditor_spnpgnentry VALUES(824,61484,5402,'Lift Relay Control',2,'Command signal used to Engage and Disengage the Lift Relay controlling a Steady-State Magnet.
INSERT INTO experimenteditor_spnpgnentry VALUES(825,61484,5403,'Drop Relay Control',2,'Command signal used to Engage and Disengage the Drop Relay controlling a Steady-State Magnet.
INSERT INTO experimenteditor_spnpgnentry VALUES(826,61484,5551,'Magnet Generator Control',2,'Command signal used to Enable and Disable the Generator controlling a Magnet.
INSERT INTO experimenteditor_spnpgnentry VALUES(827,61484,5008,'Magnet Forward Current',16,'The forward current being supplied by the generator to the electric magnet to create a magnet field to lift material.','Magnet Status Information 2','1-2','50 ms','Amps','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(828,61485,5350,'Lateral Acceleration Extended Range Figure of Merit',2,'Figure of merit for lateral acceleration measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(829,61485,5351,'Longitudinal Acceleration Extended Range Figure of Merit',2,'Figure of merit for longitudinal acceleration measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(830,61485,5352,'Vertical Acceleration Extended Range Figure of Merit',2,'Figure of merit for vertical acceleration measurement.
INSERT INTO experimenteditor_spnpgnentry VALUES(831,61485,5353,'Support Variable Transmission Repetition Rate for Acceleration Sensor',2,'Indicates which acceleration transmission rate are supported by the ECU in addition to the required 10 ms transmission rate.
INSERT INTO experimenteditor_spnpgnentry VALUES(832,61485,5347,'Lateral Acceleration Extended Range',16,'Indicates lateral acceleration of the vehicle (the component of vehicle acceleration vector along the Y-axis).  A positive lateral acceleration signal results when the vehicle is accelerated to the left.  This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.  See SPN 1809 for an alternate range and resolution.','Acceleration Sensor','1-2','10 ms (default) or 20 ms','m/s²','-320','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(833,61485,5348,'Longitudinal Acceleration Extended Range',16,'Indicates longitudinal acceleration of the vehicle (the component of vehicle acceleration vector along the X-axis).  A positive longitudinal acceleration signal results when the vehicle speed increases in the forward direction.  Longitudinal acceleration is the same for both Z-Down and Z-Up axis systems, since both systems have positive X axis directed forward.  The sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  See SPN 1810 for an alternate longitudinal acceleration.','Acceleration Sensor','3-4','10 ms (default) or 20 ms','m/s²','-320','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(834,61485,5349,'Vertical Acceleration Extended Range',16,'Indicates vertical acceleration of the vehicle and the effect of gravity (the component of vehicle acceleration vector along the Z-axis).  A positive vertical acceleration signal of 1 gravity results when the vehicle is stationary on a horizontal surface.  This parameter is defined according to a Z-Up axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Up Axis System has positive X directed forward, positive Y to the left, and positive Z directed up.','Acceleration Sensor','5-6','10 ms (default) or 20 ms','m/s²','-320','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(835,61486,5386,'Engine Turbocharger Wastegate Actuator 1 Command',16,'The ccommand to a Turbocharger Wastegate actuator 1, normalized to percent, where 0% nominally represents fully closed (No Flow) and 100% represents fully open (Max Flow).','Engine Turbocharger Wastegate Actuator and Exhaust Back Pressure Regulator Command','1-2','Engine speed dependent','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(836,61486,5387,'Engine Turbocharger Wastegate Actuator 2 Command',16,'The command to a Turbocharger Wastegate actuator 2, normalized to percent, where 0% nominally represents fully closed (No Flow) and 100% represents fully open (Max Flow).','Engine Turbocharger Wastegate Actuator and Exhaust Back Pressure Regulator Command','3-4','Engine speed dependent','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(837,61486,649,'Engine Exhaust Back Pressure Regulator Control Command',16,'The control command to the Engine Exhaust Back Pressure Regulator, normalized to percent.  100 percent means the regulator is fully closed, providing the maximum restriction to exhaust gas flow from the engine.  Zero percent means the regulator is fully open, providing the minimum available restriction.','Engine Turbocharger Wastegate Actuator and Exhaust Back Pressure Regulator Command','5-6','Engine speed dependent','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(838,61487,5676,'Advanced emergency braking system state',4,'Current operational state of advanced emergency braking system
INSERT INTO experimenteditor_spnpgnentry VALUES(839,61487,5677,'Collision warning status',4,'To implement different HMI (human machine interface) concepts, e.g. visual only, visual/audible, different warning tones etc., the AEBS provides different levels of collision warning status.
INSERT INTO experimenteditor_spnpgnentry VALUES(840,61487,5678,'Relevant object detected for advanced emergency braking system (AEBS)',3,'Indication if the advanced emergency braking system (AEBS) is monitoring a relevant object
INSERT INTO experimenteditor_spnpgnentry VALUES(841,61487,5679,'Bend off probability of relevant object',3,'Probabilty if monitored relevant object might start a turning maneuver, which could clear the travelling path of the host vehicle.
INSERT INTO experimenteditor_spnpgnentry VALUES(842,61487,5680,'Time to collision with relevant object',8,'The time to collision is the duration after which the predicted travelling paths of host vehicle and relevant object lead to a distance of 0m between both.
INSERT INTO experimenteditor_spnpgnentry VALUES(843,61488,5751,'Transmitter Command State',4,'The command contained in the signal received by the wireless transceiver from an off-board transmitter.
INSERT INTO experimenteditor_spnpgnentry VALUES(844,61488,5753,'Wireless Signal Strength',8,'The absolute received signal strength of the signal received from the off-board transmitter. The signal strength is reported as a Received Signal Strength Indicator (RSSI) value calculated in dBm.','Wireless Status','7','50 ms','dBm','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(845,61488,5750,'Wireless Rolling Message Counter',16,'A counter incremented with each instance of the Wireless Status message. The counter shall increment from 0 to 64255, rolling over to 0 on the next increment after 64255. The enables recipients of the Wireless Status message to detect problems with the wireless transceiver if counter fails to increment or the counter prematurely resets to 0.','Wireless Status','1-2','50 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(846,61488,5752,'Transmitter ID',24,'The ID of the off-board transmitter that sent the incoming message received by the wireless transceiver.','Wireless Status','4-6','50 ms','ID','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(847,61489,5822,'Wand Sensor Figure of Merit',2,'Figure of Merit sensor status for a wand sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(848,61489,5821,'Wand Angle',16,'A wand sensor measures the angle of deflection of a wand from its null position. This parameter reports the measured angle of a wand sensor.','Wand Sensor','1-2','20 ms','deg','-64','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(849,61490,5824,'Linear Displacement Sensor Sensor Figure of Merit',2,'Figure of Merit sensor status of Linear Displacement Sensor.
INSERT INTO experimenteditor_spnpgnentry VALUES(850,61490,5823,'Measured Linear Displacement',16,'Distance to target as measured by the Linear Displacement Sensor.','Linear Displacement Sensor','1-2','20 ms','m','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(851,61491,5849,'Aftertreatment 1 SCR Intermediate NH3 Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment SCR intermediate NH3 sensor by the manufacturer’s sensor control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 SCR Ammonia Information 2','3.1','50 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(852,61491,5850,'Aftertreatment 1 SCR Intermediate NH3 Reading Stable',2,'Indicates that the NH3 reading of the aftertreatment SCR intermediate NH3 sensor is stable as determined by the manufacturer’s control software in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(853,61491,5851,'Aftertreatment 1 SCR Intermediate NH3 Gas Sensor Power In Range',2,'Indicates that the power supplied to the aftertreatment SCR intermediate NH3 gas sensor is within the manufacturer’s specification in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(854,61491,5852,'Aftertreatment 1 SCR Intermediate NH3 Gas Sensor at Temperature',2,'Indicates that the heater element of the aftertreatment SCR intermediate NH3 gas sensor is within the manufacturer’s specified range for accurate measurements in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(855,61491,5853,'Aftertreatment 1 SCR Intermediate NH3 Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the outlet NH3 exhaust gas sensor by the manufacturer’s sensor control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 SCR Ammonia Information 2','5.1','50 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(856,61491,5854,'Aftertreatment 1 SCR Intermediate NH3 Gas Sensor Heater Control',2,'Indicates the heater status in the warm-up process. Upon receiving a power-up command, the NH3 gas sensor ramps up according to a manufacturer defined profile. The Preheat 1, Preheat 2, and Automatic messages are regions within this profile in exhaust bank 1. 
INSERT INTO experimenteditor_spnpgnentry VALUES(857,61491,5848,'Aftertreatment 1 SCR Intermediate NH3',16,'The amount of NH3 in the exhaust aftertreatment system measured by a NH3 sensor at an intermediate point in the SCR system, represented in NH3 molecule parts per million non-NH3 molecules in exhaust bank 1.','Aftertreatment 1 SCR Ammonia Information 2','1-2','50 ms','g/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(858,61492,5856,'Aftertreatment 2 SCR Intermediate NH3 Sensor Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment SCR intermediate NH3 sensor by the manufacturer’s sensor control software in exhaust bank 2. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 2 SCR Ammonia Information 2','3.1','50 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(859,61492,5857,'Aftertreatment 2 SCR Intermediate NH3 Reading Stable',2,'Indicates that the NH3 reading of the aftertreatment SCR intermediate NH3 sensor is stable as determined by the manufacturer’s control software in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(860,61492,5858,'Aftertreatment 2 SCR Intermediate NH3 Gas Sensor Power In Range',2,'Indicates that the power supplied to the aftertreatment SCR intermediate NH3 gas sensor is within the manufacturer’s specification in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(861,61492,5859,'Aftertreatment 2 SCR Intermediate NH3 Gas Sensor at Temperature',1,'Indicates that the heater element of the aftertreatment SCR intermediate NH3 gas sensor is within the manufacturer’s specified range for accurate measurements in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(862,61492,5860,'Aftertreatment 2 SCR Intermediate NH3 Gas Sensor Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the heater of the SCR intermediate NH3 exhaust gas sensor by the manufacturer’s sensor control software in exhaust bank 2. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 2 SCR Ammonia Information 2','5.1','50 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(863,61492,5861,'Aftertreatment 2 SCR Intermediate NH3 Gas Sensor Heater Control',2,'Indicates the heater status in the warm-up process. Upon receiving a power-up command, the NH3 gas sensor ramps up according to a manufacturer defined profile. The Preheat 1, Preheat 2, and Automatic messages are regions within this profile in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(864,61492,5855,'Aftertreatment 2 SCR Intermediate NH3',16,'The amount of NH3 in the exhaust exiting the aftertreatment system measured by a NH3 sensor at an intermediate point in the SCR system, represented in NH3 molecule parts per million non-NH3 molecules in exhaust bank 2.','Aftertreatment 2 SCR Ammonia Information 2','1-2','50 ms','m^3/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(865,64706,5872,'Hybrid System Warning Indicator',2,'Signal from a hybrid system indicating that some aspect of its operation is not functioning correctly, and as a result, hybrid system operation may be altered or restricted. The indicator is typically a lamp. Distinctions in meaning between the continuous and flashing states are left to the hybrid system manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(866,64706,5873,'Hybrid System Overheat Indicator',2,'Signal from a hybrid system indicating that at least one of its monitored temperatures is above normal acceptable limits, and as a result, hybrid system operation may be altered or restricted. The indicator is typically a lamp. Distinctions in meaning between the continuous and flashing states are left to the hybrid system manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(867,64706,5874,'Hybrid System Stop Indicator',2,'Signal from a hybrid system indicating that some aspect of its operation is not functioning correctly, and as a result, the vehicle must be stopped. The indicator is typically a lamp. Distinctions in meaning between the continuous and flashing states are left to the hybrid system manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(868,64707,5867,'Supply Gas Methane Percentage',16,'The percentage of methane in the gas supplied to the engine.','Fuel Information 4 (Gaseous)','1-2','200 ms','%','0','8 bytes');
INSERT INTO experimenteditor_spnpgnentry VALUES(869,64708,5865,'Aftertreatment 2 SCR Intermediate Gas Temperature Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment SCR intermediate gas temperature sensor by the manufacturer’s sensor control software in exhaust bank 2. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 2 SCR Exhaust Gas Temperature 2','3.1','500 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(870,64708,5864,'Aftertreatment 2 SCR Intermediate Gas Temperature',16,'Temperature of engine combustion byproducts at an intermediate point in the SCR component in exhaust bank 2.','Aftertreatment 2 SCR Exhaust Gas Temperature 2','1-2','500 ms','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(871,64709,5863,'Aftertreatment 1 SCR Intermediate Gas Temperature Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the aftertreatment SCR intermediate gas temperature sensor by the manufacturer’s sensor control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 SCR Exhaust Gas Temperature 2','3.1','500 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(872,64709,5862,'Aftertreatment 1 SCR Intermediate Gas Temperature',16,'Temperature of engine combustion byproducts at an intermediate point in the SCR component in exhaust bank 1.','Aftertreatment 1 SCR Exhaust Gas Temperature 2','1-2','500 ms','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(873,64710,5843,'Engine OBD Warm-up Sequence',2,'Engine warm-up as defined by the applicable region''s regulatory agency.  In the US, \'Engine OBD Warm-up\' or “Warm-up cycle” means sufficient vehicle operation such that coolant temperature rises by at least 22.2 °C (40 °F) from engine starting and reaches a minimum temperature of 71.1 °C (160 °F) for gasoline engines, and 60 °C (140 °F) for diesel engines.
INSERT INTO experimenteditor_spnpgnentry VALUES(874,64711,5844,'Model Year',64,'The compliance model year of the OBD system of the engine and or vehicle.  For example in the US, this is associated with either a vehicle model year or an engine model year, depending on how the emissions and OBD are certified.  This message shall be 8 bytes and formatted as ASCII.
INSERT INTO experimenteditor_spnpgnentry VALUES(875,64711,5845,'Certification Engine Family Name',1600,'The regulated family name per the applicable region''s certification agency.  For engines certified in the US, this shall be the 12-character engine family name or test group as defined by EPA.  Up to 200 characters may be used.  The characters are to be terminated with a 0x00 which is the \'null\' character.','Engine Emissions Certification Information','9+','On request','ASCII','0','0');
INSERT INTO experimenteditor_spnpgnentry VALUES(876,64712,5794,'Feedback Engine Fueling State',2,'This parameter provides feedback to the network that SPN 5793 Desired Engine Fueling State was honored.
INSERT INTO experimenteditor_spnpgnentry VALUES(877,64712,5795,'Engine Fueling Inhibit Allowed',2,'This parameter is broadcast by the engine control system, and indicates to other devices on the network whether or not it will respond to requests to inhibit engine fueling via SPN 5793 Desired Engine Fueling State. With this information, devices that may wish to inhibit engine fueling at some time in the future can know whether or not their request will be honored before they issue a request.
INSERT INTO experimenteditor_spnpgnentry VALUES(878,64712,5866,'Engine Fueling Inhibit Prevented Reason',4,'If Engine Fueling Inhibit Allowed (SPN 5795) indicates that the engine will not inhibit fueling, then this parameter will indicate the reason.
INSERT INTO experimenteditor_spnpgnentry VALUES(879,64713,5783,'Engine Throttle Valve 1 Temperature',8,'Temperature of the Engine Throttle Valve 1 drive circuitry.  Temperature excursions may affect the torque output.','Engine Fuel/Throttle Valve Information 2','1','100 ms','C','-40','8');
