INSERT INTO experimenteditor_spnpgnentry VALUES(982,64742,5515,'Lubrication Cycle Mode Lock Status',2,'Reports status of the ability to change the lubrication cycle mode.  Locking the lubrication mode would prevent the changing of the lubrication cycle mode, perhaps by an operator
