INSERT INTO experimenteditor_spnpgnentry VALUES(987,64742,5520,'Lubrication Timing Cycle Status',2,'Reports the status of the lubrication activation clock.
INSERT INTO experimenteditor_spnpgnentry VALUES(988,64743,5471,'Engine Friction Percent Torque At Idle, Point 1',8,'The static portion of the friction torque at speed point 1 (SPN 188) of the engine torque map in the engine configuration message.  This parameter does not include Estimated Pumping – Percent Torque (SPN 5398) and is expected to change with temperature.  The data is transmitted as a percent of the reference engine torque (SPN 544).','Engine Configuration 3','1','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(989,64743,5472,'Engine Friction Percent Torque At Idle, Point 2',8,'The static portion of the friction torque at speed point 2 (SPN 528) of the engine torque map in the engine configuration message.  This parameter does not include Estimated Pumping – Percent Torque (SPN 5398) and is expected to change with temperature.  The data is transmitted as a percent of the reference engine torque (SPN 544).','Engine Configuration 3','2','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(990,64743,5473,'Engine Friction Percent Torque At Idle, Point 3',8,'The static portion of the friction torque at speed point 3 (SPN 529) of the engine torque map in the engine configuration message.  This parameter does not include Estimated Pumping – Percent Torque (SPN 5398) and is expected to change with temperature.  The data is transmitted as a percent of the reference engine torque (SPN 544).','Engine Configuration 3','3','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(991,64743,5474,'Engine Friction Percent Torque At Idle, Point 4',8,'The static portion of the friction torque at speed point 4 (SPN 530) of the engine torque map in the engine configuration message.  This parameter does not include Estimated Pumping – Percent Torque (SPN 5398) and is expected to change with temperature.  The data is transmitted as a percent of the reference engine torque (SPN 544).','Engine Configuration 3','4','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(992,64743,5475,'Engine Friction Percent Torque At Idle, Point 5',8,'The static portion of the friction torque at speed point 5 (SPN 531) of the engine torque map in the engine configuration message.  This parameter does not include Estimated Pumping – Percent Torque (SPN 5398) and is expected to change with temperature.  The data is transmitted as a percent of the reference engine torque (SPN 544).','Engine Configuration 3','5','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(993,64743,5476,'Engine Friction Percent Torque At Idle, Point 6',8,'For engine configuration map modes 1 and 2, this is the static portion of the friction torque at speed point 6 (SPN 532) of the engine torque map.  For engine configuration map mode 3, this parameter is the static portion of the friction torque at the engine speed calculated by using Engine Gain (Kp) Of The Endspeed Governor (SPN 545) where torque is 0.  This parameter does not include Estimated Pumping – Percent Torque (SPN 5398) and is expected to change with temperature.  The data is transmitted as a percent of the reference engine torque (SPN 544)..','Engine Configuration 3','6','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','8');
