INSERT INTO experimenteditor_spnpgnentry VALUES(1008,64750,5410,'Blade Elevation Deviation - Left',16,'Indicate the blade''s left elevation deviation with respect to the reference elevation.  Serves as an indication of how far the left end of the blade is above or below grade.  A positive number indicates that the blade is above the desired grade.  A negative value indicates the blade is below the desired grade.','Land Leveling System Reference Elevation Data','1-2','200 ms','mm','-32000','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1009,64750,5411,'Blade Elevation Deviation - Right',16,'Indicate the blade''s right elevation deviation with respect to the reference elevation.  Serves as an indication of how far the left end of the blade is above or below grade.  A positive number indicates that the blade is above the desired grade.  A negative value indicates the blade is below the desired grade.','Land Leveling System Reference Elevation Data','3-4','200 ms','mm','-32000','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1010,64750,5412,'Blade Reference Elevation Offset - Left',16,'Indicates the blade''s left elevation offset with respect to the reference elevation.  An offset of 0 m represents no offset from the reference elevation.  A positive number indicates that the offset elevation is above the original reference elevation.  A negative value indicates the offset elevation is below the original reference elevation.','Land Leveling System Reference Elevation Data','5-6','200 ms','mm','-32000','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1011,64750,5413,'Blade Reference Elevation Offset - Right',16,'Indicates the blade''s right elevation offset with respect to the reference elevation.  An offset of 0 m represents no offset from the reference elevation.  A positive number indicates that the offset elevation is above the original reference elevation.  A negative value indicates the offset elevation is below the original reference elevation.','Land Leveling System Reference Elevation Data','7-8','200 ms','mm','-32000','8');
