INSERT INTO experimenteditor_spnpgnentry VALUES(1048,64756,5292,'Engine Charge Air Cooler 2 Efficiency',8,'Engine charge air cooler 2 (CAC2) is an indication of the CAC’s ability to reduce the temperature of the combustion air that is being routed through the CAC. 0% = no reduction in temperature, 100% = maximum cooling. The CAC2 efficiency is calculated as (CAC2 Intake temperature minus CAC2 outlet temperature) divided by (CAC2 Intake temperature minus CAC2 ambient air temperature).  This calculation assumes that the CAC uses a measured or estimated ambient air temperature as the cooling fluid temperature.  ','Charge Air Cooler 2','7','1 sec','%','0','8');
