INSERT INTO experimenteditor_spnpgnentry VALUES(1052,64757,5288,'Engine Charge Air Cooler 2 Precooler Efficiency',8,'Engine charge air cooler 2 (CAC2) precooler efficiency is an indication of the precooler’s ability to reduce the temperature of the gas that is being routed through the precooler. 0% = no reduction in temperature, 100% = maximum cooling. The CAC2 precooler efficiency is calculated as (CAC2 precooler Intake temperature minus CAC2 precooler outlet temperature) divided by (CAC2 precooler Intake temperature minus engine coolant temperature).  This calculation assumes that the CAC2 precooler uses engine coolant as the cooling fluid.  ','Charge Air Cooler 2 Precooler','5','1 sec','%','0','8');
