INSERT INTO experimenteditor_spnpgnentry VALUES(1055,64758,5285,'Engine Charge Air Cooler 1 Efficiency',8,'Engine charge air cooler 1(CAC1) efficiency is an indication of the CAC’s ability to reduce the temperature of the combustion air that is being routed through the CAC1. 0% = no reduction in temperature, 100% = maximum cooling. The CAC1 efficiency is calculated as (CAC1 Intake temperature minus CAC1 outlet temperature) divided by (CAC1 Intake temperature minus CAC1 ambient air temperature).  This calculation assumes that the CAC uses a measured or estimated ambient air temperature as the cooling fluid temperature.  ','Charge Air Cooler 1','5','1 sec','%','0','8');
