INSERT INTO experimenteditor_spnpgnentry VALUES(1090,64769,5141,'Low Voltage Disconnect Manual Disconnect State',2,'State of the Manual Disconnect hardwired input to the LVD.  Manual Disconnect is used to override the LVD''s normal activlty and dicconnect all of the LVD outputs.  Manual Disconnect is lower in priority than the Manual Connect hardwired input, but has priority over all LVD Set Operating Mode messages.
INSERT INTO experimenteditor_spnpgnentry VALUES(1091,64769,5142,'Low Voltage Disconnect Manual Connect State',2,'State of the Manual Connect hardwired input to the LVD.  Manual Connect is used to override the LVD''s normal activlty and connect all of the LVD outputs.  Manual Connect has priority over the Manual Dicsonnect hardwired input and all LVD Set Operating Mode messages.
INSERT INTO experimenteditor_spnpgnentry VALUES(1092,64769,5143,'Low Voltage Disconnect Current Operating Mode',4,'Current operating mode of the LVD.  The current mode is dependent on the state of the Manual Disconnect/Connect hardwired inputs and on the most-recent received LVD Set Desired Operating Mode message.  The hardwired inputs have priority over the LVD Set Operating Mode message, and Connects have priority over Disconnects.
INSERT INTO experimenteditor_spnpgnentry VALUES(1093,64769,5144,'Low Voltage Disconnect Output #3 State',4,'State of the Output #3 from the LVD.  Output #3 controls an external load or relay.  This external load could be independent of the main output, and may apply to an application specific circuit or zone.  If the LVD supports prioritization, this circuit will disconnect before Output #2 and reconnect after Output #2.
INSERT INTO experimenteditor_spnpgnentry VALUES(1094,64769,5145,'Low Voltage Disconnect Output #2 State',4,'State of the Output #2 from the LVD.  Output #2 controls an external load or relay.  This external load could be independent of the main output, and may apply to an application specific circuit or zone.  If the LVD supports prioritization, this circuit will disconnect before Output #1 and reconnect after Output #1.
INSERT INTO experimenteditor_spnpgnentry VALUES(1095,64769,5146,'Low Voltage Disconnect Output #1 State',4,'State of the Output #1 from the LVD.  Output #1 controls an external load or relay.  This external load could be independent of the main output, and may apply to an application specific circuit or zone.  If the LVD supports prioritization, this circuit will disconnect before the Vout output and reconnect after the Vout output.
INSERT INTO experimenteditor_spnpgnentry VALUES(1096,64769,5147,'Low Voltage Disconnect Vout Output State',4,'State of the Vout Output from the LVD.  Vout is the LVD''s main internal, controllable, high-current output.  If the LVD supports prioritization, this circuit will be the last to disconnect and the first to reconnect.
