INSERT INTO experimenteditor_spnpgnentry VALUES(1179,64786,5004,'Genset Softstart Active Status',2,'The Genset Softstart Active Status refers to the status of the genset softstart relay. The moment the Genset System is started, this relay is activated. As a result, the hydraulic power is hold on for a short period of time, and this relay will be turned off once the genset hydraulic power become stable.
INSERT INTO experimenteditor_spnpgnentry VALUES(1180,64786,5002,'Reverse Current Range Setting',5,'The operator setting for the Reverse Current. The setting defines the maximum reverse current. The actual current limits are specific to the application.
INSERT INTO experimenteditor_spnpgnentry VALUES(1181,64786,5005,'Genset Enable Active Status',2,'Status of the Genset Enable Relay that enables or disables the Genset.
INSERT INTO experimenteditor_spnpgnentry VALUES(1182,64786,5006,'Voltage Monitor Active Status',2,'Status of Voltage Monitor Relay. When it is activated, the Generator Voltage Monitor is connected to the generator output line so that the generator output voltage range could be monitored.
INSERT INTO experimenteditor_spnpgnentry VALUES(1183,64786,5007,'Generator Duty Cycle Exceeded Status',2,'The status of the duty cycle of the generator usage, indicating if the generator has been on for too much time within a defined time window.  The duty cycle is the ratio of the time the generator is on and the time the generator is off within a time window.
INSERT INTO experimenteditor_spnpgnentry VALUES(1184,64787,4998,'Magnet Boost Time',8,'The duration of time after the activation of the magnet circuit that a relatively high current is sent to the magnet for material pick up operations. This time is called boost time. After the boost time expires, a lower operation current is sent to the magnet to hold the material.','Magnet System Configuration Information','1','On request','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1185,64787,4999,'Magnet Rated Power',16,'The rated power that the magnet can accept during material holding operations.  Note that the magnet may experience more power over short intervals, such as during initial activation of the magnet circuit to pick up material.','Magnet System Configuration Information','2-3','On request','kW','0','8');
