INSERT INTO experimenteditor_spnpgnentry VALUES(1650,64817,1550,'Estimated Percent Fan 2 Speed',8,'Estimated fan speed as a ratio of the fan drive (current speed) to the fully engaged fan drive (maximum fan speed).  A two state fan (off/on) will use 0% and 100% respectively.  A three state fan (off/intermediate/on) will use 0%, 50% and 100% respectively.  A variable speed fan will use 0% to 100%. Multiple fan systems will use 0 to 100% to indicate the percent cooling capacity being provided.
INSERT INTO experimenteditor_spnpgnentry VALUES(1651,64817,1557,'Fan 2 Drive State',4,'This parameter is used to indicate the current state or mode of operation by the second fan drive.
INSERT INTO experimenteditor_spnpgnentry VALUES(1652,64817,1708,'Fan 2 Drive Bypass Command Status',8,'Status of the Fan Drive Bypass Command for the second fan as being commanded by the ECU.  The fan drive bypass diverts pump pressure away from the hydraulic motor to maintain the fan drive pressure.  0% is defined as no bypass (i.e. diverting no fan drive pressure) and 100% is defined as full bypass (i.e. diverting the maximum fan drive pressure) from the fan motor.','Fan Drive #2','7','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1653,64817,1598,'Fan 2 Speed',16,'The speed of the second fan associated with engine coolant system.','Fan Drive #2','3-4','1 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1654,64817,1707,'Hydraulic Fan 2 Motor Pressure',16,'The hydraulic pressure used to drive the second fan system, sensed before the hydraulic fan motor.','Fan Drive #2','5-6','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1655,64818,NULL,'',NULL,'','Reserved for ISOBUS ECU diagnostic protocol','','On request','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1656,64819,4441,'Aftertreatment 2 Diesel Exhaust Fluid Pump Drive Percentage',8,'The percent (command) sent to the motor to control the speed of  the diesel exhaust fluid pump.','Aftertreatment 2 Diesel Exhaust Fluid Supply Information','3','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1657,64819,4442,'Aftertreatment 2 Diesel Exhaust Fluid Return Valve',8,'Command to the valve which determines whether the diesel exhaust fluid is delivered to the injector or is routed back to the diesel exhaust fluid tank. Zero directs all diesel exhaust fluid flow  to the injector, 100% sends all diesel exhaust fluid back to the tank.','Aftertreatment 2 Diesel Exhaust Fluid Supply Information','4','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1658,64819,5437,'Aftertreatment 2 Diesel Exhaust Fluid Tank Fill Valve Command',8,'Commanded percentage of maximum Aftertreatment 2 Diesel Exhaust Fluid Tank Fill Valve opening. 100% means the fill valve is fully open providing maximum flow of diesel exhaust fluid into the diesel exhaust fluid tank.','Aftertreatment 2 Diesel Exhaust Fluid Supply Information','5','1 s','%','0','8');
