INSERT INTO experimenteditor_spnpgnentry VALUES(1806,64849,4199,'Desired Aftercooler Coolant Intake Temperature',8,'Indicates the desired temperature of the fluid in the low temperature aftercooler circuit to an electronic thermostat.  If the aftercooler coolant thermostat valve is operating in position control mode (see SPN 4198) then this value should be 0xFF.','Aftercooler Coolant Control Valve Command','2','1 sec','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(1807,64849,4200,'Desired Aftercooler Coolant Thermostat Opening',8,'Used to transmit the desired position of the low temperature aftercooler temperature control valve.  0% represents the thermostat allows flow to completely bypass the aftercooler and 100% represents the flow is fully through the aftercooler.   If the aftercooler coolant thermostat is operating in temperature control mode (see SPN 4198)  then this value should be 0xFF.','Aftercooler Coolant Control Valve Command','3','1 sec','%','0','8');
