INSERT INTO experimenteditor_spnpgnentry VALUES(1810,64850,4197,'Desired Engine Coolant Thermostat Opening',8,'Indicates the desired position of the engine coolant control valve.   0% represents the thermostat allows flow to completely bypass the radiator and 100% represents the flow is fully through the radiator.  If the electronic thermostat is operating in temperature control mode (SPN 4195) then transmit 0xFF.','Engine Coolant Control Valve Command','3','1 sec','%','0','8');
