INSERT INTO experimenteditor_spnpgnentry VALUES(1814,64851,4153,'Engine Exhaust Gas Temperature Average - Bank 1',16,'The calculated average temperature based upon all of the Bank 1 (left bank) engine exhaust port temperatures.  This is the average temperature based upon the exhaust port temperature measurements of each of the engine cylinders on the left bank prior to the turbocharger.
