INSERT INTO experimenteditor_spnpgnentry VALUES(1822,64852,3039,'Flash Red Stop Lamp (RSL)',2,'This parameter provides the capability to flash the RSL
INSERT INTO experimenteditor_spnpgnentry VALUES(1823,64852,3038,'Flash Malfunction Indicator Lamp (MIL)',2,'This parameter provides the capability to flash the MIL
INSERT INTO experimenteditor_spnpgnentry VALUES(1824,64852,1215,'Failure Mode Identifier',5,'The FMI defines the type of failure detected in the subsystem identified by an SPN.  Note that the failure may not be an electrical failure but may instead be a subsystem failure or condition needing to be reported to the service technician and maybe also to the operator. Conditions can include system events or status that need to be reported.  The FMI, SPN, SPN Conversion Method and Occurrence Count fields combine to form a given diagnostic trouble code.','DTCs - C, Previously Active','5.1','On request','binary','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(1825,64852,1216,'Occurrence Count',7,'The 7-bit occurrence count field contains the number of times a fault has been independently detected.  The occurrence count is reported as 1 the first time the DTC is detected. The occurrence count is not incremented again, until after the DTC has gone to the previously active state and then back active the DTC state when subsequently detected.  At this point the occurrence count would be reported as 2. This continues until the DTC has been independently detected 126 times. The occurrence count shall not be incremented from 126 to 127 -- it shall remain at 126 until cleared by DM3 or DM11.
INSERT INTO experimenteditor_spnpgnentry VALUES(1826,64852,1706,'SPN Conversion Method',1,'When this 1-bit field is equal to a zero, the SPN should be converted as it is defined.  The February 1996 version of J1939-73 contained inadequate definitions to assure consistent implementations. Products implementing to February 1996 version of the document will always have this bit set to a one. When this is the case, the SPN is in either Version 1, 2 or 3 format. The original publication of this recommended practice defined that this bit be set to one. This particular implementation is no longer permitted. It provides context for some implementations prior to the adoption of the recommended setting as zero (version 4 definition).
INSERT INTO experimenteditor_spnpgnentry VALUES(1827,64852,1214,'Suspect Parameter Number',19,'This 19-bit number is used to identify the item for which diagnostics are being reported.  The SPN is used for multiple purposes, some of those that are specific to diagnostics are:
