INSERT INTO experimenteditor_spnpgnentry VALUES(1959,64863,1214,'Suspect Parameter Number',19,'This 19-bit number is used to identify the item for which diagnostics are being reported.  The SPN is used for multiple purposes, some of those that are specific to diagnostics are:
