INSERT INTO experimenteditor_spnpgnentry VALUES(2009,64879,4752,'Engine Exhaust Gas Recirculation 1 (EGR1) Cooler Efficiency',8,'Exhaust Gas Recirculation cooler efficiency is an indication of the cooler’s ability to reduce the temperature of the exhaust gas that is being recirculated back to the intake. 0% = no reduction in temperature, 100% = maximum cooling.  The EGR cooler efficiency is calculated as (EGR cooler intake temperature minus EGR gas temperature) divided by (EGR cooler intake temperature minus engine coolant temperature).','Electronic Engine Controller 8','7','On request','%','0','8');
