INSERT INTO experimenteditor_spnpgnentry VALUES(2128,64896,987,'Protect Lamp',2,'This lamp is used to relay trouble code information that is reporting a problem with a vehicle system that is most probably not electronic subsystem related. For instance, engine coolant temperature is exceeding its prescribed temperature range.
