INSERT INTO experimenteditor_spnpgnentry VALUES(2190,64912,3558,'AETC Data Collection Standard',4,'Indicates the standardized method by which torque data was obtained for the Advertised Engine Torque Curve (AETC).  For example, in North America, heavy duty diesel engine specifications are typically based on SAE J1995.  Other applicable SAE, ISO, or DIN standards may be added as necessary in the future.
