INSERT INTO experimenteditor_spnpgnentry VALUES(2198,64914,4082,'Fuel Pump Primer Control',2,'Parameter used to activate or deactivate a priming system on the fuel transfer system. The fuel priming system is a system that purges air in the fuel lines and may assist fuel delivery to a second pump at lower speeds.
INSERT INTO experimenteditor_spnpgnentry VALUES(2199,64914,3608,'Engine Fuel Shutoff Vent Control',2,'Control setting for a fuel shutoff vent.  Typically, for a dual fuel shutoff system, the vent line is located between them and is plumbed to vent outside to atmosphere.  The vent control typically always actuates opposite to that of the fuel shutoff(s) control.  Thus, when the fuel shutoff(s) are closed, the vent is open, thereby ''ventilating'' any leftover or leaking gas from the fuel shutoff.  When the fuel shutoff(s) are open, the vent is closed, thereby all gas passes through to the engine.
INSERT INTO experimenteditor_spnpgnentry VALUES(2200,64914,632,'Engine Fuel Shutoff 1 Control',2,'Control setting for fuel shutoff 1.  The second instance is SPN 2807.  For a single fuel shutoff system, this represents its commanded position.  For a dual fuel shutoff system, this SPN is representative of the upstream fuel shutoff commanded position.  When fuel (gas) is desired at the engine, the fuel shutoff is opened.  Otherwise, it is closed.
INSERT INTO experimenteditor_spnpgnentry VALUES(2201,64914,2807,'Engine Fuel Shutoff 2 Control',2,'Control setting for fuel shutoff 2.  First instance is SPN 632.  For a dual fuel shutoff system, this SPN is representative of the downstream fuel shutoff commanded position.  When fuel (gas) is desired at the engine, the fuel shutoff is opened.  Otherwise, it is closed.
INSERT INTO experimenteditor_spnpgnentry VALUES(2202,64914,3601,'Engine Fuel Shutoff Valve Leak Test Control',2,'Control setting for fuel shutoff valve proving system test.  Typically, this type of system can only be used with a dual fuel shutoff system.  The test consists of a small pump to pressurize the chamber between the dual fuel shutoffs when they are closed.  After pressurizing, the test is passed if the pressure is above a certain threshold, indicating the fuel shutoffs are sealed completely shut without leaks.  Otherwise, a low pressure indicates a leak is present past one or both of the fuel shutoffs. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2203,64914,3589,'Engine Oil Priming Pump Control',2,'This control is used to activate a pump that lubricates the engine, particularly prior to initial engine startup.
INSERT INTO experimenteditor_spnpgnentry VALUES(2204,64914,3602,'Engine Oil Pre-heater Control',2,'Control setting for an electrically actuated oil pre-heating device.
INSERT INTO experimenteditor_spnpgnentry VALUES(2205,64914,3603,'Engine Electrical System Power Conservation Control',2,'Control setting for cutting power to various devices when the engine is not in use.  Useful if it is desired to keep the engine in standby, with main control ECM still powered on and communictaing with outside world, but actuators and certain other ECMs can be de-powered.
INSERT INTO experimenteditor_spnpgnentry VALUES(2206,64914,3604,'Engine Block / Coolant Pre-heater Control',2,'Control setting for an electrically actuated engine block or coolant pre-heating device.
INSERT INTO experimenteditor_spnpgnentry VALUES(2207,64914,3605,'Engine Coolant Circulating Pump Control',2,'Control setting for an electrically actuated engine coolant circulating pump. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2208,64914,3606,'Engine Controlled Shutdown Request',2,'A signal issued by the engine control system to a user or external system requesting for a controlled shutdown.  This request is made when engine protection diagnostics determine a condition warrants a shutdown soon, but it is not severe enough to necessitate an immediate shutdown.  This function gives notice such that the engine can be unloaded and cooled down before stopping.
INSERT INTO experimenteditor_spnpgnentry VALUES(2209,64914,3607,'Engine Emergency (Immediate) Shutdown Indication',2,'A signal issued by the engine control system to a user or external system indicating that it is immediately shutting the engine down.  This indication is made when engine protection diagnostics determine a condition necessitates an immediate shutdown.  This function gives notice that this has occurred.
INSERT INTO experimenteditor_spnpgnentry VALUES(2210,64914,3644,'Engine Derate Request',8,'This parameter is a derate request made from the engine control system to an external system, where the engine is requesting an external device to reduce the load being applied.  A zero value indicates that there is no derate being requested and 100% means full derate being requested.  Any non-zero value represents a derate is being requested, at a percentage of full load.  The engine control system identifies any problems and determines the amount of derate the situation calls for. This parameter can be useful to customer applications that prefer awareness and control of the engine derate.','Engine Operating Information','8','250 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2211,64914,3544,'Time Remaining in Engine Operating State',16,'This parameter is used to indicate the time remaining in the current engine operating state, based on the state defined in the SPN \'Engine Operating State\' (SPN 3543). For the states in which time remaining is not applicable, use 65535 ($FFFF).','Engine Operating Information','2-3','250 ms','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2212,64915,3542,'Requested Engine Control Mode',4,'This parameter is used to request a change to the engine control mode.  This is a status parameter.  
INSERT INTO experimenteditor_spnpgnentry VALUES(2213,64915,3567,'Generator Control Not In Automatic Start State',2,'This parameter indicates whether or not the generator set is in a condition to automatically start up and provide power. If not, this status parameter is in the ACTIVE state.
INSERT INTO experimenteditor_spnpgnentry VALUES(2214,64915,3568,'Generator Not Ready to Automatically Parallel State',2,'This parameter indicates whether or not all systems required to start the engine and close to the bus are prepared to operate automatically. If not, the generator is not ready to automatically parallel, and the status parameter is in the ACTIVE state.
INSERT INTO experimenteditor_spnpgnentry VALUES(2215,64915,4079,'Generator Governing Speed Command',2,'Command from user and/or generator control system for the genset (engine) to govern to low idle or rated base speed setpoints.  If this method of engine control is used, then the PGN 0 (TSC1) is not expected to be received by the engine controller and it will not be processed.
INSERT INTO experimenteditor_spnpgnentry VALUES(2216,64915,4080,'Generator Frequency Selection',4,'Command from user and/or generator control system for the genset (engine) to target operations for 50 Hz, 60 Hz, or 400 Hz.
INSERT INTO experimenteditor_spnpgnentry VALUES(2217,64915,5568,'Engine Speed Governor Droop',8,'This is the percent speed droop adjustment relative to rated speed setpoint. The Engine Speed Droop is equal to the following equation: 
INSERT INTO experimenteditor_spnpgnentry VALUES(2218,64915,4078,'Generator Alternator Efficiency',16,'Measured, calculated, and/or estimated operating efficiency of the generator alternator.  Percentage reflects ratio of power output divided by power input, multiplied by 100.','Generator Control 1','2-3','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2219,64915,5567,'Engine Speed Governor Gain Adjust',16,'This parameter is used to adjust multiple gains at same time to attain engine stability across a broader range of applications.  
INSERT INTO experimenteditor_spnpgnentry VALUES(2220,64916,27,'Engine Exhaust Gas Recirculation 1 Valve Position',16,'The position of the exhaust gas recirculation valve expressed as a percentage of full travel. Zero percent means the valve is closed and no exhaust gas is flowing into the intake air stream. One hundred percent means the valve is fully opened.','Electronic Engine Controller 7','1-2','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2221,64916,3822,'Engine Exhaust Gas Recirculation 1 Valve 2 Position',16,'The position of the second exhaust gas recirculation valve expressed as a percentage of full travel. Zero percent means the valve is closed and no exhaust gas is flowing into the intake air stream. One hundred percent means the valve is fully opened.','Electronic Engine Controller 7','3-4','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2222,64916,5444,'Engine Crankcase Breather Oil Separator Speed',16,'The speed of a rotating (centrifugal) crankcase oil separator.','Electronic Engine Controller 7','5-6','100 ms','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2223,64916,5312,'Commanded Engine Intake Manifold Pressure',16,'Provides the commanded set point value for the engine intake manifold pressure.','Electronic Engine Controller 7','7-8','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2224,64917,3359,'Transmission Oil Filter Restriction Switch',2,'This switch indicates whether the transmission oil filter is clogged.
INSERT INTO experimenteditor_spnpgnentry VALUES(2225,64917,3533,'Transmission Oil Level Switch',2,'This switch indicates whether transmission oil level is full or empty.
INSERT INTO experimenteditor_spnpgnentry VALUES(2226,64917,5345,'Transmission Overheat Indicator',2,'Signal from transmission indicating that its fluid temperature is above normal acceptable limits, and as a result, transmission operation may be altered or restricted.  The indicator is typically a lamp.  Distinctions in meaning between the continuous and flashing are left to the transmission manufacturer..
INSERT INTO experimenteditor_spnpgnentry VALUES(2227,64917,4177,'Transmission Oil Life Remaining',8,'Signal which indicates the actual oil life remaining in percent.  100% means the transmission oil is brand new, and 0% means the transmission oil is at the end of its life.','Transmission Fluids 2','4','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2228,64917,5914,'Transmission Oil Level 2 High / Low',8,'Second instance of a transmission oil level indicator. Conveys the current volume of transmission sump oil compared to recommended volume. Positive values indicate overfill. Zero means the transmission fluid is filled to the recommended level. If only a one instance of transmission oil level measurement exists, SPN 3027 Transmission Oil Level 1 High / Low should be used.
INSERT INTO experimenteditor_spnpgnentry VALUES(2229,64917,5915,'Transmission Oil Level 2 Countdown Timer',4,'Countdown timer for the second instance of a transmission oil level indicator. Once all vehicle conditions (such as vehicle stopped, etc) are met, some transmissions may require a ‘settling time’ to allow the fluid level to normalize. This parameter indicates how much of the required settling time remains. When time reaches 0, a valid oil level measurement value will be broadcast in SPN 5914 Transmission Oil Level 2 High / Low. If only a single oil level is measured, SPN 3028 Transmission Oil Level 1 Countdown Timer should be used.
INSERT INTO experimenteditor_spnpgnentry VALUES(2230,64917,5916,'Transmission Oil Level 2 Measurement Status',4,'Measurement status for the second instance of a transmission oil level indicator. Indicates if conditions are acceptable to obtain a valid transmission oil level measurement as conveyed in SPN 5914 Transmission Oil Level 2 High / Low. If conditions are not acceptable, this parameter conveys to the operator what prevents conditions from being acceptable. Only one condition can be conveyed in this parameter at any given point in time. If multiple conditions exist, it is not important which condition is actually broadcast, as the driver must ‘correct’ each and every condition as it is presented before a valid oil level reading can be made. If multiple conditions exist that prevent a valid reading, the sender should broadcast one of those conditions until it is corrected; then the next condition can be conveyed to the operator, and so on. If only a single oil level is measured, use SPN 3026 Transmission Oil Level 1 Measurement Status.
INSERT INTO experimenteditor_spnpgnentry VALUES(2231,64917,3823,'Transmission Torque Converter Oil Outlet Temperature',16,'Temperature of transmission torque converter outlet oil.','Transmission Fluids 2','2-3','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2232,64917,5913,'Transmission Oil Temperature 2',16,'Second instance of transmission lubricant temperature. This parameter may reflect the temperature of a second sump or oil supply. If only one instance of transmission lubricant temperature measurement exists, SPN 177 Transmission Oil Temperature 1 should be used.','Transmission Fluids 2','5-6','1 s','C','-273','8');
