INSERT INTO experimenteditor_spnpgnentry VALUES(2254,64923,3515,'Aftertreatment 1 Diesel Exhaust Fluid Temperature 2',8,'Temperature of the diesel exhaust fluid at the device measuring diesel exhaust fluid quality','Aftertreatment 1 Diesel Exhaust Fluid Information','1','1 sec','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2255,64923,3516,'Aftertreatment 1 Diesel Exhaust Fluid Concentration',8,'A measure of the concentration of urea in water.  Zero percent means that the tank contains no urea.  A 32.5% value indicates that the diesel exhaust fluid is of the proper concentration.  The 32.5% value indicates that the concentration is highest quality.','Aftertreatment 1 Diesel Exhaust Fluid Information','2','1 sec','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2256,64923,3518,'Aftertreatment 1 Diesel Exhaust Fluid Conductivity',8,'A measure of the conductivity of the diesel exhaust fluid at the sensor.  The conductivity is an indication of the diesel exhaust fluid''s chemical make up.','Aftertreatment 1 Diesel Exhaust Fluid Information','3','1 sec','microSiemens/mm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2257,64923,3519,'Aftertreatment 1 SCR Catalyst Reagent Temperature 2 Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI that applies to the most significant failure of the catalyst temperature sensor.  When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Diesel Exhaust Fluid Information','4.1','1 sec','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2258,64923,3520,'Aftertreatment 1 SCR Catalyst Reagent Properties Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI that applies to the most significant failure of the catalyst reagent properties sensor.  This may be used for indicating failures of the catalyst reagent concentration, catalyst reagent conductivity or catalyst reagent type.  When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Diesel Exhaust Fluid Information','5.1','1 sec','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2259,64923,3521,'Aftertreatment 1 Diesel Exhaust Fluid Property',4,'This parameter indicates the property of the fluid compound in the tank.  A value of 0011 indicates uncontaminated Diesel Exhaust Fluid.
