INSERT INTO experimenteditor_spnpgnentry VALUES(2304,64931,641,'Engine Variable Geometry Turbocharger Actuator #1',8,'Actuator that controls the variable geometry turbocharger geometry.The control command to the actuator, normalized to percent, where 0% nominally represents fully closed (smallest turbocharger geometry) and 100% represents fully open (largest geometry turbocharger).','Electronic Engine Controller 6','3','100 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2305,64931,3675,'Engine Turbocharger Compressor Bypass Actuator 1  Position',8,'Measures the position of the turbocharger compressor bypass actuator, where  0% represents bypass fully closed and 100% represents bypass fully open.  Typically, the compressor bypass is used to lower the compressor outlet pressure and/or intake manifold pressure during situations where too much boost is being generated by the turbocharger.  Typically, a compressor bypass will be plumbed from the compressor outlet or intake manifold back to the compressor intake, with the compressor bypass actuator and valve in place to regulate bypass flow.','Electronic Engine Controller 6','4','100 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2306,64931,5366,'Engine Desired Turbocharger Compressor Bypass Actuator 1 Position',8,'The requested position of the Engine Turbocharger Compressor Bypass actuator by the engine ECM, where 0% represents bypass fully closed and 100% represents bypass fully open.
INSERT INTO experimenteditor_spnpgnentry VALUES(2307,64931,5367,'Engine Turbocharger Compressor Bypass Actuator 1 Preliminary FMI',5,'Used to identify  the appplicable J1939-73 FMI detected in the Engine Turbocharger Compressor Bypass Actuator 1 by the manufacturers software. When there is no failure FMI 31 is transmitted. When there is multiple failures, the most severe is transmitted.','Electronic Engine Controller 6','8.1','100 msec (preferred) or Engine Speed Dependent (if required by application)','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2308,64931,5368,'Engine Turbocharger Compressor Bypass Actuator 1 Temperature Status',3,'Used to identify the status of the Engine Turbocharger Compresssor Bypass Actuator 1 drive circuitry temperature.  Temperature excursions may affect the torque output.
INSERT INTO experimenteditor_spnpgnentry VALUES(2309,64931,3470,'Engine Turbocharger Compressor Bypass Actuator 1 Command',16,'The command to a compressor bypass actuator, normalized to percent, where 0% nominally represents fully closed and 100% represents fully open.  Typically, the turbocharger compressor bypass actuator is used to keep the engine out of surge by metering compressed air (charge).','Electronic Engine Controller 6','1-2','100 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2310,64931,5369,'Engine Turbocharger Compressor Bypass Actuator 2 command',16,'The command to a compressor bypass actuator 2, normalized to percent, where 0% nominally represents fully closed and 100% represents fully open. Typically, the turbocharger compressor bypass actuator is used to keep the engine out of surge by metering compressed air (charge).','Electronic Engine Controller 6','5-6','100 msec (preferred) or Engine Speed Dependent (if required by application)','%','0','8');
