INSERT INTO experimenteditor_spnpgnentry VALUES(2318,64932,3459,'Engagement Consent – Transfer case output shaft PTO',2,'Status of the transmission controller’s consent to engage the PTO drive connected to the transfer case output shaft.  The controller in charge of the PTO drive should monitor this parameter and only engage the drive when consent is given.  If consent is removed, while the PTO drive is engaged, the drive controller should disengage the drive as soon as possible.  Engaging the drive or continuing drive engagement when consent is removed may result in damage to the transmission and / or the PTO drive mechanism.
INSERT INTO experimenteditor_spnpgnentry VALUES(2319,64932,3458,'Engagement Consent – Transmission output shaft PTO',2,'Status of the transmission controller’s consent to engage the PTO drive connected to the transmission output shaft.  The controller in charge of the PTO drive should monitor this parameter and only engage the drive when consent is given.  If consent is removed, while the PTO drive is engaged, the drive controller should disengage the drive as soon as possible.  Engaging the drive or continuing drive engagement when consent is removed may result in damage to the transmission and / or the PTO drive mechanism.
INSERT INTO experimenteditor_spnpgnentry VALUES(2320,64932,3457,'Engagement Consent – Transmission input shaft PTO 2',2,'Status of the transmission controller’s consent to engage the second PTO drive mounted on the transmission case.  The controller in charge of the PTO drive should monitor this parameter and only engage the drive when consent is given.  If consent is removed while the PTO drive is engaged, the drive controller should disengage the drive as soon as possible.  Engaging the drive or continuing drive engagement when consent is removed may result in damage to the transmission and / or the PTO drive mechanism.  If there is only one PTO drive on the transmission case, use SPN 3456 Engagement Consent – Transmission input shaft PTO 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(2321,64932,3456,'Engagement Consent – Transmission input shaft PTO 1',2,'Status of the transmission controller’s consent to engage the first or sole PTO drive mounted on the transmission case.  The controller in charge of the PTO drive should monitor this parameter and only engage the drive when consent is given.  If consent is removed, while the PTO drive is engaged, the drive controller should disengage the drive as soon as possible.  Engaging the drive or continuing drive engagement when consent is removed may result in damage to the transmission and / or the PTO drive mechanism.
