INSERT INTO experimenteditor_spnpgnentry VALUES(2415,64946,3253,'Aftertreatment 1 Diesel Particulate Filter Delta Pressure Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the diesel particulate filter differential pressure sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Intermediate Gas','7.6-8.1','500 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2416,64947,3247,'Aftertreatment 1 Exhaust Gas Temperature 3 Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the exhaust gas temperature 3 sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Outlet Gas 2','5.1','500 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2417,64947,3248,'Aftertreatment 1 Diesel Particulate Filter Outlet Exhaust Gas Temperature  Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the diesel particulate filter outlet gas temperature sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Outlet Gas 2','6.1','500 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2418,64947,3245,'Aftertreatment 1 Exhaust Gas Temperature 3',16,'The reading from the exhaust gas temperature sensor located farthest downstream in the aftertreatment system in exhaust bank 1.','Aftertreatment 1 Outlet Gas 2','1-2','500 ms','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2419,64947,3246,'Aftertreatment 1 Diesel Particulate Filter Outlet Gas Temperature',16,'Temperature of engine combustion byproducts leaving the diesel particulate filter exhaust in exhaust bank 1.','Aftertreatment 1 Outlet Gas 2','3-4','500 ms','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2420,64948,3243,'Aftertreatment 1 Exhaust Gas Temperature 1 Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the exhaust gas temperature 1 sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Intake Gas 2','5.1','500 ms','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2421,64948,3244,'Aftertreatment 1 Diesel Particulate Filter Intake Gas Temperature Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the diesel particulate filter intake gas temperature sensor by the manufacturer’s sensor control software in exhaust bank 1.  When there is no failure FMI 31 is sent.  In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Intake Gas 2','6.1','500 ms','binary','0','8');
