INSERT INTO experimenteditor_spnpgnentry VALUES(2423,64948,3242,'Aftertreatment 1 Diesel Particulate Filter Intake Gas Temperature',16,'Temperature of engine combustion byproducts entering the diesel particulate filter in exhaust bank 1.','Aftertreatment 1 Intake Gas 2','3-4','500 ms','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2424,64949,987,'Protect Lamp',2,'This lamp is used to relay trouble code information that is reporting a problem with a vehicle system that is most probably not electronic subsystem related. For instance, engine coolant temperature is exceeding its prescribed temperature range.
INSERT INTO experimenteditor_spnpgnentry VALUES(2425,64949,624,'Amber Warning Lamp',2,'This lamp is used to relay trouble code information that is reporting a problem with the vehicle system but the vehicle need not be immediately stopped. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2426,64949,623,'Red Stop Lamp',2,'This lamp is used to relay trouble code information that is of a severe enough condition that it warrants stopping the vehicle.
INSERT INTO experimenteditor_spnpgnentry VALUES(2427,64949,1213,'Malfunction Indicator Lamp',2,'A lamp used to relay only emissions-related trouble code information. This lamp is only illuminated when there is an emission-related trouble code active.
INSERT INTO experimenteditor_spnpgnentry VALUES(2428,64949,3041,'Flash Protect Lamp',2,'This parameter provides the capability to flash the engine protect lamp
INSERT INTO experimenteditor_spnpgnentry VALUES(2429,64949,3040,'Flash Amber Warning Lamp (AWL)',2,'This parameter provides the capability to flash the AWL
INSERT INTO experimenteditor_spnpgnentry VALUES(2430,64949,3039,'Flash Red Stop Lamp (RSL)',2,'This parameter provides the capability to flash the RSL
INSERT INTO experimenteditor_spnpgnentry VALUES(2431,64949,3038,'Flash Malfunction Indicator Lamp (MIL)',2,'This parameter provides the capability to flash the MIL
INSERT INTO experimenteditor_spnpgnentry VALUES(2432,64949,1215,'Failure Mode Identifier',5,'The FMI defines the type of failure detected in the subsystem identified by an SPN.  Note that the failure may not be an electrical failure but may instead be a subsystem failure or condition needing to be reported to the service technician and maybe also to the operator. Conditions can include system events or status that need to be reported.  The FMI, SPN, SPN Conversion Method and Occurrence Count fields combine to form a given diagnostic trouble code.','Previously Active Emission Related Faults','5.1','On request','binary','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(2433,64949,1216,'Occurrence Count',7,'The 7-bit occurrence count field contains the number of times a fault has been independently detected.  The occurrence count is reported as 1 the first time the DTC is detected. The occurrence count is not incremented again, until after the DTC has gone to the previously active state and then back active the DTC state when subsequently detected.  At this point the occurrence count would be reported as 2. This continues until the DTC has been independently detected 126 times. The occurrence count shall not be incremented from 126 to 127 -- it shall remain at 126 until cleared by DM3 or DM11.
INSERT INTO experimenteditor_spnpgnentry VALUES(2434,64949,1706,'SPN Conversion Method',1,'When this 1-bit field is equal to a zero, the SPN should be converted as it is defined.  The February 1996 version of J1939-73 contained inadequate definitions to assure consistent implementations. Products implementing to February 1996 version of the document will always have this bit set to a one. When this is the case, the SPN is in either Version 1, 2 or 3 format. The original publication of this recommended practice defined that this bit be set to one. This particular implementation is no longer permitted. It provides context for some implementations prior to the adoption of the recommended setting as zero (version 4 definition).
INSERT INTO experimenteditor_spnpgnentry VALUES(2435,64949,1214,'Suspect Parameter Number',19,'This 19-bit number is used to identify the item for which diagnostics are being reported.  The SPN is used for multiple purposes, some of those that are specific to diagnostics are:
INSERT INTO experimenteditor_spnpgnentry VALUES(2436,64950,4100,'Supported in Expanded Freeze Frame (e.g., DM25)',1,'This parameter defines whether the applicable parameter (that is the SPN) is supported in the expanded freeze frame message, DM25.','SPN Support','3.1','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2437,64950,4101,'Supported in Data Stream',1,'This parameter defines whether the applicable parameter (that is the SPN) is supported in the Data Stream messages.','SPN Support','3.2','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2438,64950,4102,'Supported in Scaled Test Results (e.g., DM30)',1,'This parameter defines whether the applicable parameter (that is the SPN) is supported in the Scaled Test Results message, DM30.','SPN Support','3.3','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2439,64950,4103,'SPN Data Length',8,'The number of data bytes associated with the SPN in the Freeze Frame.
INSERT INTO experimenteditor_spnpgnentry VALUES(2440,64950,3297,'SPN Supported',19,'This parameter defines the SPN(s) that is/are supported for the freeze frame and/or data stream information.','SPN Support','1-2, 3.6','On request','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2441,64951,3300,'Expanded Freeze Frame Length',8,'The Freeze Frame Length is the length plus the number of bytes to convey the data of all parameters (SPNs) in Freeze Frame.','Expanded Freeze Frame','1','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2442,64951,1215,'Failure Mode Identifier',5,'The FMI defines the type of failure detected in the subsystem identified by an SPN.  Note that the failure may not be an electrical failure but may instead be a subsystem failure or condition needing to be reported to the service technician and maybe also to the operator. Conditions can include system events or status that need to be reported.  The FMI, SPN, SPN Conversion Method and Occurrence Count fields combine to form a given diagnostic trouble code.','Expanded Freeze Frame','4.1','On request','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2443,64951,1216,'Occurrence Count',7,'The 7-bit occurrence count field contains the number of times a fault has been independently detected.  The occurrence count is reported as 1 the first time the DTC is detected. The occurrence count is not incremented again, until after the DTC has gone to the previously active state and then back active the DTC state when subsequently detected.  At this point the occurrence count would be reported as 2. This continues until the DTC has been independently detected 126 times. The occurrence count shall not be incremented from 126 to 127 -- it shall remain at 126 until cleared by DM3 or DM11.
INSERT INTO experimenteditor_spnpgnentry VALUES(2444,64951,1706,'SPN Conversion Method',1,'When this 1-bit field is equal to a zero, the SPN should be converted as it is defined.  The February 1996 version of J1939-73 contained inadequate definitions to assure consistent implementations. Products implementing to February 1996 version of the document will always have this bit set to a one. When this is the case, the SPN is in either Version 1, 2 or 3 format. The original publication of this recommended practice defined that this bit be set to one. This particular implementation is no longer permitted. It provides context for some implementations prior to the adoption of the recommended setting as zero (version 4 definition).
INSERT INTO experimenteditor_spnpgnentry VALUES(2445,64951,1214,'Suspect Parameter Number',19,'This 19-bit number is used to identify the item for which diagnostics are being reported.  The SPN is used for multiple purposes, some of those that are specific to diagnostics are:
INSERT INTO experimenteditor_spnpgnentry VALUES(2446,64951,1545,'SPN Data',8,'The SPN data field represents the data pertaining to one or more SPNs that were reported in DM24.  The order and number of bytes per SPN is determined from the DM24 response. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2447,64952,3302,'Number of Warm-Ups Since DTCs Cleared',8,'Number of warm-up cycles since all DTCs were cleared (via an external test equipment or possibly, a battery disconnect).  A warm-up is defined in the OBD regulations to be sufficient vehicle operation such that coolant temperature rises by at least 22.2 °C (40 °F) from engine starting and reaches a minimum temperature of 71.1 °C (160 °F) for gasoline engines, and 60 °C (140 °F) for diesel engines.  This PID is not associated with any particular DTC.  It is simply an indication for I/M, of the last time an external test equipment was used to clear DTCs.  If greater than 255 warm-ups have occurred, WARM_UPS shall remain at 255 and not wrap to zero.','Diagnostic Readiness 3','3','On request','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2448,64952,3303,'Continuously Monitored Systems Enabled/Completed Status',8,'This parameter identifies the continuously monitored system enable/completed support and status.','Diagnostic Readiness 3','4','On request','bit-mapped','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2449,64952,3301,'Time Since Engine Start',16,'RUNTM shall increment while the engine is running.  It shall freeze if the engine stalls.  RUNTM shall be reset to zero during every control module power-up and when entering the key-on, engine off position.  RUNTM is limited to 65,535 seconds and shall not wrap around to zero.','Diagnostic Readiness 3','1-2','On request','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2450,64952,3304,'Non-Continuously Monitored Systems Enabled Status',16,'Enable status of non-continuous monitors this monitoring cycle.','Diagnostic Readiness 3','5-6','On request','bit-mapped','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2451,64952,3305,'Non-Continuously Monitored Systems Complete Status',16,'Completion status of non-continuous monitors this monitoring cycle.  Each bit identifies whether a particular test is complete for a given controller.','Diagnostic Readiness 3','7-8','On request','bit-mapped','0','8');
