INSERT INTO experimenteditor_spnpgnentry VALUES(2493,64960,3043,'Type of Passenger Count',8,'Used to notify transit link devices of the type of passenger counting system used in the vehicle.  Some passenger counting systems indicate real-time boarding and exiting data for other devices to accumulate. Other types of passenger counters report a current on-board total relative to a transit door status,  a fare collection status, or other signal which can define the end of the boarding/exiting period and a stable underway totalized passenger count.
