INSERT INTO experimenteditor_spnpgnentry VALUES(2498,64961,3358,'Engine Exhaust Gas Recirculation 1 Intake Pressure',8,'EGR intake gage pressure is measured after the EGR cooler and before the EGR valve.','Engine Fluid Level/Pressure 3','3','500 ms','kPa','0','8');
