INSERT INTO experimenteditor_spnpgnentry VALUES(2507,64963,2623,'Accelerator Pedal #1 Channel 2',8,'Sensor output 2 for the accelerator pedal #1 position when using a redundant-style sensor.  The ratio of actual accelerator pedal position to maximum pedal position. This is for the first occurrence of the accelerator pedal. Although it is used as an input to determine powertrain demand, it also provides anticipatory information to transmission and ASR algorithms about driver actions.  This is the second sensor output when a multiple output (redundant) sensor is used for Accelerator Pedal #1 position.  Sensor outputs 1 & 3 (for accelerator pedal #1 position) are SPNs 91 & 2624.','Electronic Engine Controller 15','1','On Request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2508,64963,2624,'Accelerator Pedal #1 Channel 3',8,'Sensor output 3 for the accelerator pedal #1 position when using a redundant-style sensor.  The ratio of actual accelerator pedal position to maximum pedal position. This is for the first occurrence of the accelerator pedal. Although it is used as an input to determine powertrain demand, it also provides anticipatory information to transmission and ASR algorithms about driver actions.  This is the third sensor output when a multiple output (redundant) sensor is used for Accelerator Pedal #1 position.  Sensor outputs 1 & 2 (for accelerator pedal #1 position) are SPNs 91 & 2623.','Electronic Engine Controller 15','2','On Request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2509,64963,2625,'Accelerator Pedal #2 Channel 2',8,'Sensor output 2 for the accelerator pedal #2 position when using a redundant-style sensor.  The ratio of actual accelerator pedal position to maximum pedal position. This is for the second occurrence of the accelerator pedal. Although it is used as an input to determine powertrain demand, it also provides anticipatory information to transmission and ASR algorithms about driver actions.  This is the second sensor output when a multiple output (redundant) sensor is used for Accelerator Pedal # 2 position.  Sensor outputs 1 & 3 (for accelerator pedal #2 position) are SPNs 29 & 2626.','Electronic Engine Controller 15','3','On Request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2510,64963,2626,'Accelerator Pedal #2 Channel 3',8,'Sensor output 3 for the accelerator pedal #2 position when using a redundant-style sensor.  The ratio of actual accelerator pedal position to maximum pedal position. This is for the second occurrence of the accelerator pedal. Although it is used as an input to determine powertrain demand, it also provides anticipatory information to transmission and ASR algorithms about driver actions.  This is the third sensor output when a multiple output (redundant) sensor is used for Accelerator Pedal # 2 position.  Sensor outputs 1 & 2 (for accelerator pedal #2 position) are SPNs 29 & 2625.','Electronic Engine Controller 15','4','On Request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2511,64964,3839,'Brake Temperature Warning',2,'This parameter indicates if the temperature in the service brakes exceeds a certain value. It can be used for a warning information for the driver. The temperature warning value is vehicle manufacturer specific.
