INSERT INTO experimenteditor_spnpgnentry VALUES(2517,64964,2921,'XBR Acceleration Limit',8,'The brake system may temporarily or generally limit the maximum brake performance available for external systems. A temporary limit may be nessary due to high brake temperature; a general limit may be defined by the vehicle manufacturer, e.g. a value of -2.5 m/s² due to liability reasons. The actual limit is communicated to the external systems that request braking. The limit is only effective in the XBR Priorities 01 to 11. It is specified as an absolute acceleration in reference to the road.','Electronic Brake Controller 5','3','100 ms','m/s²','-12.5','8');
