INSERT INTO experimenteditor_spnpgnentry VALUES(2520,64965,2902,'ECU Serial Number',1600,'The serial number of the physical ECU.','ECU Identification Information','b','On request','ASCII','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(2521,64965,2903,'ECU Location',1600,'The location of the ECU within a network.','ECU Identification Information','c','On request','ASCII','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(2522,64965,2904,'ECU Type',1600,'The type of ECU.  One example of a use of the ECU type could be for classifying ECU capabilities, such as I/O.','ECU Identification Information','d','On request','ASCII','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(2523,64965,4304,'ECU Manufacturer Name',1600,'The name of the manufacturer of the physical ECU.
INSERT INTO experimenteditor_spnpgnentry VALUES(2524,64966,626,'Engine Start Enable Device 1',2,'Devices that assist an Engine in starting, e.g. intake heaters and ether.  Primary starting aid.
INSERT INTO experimenteditor_spnpgnentry VALUES(2525,64966,1804,'Engine Start Enable Device 2',2,'Devices that assist an engine in starting, e.g. intake heaters, ether, or an alternate/secondary starting aid.  May be of the same type or different than Start Enable Device 1 (SPN 626). Parameter indicating whether the start enable device 2 is ON or OFF.
INSERT INTO experimenteditor_spnpgnentry VALUES(2526,64966,2899,'Engine Start Enable Device 1 Configuration',4,'The start enable device installed for start enable device 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(2527,64966,2898,'Engine Start Enable Device 2 Configuration',4,'The start enable device installed for start enable device 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(2528,64966,5548,'Engine Cold Start Fuel Igniter Command',8,'The engine cold start fuel igniter control command, normalized to %, where 0% represents fully off and 100% represents fully on.','Cold Start Aids','3','As required','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2529,64966,5549,'Engine Cold Start Fuel Igniter Relay',2,'The engine cold start fuel igniter relay control command.  This command controls the relay, not the igniter.
INSERT INTO experimenteditor_spnpgnentry VALUES(2530,64966,5550,'Engine Cold Start Fuel Igniter Relay Feedback',2,'Feedback state of the engine cold start fuel igniter relay which indicates the status of the relay output.
INSERT INTO experimenteditor_spnpgnentry VALUES(2531,64967,2896,'Engine Auxiliary Governor State',2,'This is the Engine Auxiliary Governor feature. This feature is used to allow engine speed to be controlled by an auxiliary input such as pressure or tailshaft speed. This feature is requested by an operator switch, this parameter indicates the state of the feature as determined by the controlling ECM.
INSERT INTO experimenteditor_spnpgnentry VALUES(2532,64967,2890,'Engine Multi-Unit Sync State',2,'This feature is widely used in Industry to operate multiple engines from a single command source. A master engine will “synchronize” one or more slave engines to operate at the same speed. This feature is requested by an operator switch, this parameter indictes the state of the feature as determined by the controlling ECM.
INSERT INTO experimenteditor_spnpgnentry VALUES(2533,64967,2891,'Engine Alternate Low Idle Select State',2,'In many applications, it is desirable that an alternate low idle speed setting be made available via switch input. The normal programmed low idle is the default low idle, and when the Alternate Low Idle feature is activated, an alternate preprogrammed low idle speed is selected. The accelerator position control operates as normal but is now bounded to a different low idle speed. This selection impacts Point 1 on the Engine Configuration.
INSERT INTO experimenteditor_spnpgnentry VALUES(2534,64967,2888,'Engine Alternate Rating Select State',8,'In some off-highway applications it may be desirable to have multiple engine ratings available for selection by the operator.  There is the default engine rating, which provides the maximum available power across the range of operation. There are additional engine ratings which the engine controller may use that allow for alternate fueling across the operational range.  Engine rating  number 1 is the maximum rating. Rating number 2 is the next highest, rating 3 next highest, etc.
INSERT INTO experimenteditor_spnpgnentry VALUES(2535,64967,2889,'Engine Alternate Droop Accelerator 1 Select State',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching. The selections may apply to Accelerator 1. This parameter indicates which state has been selected by the controlling ECM.
INSERT INTO experimenteditor_spnpgnentry VALUES(2536,64967,2893,'Engine Alternate Droop Accelerator 2 Select State',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching. The selections apply to Accelerator 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(2537,64967,2894,'Engine Alternate Droop Remote Accelerator Select State',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching.  The selections apply to Remote Accelerator.
INSERT INTO experimenteditor_spnpgnentry VALUES(2538,64967,2895,'Engine Alternate Droop Auxiliary Input Select State',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching.  The selections apply to Auxiliary Input.
INSERT INTO experimenteditor_spnpgnentry VALUES(2539,64968,2892,'Engine Operator Primary Intermediate Speed Select State',4,'13 preprogrammed intermediate speed control settings are available for the controlling ECM to select.  If no speed setting is requested, the engine operates normally. The Intermediate Speed Control is widely used in the Industrial application to control the engine to an intermediate speed setting which can either replace the accelerator position control altogether, or limit the accelerator position control to a selectable speed point minimum or maximum. This parameter indicates which state has been selected by the controlling ECM.
INSERT INTO experimenteditor_spnpgnentry VALUES(2540,64969,2887,'Total Count of Configuration Changes Made',16,'Total number of times changes have been made to any of the configurable parameters.','Electronic Control Module Information','1-2','As required','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2541,64970,2880,'Engine Operator Primary Intermediate Speed Select',4,'Allows the operator to select one of 13 preprogrammed Intermediate Speed Control settings. If no speed setting is requested, the engine operates normally. The Intermediate Speed Control is widely used in the Industrial application to control the engine to an intermediate speed setting which can either replace the accelerator position control altogether, or limit the accelerator position control to a selectable speed point minimum or maximum.
INSERT INTO experimenteditor_spnpgnentry VALUES(2542,64971,2884,'Engine Auxiliary Governor Switch',2,'This is the On/Off operation of the Auxiliary Governor feature switch. This feature is used to allow engine speed to be controlled by an auxiliary input such as pressure or tailshaft speed. This switch position indicates whether this feature is requested or not. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2543,64971,1377,'Engine Synchronization Switch',2,'This is the On/Off operation of the Multiple Unit Synchronization functionality. When it is enabled (i.e. On) the master engine will synchronize one or more slave engines to operate at the same speed. This switch position indicates whether this feature is disabled (off) or enabled (on). 
INSERT INTO experimenteditor_spnpgnentry VALUES(2544,64971,2883,'Engine Alternate Low Idle Switch',2,'Operator switch which selects between two low idle speeds, default and alternate.
INSERT INTO experimenteditor_spnpgnentry VALUES(2545,64971,2882,'Engine Alternate Rating Select',8,'In some off-highway applications it may be desirable to have multiple engine ratings available for selection by the operator. There is the default engine rating, which provides the maximum available power across the range of operation. There are additional engine ratings which the user can select that allow for alternate fueling across the operational range.  Engine rating selection number 1 is the maximum rating. Selection number 2 is the next highest, selection 3 next highest, etc. The selection impacts the operating points in the Engine Configuration.
INSERT INTO experimenteditor_spnpgnentry VALUES(2546,64971,2881,'Engine Alternate Droop Accelerator 1 Select',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching. The selections apply to Accelerator 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(2547,64971,2879,'Engine Alternate Droop Accelerator 2 Select',4,'Same description as Engine Alternate Droop Accelerator 1 Select (SPN 2881) except that the selections may apply to Accelerator 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(2548,64971,2886,'Engine Alternate Droop Remote Accelerator Select',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching. The selections apply to the Remote Accelerator.
INSERT INTO experimenteditor_spnpgnentry VALUES(2549,64971,2885,'Engine Alternate Droop Auxiliary Input Select',4,'In some off-highway applications it may be desirable to have multiple droop settings available across the range of engine operation.  For example, in an agricultural tractor application, this functionality allows a higher engine speed during low load so as to maximize vehicle speed driven between fields on the road. Another use of the alternate droop settings would be to provide functionality for maintaining an engine speed independent of the applied load on demand. There is a normal droop setting, and up to 13 additional preprogrammed droop settings which are user selectable by switching. The selections apply to the Alternate Droop Auxiliary Input.
INSERT INTO experimenteditor_spnpgnentry VALUES(2550,64972,2873,'Work Light Switch',4,'A 4 bit parameter to indicate the selected position of the operator''s work light switch. In Ag applications the work lights are often refereed to as field lights.  In on-highway applications the work lights are often referred to as clearance lights and may or may not be operated by a switch separate from the main light switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(2551,64972,2872,'Main Light Switch',4,'A 4 bit parameter to indicate the selected position of the operator''s main light switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(2552,64972,2876,'Turn Signal Switch',4,'A 4 bit parameter to indicate the selected position of the operator''s turn signal switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(2553,64972,2875,'Hazard Light Switch',2,'A 2 bit parameter to indicate the selected position of the operator''s hazard light switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(2554,64972,2874,'High-Low Beam Switch',2,'A 2 bit parameter to indicate the selected position of the operator''s high/low beam select switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(2555,64972,2878,'Operators Desired Back-light',8,'A 8 bit parameter to indicate the level of back lighting the operator has selected for displays.  This is to be differentiated from the Illumination Brightness Percent (SPN:1487 PGN:53248 Cab Illumination Message) which is sent to the displays to tell them what level to be at.  This is the operator desired level (as sensed by operator controls) for those system where the operator controls are monitored by an ecu separate from the ecu sending the command to the displays.  Note each display (if appropriate) will need to have its own balance function to compensate its nominal brightness to the same level of that of all other displays.  This is especially important for systems with back-lights which may change noticeable with aging.  In other words it will be necessary within a vehicle to scale all of the displays down to the same level as the dimmest display (since, obviously you can not make the dimmest brighter).','Operators External Light Controls Message','3','Every 1 s and on change of switch state but no faster than every 100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2556,64972,2877,'Operators Desired - Delayed Lamp Off Time',16,'A 16 bit parameter to be associated with Delayed Off position (1000 binary) of the Main Light Switch.  This parameter indicates the time the operator wishes to have elapse following the Main Light switch being placed in Delayed Off position before the defined lights turn back off.  The Operator''s definition as to which lamps are to turn On (and then Off of course) when the Main Light Switch is in the Delayed Off position.  The specific lamps are not identified within this message, but are to be stored by whatever device (ecu) is planning to send the lamp command message for said lamps.  Said device must also provide the means for the operator to enter and/or adjust said definition.','Operators External Light Controls Message','4-5','Every 1 s and on change of switch state but no faster than every 100 ms','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2557,64973,2864,'Front Non-operator Wiper Switch',4,'State of operation selected by operator switch for the front wiper not in front of the operator position.  The parameter, ''Front Operator Washer Switch'' should be used for the control information if this parameter is ''Not Available'' and the associated washer still needs to be controlled.
INSERT INTO experimenteditor_spnpgnentry VALUES(2558,64973,2863,'Front Operator Wiper Switch',4,'State of operation selected by operator switch for the Wiper in front of the operator position. This parameter, ''Front Operator Wiper Switch'' should be used for the control information if either of the other wiper switch parameters is ''Not Available'' and the associated wiper still needs to be controlled.
INSERT INTO experimenteditor_spnpgnentry VALUES(2559,64973,2865,'Rear Wiper Switch',4,'State of operation selected by operator switch for the rear wiper.  The parameter, ''Front Operator Washer Switch'' should be used for the control information if this parameter is ''Not Available'' and the associated washer still needs to be controlled.
INSERT INTO experimenteditor_spnpgnentry VALUES(2560,64973,2869,'Front Operator Wiper Delay Control',8,'Time between cycles of the front operator side wiper (i.e. from end of cycle ''n'' to start of cycle ''n+1'') as selected by the operator control (switch, etc.) in percentage of position with maximum position corresponding to maximum delay selectable.  This parameter, ''Front Operator Wiper Delay Control'' should be used for the delay information if either of the other delay parameters is ''Not Available'' and the function needs to be provided.','Operator Wiper and Washer Controls Message','3','200 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2561,64973,2870,'Front Non-operator Wiper Delay Control',8,'Time between cycles of the front non-operator side wiper (i.e. from end of cycle ''n'' to start of cycle ''n+1'') as selected by the operator control (switch, etc.) in percentage of position with maximum position corresponding to maximum delay selectable.  The parameter, ''Front Operator Wiper Delay Control'' should be used for the delay information if this parameter is ''Not Available'' and the function needs to be provided.','Operator Wiper and Washer Controls Message','4','200 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2562,64973,2871,'Rear Wiper Delay Control',8,'Time between cycles of the rear wiper (i.e. from end of cycle ''n'' to start of cycle ''n+1'') as selected by the operator control (switch, etc.) in percentage of position with maximum position corresponding to maximum delay selectable.  The parameter, ''Front Operator Wiper Delay Control'' should be used for the delay information if this parameter is ''Not Available'' and the function needs to be provided.','Operator Wiper and Washer Controls Message','5','200 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2563,64973,2867,'Front Non-operator Washer Switch',3,'State of operation selected by operator switch for the front washer not in front of the operator position.  The parameter, ''Front Operator Washer Switch’ should be used for the control information if this parameter  is ''Not Available'' and the associated washer still needs to be controlled.
INSERT INTO experimenteditor_spnpgnentry VALUES(2564,64973,2866,'Front Operator Washer Switch',3,'State of operation selected by operator switch for the washer in front of the operator position. This parameter, ''Front Operator Washer Switch’ should be used for the control information if either of the other washer switch parameters  is ''Not Available'' and the associated washer still needs to be controlled.
INSERT INTO experimenteditor_spnpgnentry VALUES(2565,64973,2868,'Rear Washer Function',3,'State of operation selected by operator switch for the rear washer.   The parameter, ''Front Operator Washer Switch’ should be used for the control information if this parameter is ''Not Available'' and the associated washer still needs to be controlled.
INSERT INTO experimenteditor_spnpgnentry VALUES(2566,64974,2845,'NAME of Working Set Member',64,'NAME of Working Set Member
INSERT INTO experimenteditor_spnpgnentry VALUES(2567,64975,2409,'Number of Members in Working Set',8,'The number of members in a particular Working Set.  The particular Working Set is identified by the NAME of the Working Set Master, which is associated with the Source Address of the message containing this parameter.  No member (as identified by a specific NAME, not by ECU) may belong to more than one Working Set at a time.  Reference ISO 11783-6[4] and ISO 11783-1[2] for descriptions of a Working Set, Working Set Master and members of a Working set.','Working Set Master Message','1','As required','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2568,64976,2809,'Engine Air Filter 2 Differential Pressure',8,'Change in engine air system pressure, measured across the second air filter, due to the filter and any accumulation of solid foreign matter on or in the filter.
INSERT INTO experimenteditor_spnpgnentry VALUES(2569,64976,2810,'Engine Air Filter 3 Differential Pressure',8,'Change in engine air system pressure, measured across the third air filter, due to the filter and any accumulation of solid foreign matter on or in the filter.
INSERT INTO experimenteditor_spnpgnentry VALUES(2570,64976,2811,'Engine Air Filter 4 Differential Pressure',8,'Change in engine air system pressure, measured across the fourth air filter, due to the filter and any accumulation of solid foreign matter on or in the filter.
INSERT INTO experimenteditor_spnpgnentry VALUES(2571,64976,3562,'Engine Intake Manifold #2 Pressure',8,'The gage pressure measurement of the air intake manifold for bank #2 or the second air intake manifold. If there are multiple air pressure sensors in the second intake stream, this is the last one in flow direction before entering the combustion chamber. See also SPNs 1127-1130 and SPN 102 for alternate range and resolution.','Intake/Exhaust Conditions 2','4','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2572,64976,3563,'Engine Intake Manifold #1 Absolute Pressure',8,'The absolute pressure measurement of the air intake manifold. If there are multiple air pressure sensors in the intake stream, this is the last one in flow direction before entering the combustion chamber.','Intake/Exhaust Conditions 2','5','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2573,64976,5422,'Engine Intake Manifold 2 Absolute Pressure',8,'The absolute pressure measurement of the air intake manifold for bank 2 or the second air intake manifold. If there are multiple air pressure sensors in the intake stream, this is the last one in flow direction before entering the combustion chamber.','Intake/Exhaust Conditions 2','8','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2574,64976,4817,'Engine Intake Manifold #1 Absolute Pressure (High Resolution)',16,'The absolute pressure measurement of the air intake manifold. If there are multiple air pressure sensors in the intake stream, this is the last one in flow direction before entering the combustion chamber.  This SPN is a high resolution measurement.  See SPN 3563 if high resolution is not needed.','Intake/Exhaust Conditions 2','6-7','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2575,64977,2804,'FMS-standard Diagnostics Supported',2,'Status signal which indicates if the FMS Vehicle Interface (FMS Gateway) supports the handling of diagnostic messages from the vehicle network onto the FMS network.
INSERT INTO experimenteditor_spnpgnentry VALUES(2576,64977,2805,'FMS-standard Requests Supported',2,'Status signal which indicates if the FMS Vehicle Interface (FMS Gateway) will respond to requests from the FMS device for the PGNs listed in the FMS Interface Specification.
INSERT INTO experimenteditor_spnpgnentry VALUES(2577,64977,2806,'FMS-standard SW-version supported.',32,'Information that identifies which issue level of the FMS-standard document the software included in the FMS gateway supports. Four bytes, representing xx.yy type revision level identification.
INSERT INTO experimenteditor_spnpgnentry VALUES(2578,64978,2802,'Data Memory Usage',8,'The used storage capacity of the data buffer memory internal to an ECU, such as a data logger.','ECU Performance','3','On request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2579,64978,2803,'Keep-Alive Battery Consumption',16,'The capacity consumed from the direct battery connection since the key was last turned off.  This value is maintained and does not accumulate while the key switch is on.  The value is reset to 0 when the key switch is turned to the off position.','ECU Performance','1-2','On request','mAhr','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2580,64979,2629,'Engine Turbocharger 1 Compressor Outlet Temperature',16,'Temperature of the air exiting the turbocharger 1 compressor outlet','Turbocharger Information 6','1-2','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2581,64979,2799,'Engine Turbocharger 2 Compressor Outlet Temperature',16,'Temperature of the air exiting the turbocharger 2 compressor outlet','Turbocharger Information 6','3-4','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2582,64979,2800,'Engine Turbocharger 3 Compressor Outlet Temperature',16,'Temperature of the air exiting the turbocharger 3 compressor outlet','Turbocharger Information 6','5-6','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2583,64979,2801,'Engine Turbocharger 4 Compressor Outlet Temperature',16,'Temperature of the air exiting the turbocharger 4 compressor outlet','Turbocharger Information 6','7-8','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2584,64980,2796,'Transfer Case Selector Switch',3,'Operator switch to select the condition of the transfer case.  States 000 and 001 should be used if the transfer case only functions to switch between 2-wheel and 4-wheel drive.  If the transfer case includes a High / Low Range function, states 011 and 100 should be supported as well.  For reporting the status of the transfer case, see SPN 3645.
INSERT INTO experimenteditor_spnpgnentry VALUES(2585,64980,3314,'Fifth Wheel Release Control',2,'Operator input used to release the fifth wheel. Fifth Wheel Release Control Security Lockout and other conditions must be properly enabled before this will function.
INSERT INTO experimenteditor_spnpgnentry VALUES(2586,64980,3315,'Fifth Wheel Release Control Security Lockout',2,'Operator''s fifth wheel release control interlock. This operator input must be enabled prior to activating the fifth wheel release control (SPN 3314). 
INSERT INTO experimenteditor_spnpgnentry VALUES(2587,64980,3809,'Transmission Oil Level Request',2,'Conveys operator or vehicle system desire for a transmission oil level reading to be taken. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2588,64981,2792,'Engine Variable Geometry Turbocharger (VGT) Air Control Shutoff Valve',2,'Isolates vehicle brake air from the Variable Geometry Turbocharger (VGT) system when engine is not running.  This valve prevents vehicle air from bleeding off through the VGT Control Valve when engine is not in use.  Primary vehicle air system from air tanks feed the VGT Air Control Shutoff Valve, which in turn provides air to the VGT Control Valve when the key switch is ''ON''.  The VGT Control Valve delivers air to the VGT actuator to adjust turbocharger geometry.
INSERT INTO experimenteditor_spnpgnentry VALUES(2589,64981,5323,'Engine Fuel Control Control Mode',2,'Indicates whether the Engine Fuel Control System is in open loop or closed loop.
INSERT INTO experimenteditor_spnpgnentry VALUES(2590,64981,5457,'Engine Variable Geometry Turbocharger 1 Control Mode',2,'Indicates if the variable geometry turbocharger control status is either open loop or closed loop.
INSERT INTO experimenteditor_spnpgnentry VALUES(2591,64981,2795,'Engine Variable Geometry Turbocharger (VGT) 1 Actuator Position',8,'Sensor that measures the position of the variable geometry turbocharger actuator.  A  position of 0% indicates the actuator is in the position creating the smallest geometry turbocharger. A position of 100% represents the largest geometry turbocharger.','Electronic Engine Controller 5','8','On request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2592,64981,2789,'Engine Turbocharger 1 Calculated Turbine Intake Temperature',16,'Calculated value of turbine intake temperature based on engine operating conditions, such as intake manifold temperature, charge fuel ratio, injection timing, and engine speed.  Use SPN 1180 for actual measured intake temperature.','Electronic Engine Controller 5','1-2','On request','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2593,64981,2790,'Engine Turbocharger 1 Calculated Turbine Outlet Temperature',16,'Calculated value of turbocharger compressor outlet air temperature.  Temperature of air exiting the turbocharger compressor and before entering charge air cooler.  The estimate is based on turbo speed and measured turbocharger compressor intake temperature.  Use SPN 1184 for actual measured outlet temperature.','Electronic Engine Controller 5','3-4','On request','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2594,64981,2791,'Engine Exhaust Gas Recirculation 1 (EGR1) Valve Control',16,'Desired percentage of maximum Exhaust Gas Recirculation (EGR) valve opening.  0% means valve is closed. 100% means maximum valve opening (full gas flow).','Electronic Engine Controller 5','5-6','On request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2595,64982,2675,'Joystick 1 X-Axis Neutral Position Status',2,'Reports when the current joystick position is in the neutral position for that axis of travel.  The neutral position measurement must be determined from some mechanism other than the axis position measurement device.  
INSERT INTO experimenteditor_spnpgnentry VALUES(2596,64982,2670,'Joystick 1 X-Axis Lever Left Negative Position Status',2,'Reports when the current joystick position is on the negative travel side (back, left, counterclockwise, down) relative to the neutral position for that axis of travel. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2597,64982,2665,'Joystick 1 X-Axis Lever Right Positive Position Status',2,'Reports when the current joystick position is on the positive travel side (forward, right, clockwise, up) relative to the neutral position for that axis of travel. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2598,64982,2676,'Joystick 1 Y-Axis Neutral Position Status',2,'Reports when the current joystick position is in the neutral position for that axis of travel.  The neutral position measurement must be determined from some mechanism other than the axis position measurement device.  
INSERT INTO experimenteditor_spnpgnentry VALUES(2599,64982,2671,'Joystick 1 Y-Axis Lever Back Negative Position Status',2,'Reports when the current joystick position is on the negative travel side (back, left, counterclockwise, down) relative to the neutral position for that axis of travel. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2600,64982,2666,'Joystick 1 Y-Axis Lever Forward Positive Position Status',2,'Reports when the current joystick position is on the positive travel side (forward, right, clockwise, up) relative to the neutral position for that axis of travel. 
INSERT INTO experimenteditor_spnpgnentry VALUES(2601,64982,2681,'Joystick 1 Y-Axis Detent Position Status',2,'Reports when the current joystick position is in the detent position for that axis of travel.
INSERT INTO experimenteditor_spnpgnentry VALUES(2602,64982,2680,'Joystick 1 X-Axis Detent Position Status',2,'Reports when the current joystick position is in the detent position for that axis of travel.
