INSERT INTO experimenteditor_spnpgnentry VALUES(2609,64982,2690,'Joystick 1 Button 6 Pressed Status',2,'Reports when the joystick button has been pressed.
INSERT INTO experimenteditor_spnpgnentry VALUES(2610,64982,2689,'Joystick 1 Button 5 Pressed Status',2,'Reports when the joystick button has been pressed.
