INSERT INTO experimenteditor_spnpgnentry VALUES(2724,64995,2601,'Travel Velocity Control Position',8,'The position of the travel velocity control component reported as a percentage of the control''s full displacement in each direction respectively.  Positive position values indicate forward travel direction;  negative position values indicate reverse, or backward, travel direction; and zero (0) percent position indicates the control device is in the neutral position.  Higher percent for a particular travel direction indicates a higher desired travel speed in that direction.','Equipment Operation and Control','1','250 mS','%','-125','8');
