INSERT INTO experimenteditor_spnpgnentry VALUES(2847,65035,NULL,'',NULL,'','Implement Remote Control Command','1','default is 100 ms, maximum is 10 ms for doing closed loop cruise control.  For setting slip control functions a repetition rate of 1 in 10 seconds and on change of state is required.','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2848,65036,NULL,'',NULL,'','Working Set Member','1','As Required','','','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2849,65037,2409,'Number of Members in Working Set',8,'The number of members in a particular Working Set.  The particular Working Set is identified by the NAME of the Working Set Master, which is associated with the Source Address of the message containing this parameter.  No member (as identified by a specific NAME, not by ECU) may belong to more than one Working Set at a time.  Reference ISO 11783-6[4] and ISO 11783-1[2] for descriptions of a Working Set, Working Set Master and members of a Working set.','Working Set Master','1','As Required','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2850,65038,2421,'Process Data Modifier',3,'This 3 bit parameter that indicates how the data in the following Process Data Parameters is to be used when combined with the Process Data Type parameter. See Table A.2.
INSERT INTO experimenteditor_spnpgnentry VALUES(2851,65038,2420,'Process Data Type',2,'This 2 bit parameter indicates what the data in the following Process Data Parameters is to be used for. See Table A.2.
INSERT INTO experimenteditor_spnpgnentry VALUES(2852,65038,2419,'Data Format/Error Condition',2,'This 2 bit parameter that indicates the format or availability of the data in the following Process Data Parameter.
INSERT INTO experimenteditor_spnpgnentry VALUES(2853,65038,2426,'Implement Position',4,'This 4 bit parameter of this message will indicate which Implement is referenced within a set of identical Implements.  The numbering is to start with 1 at the leftmost, foremost, bottom most implement.  The numbering will then increment from left to right followed by front to rear followed by bottom to top.  (Left being defined as to a person’s left when looking toward the front of the vehicle from behind the vehicle).  Special case ‘15’ is to signify all Positions of Implements of this Implement Type.
INSERT INTO experimenteditor_spnpgnentry VALUES(2854,65038,2425,'Implement Type',4,'This 4 bit parameter indicates which data dictionary page is to be used to locate the identity of the following data.','Response for Repetition Rate','7.5','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2855,65038,2428,'Data Dictionary Column',4,'This 4 bit parameter indicates the Column that is to be used within the specific Data Dictionary Table identified by the Implement Type. This is the Instance (INST) in LBS documents.','Response for Repetition Rate','8.1','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2856,65038,2427,'Data Dictionary Row',4,'This 4 bit parameter indicates the Row that is to be used within the specific Data Dictionary Table identified by the Implement Type. This is the Group (GRUP) in LBS documents.','Response for Repetition Rate','8.5','On request','bit','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(2857,65038,2418,'Repetition Rate Parameter',16,'This parameter defines the repetition rate of the specified PGN.','Response for Repetition Rate','4-5','On request','Seconds','0','8');
