INSERT INTO experimenteditor_spnpgnentry VALUES(3161,65093,1877,'Rear Hitch In-work Indication',2,'A measured signal indicating that the rear hitch is positioned below (in-work) or above (out-of-work) an adjustable switching threshold.  The method of determining switching threshold is not standardise and will be determined by machine designers.
INSERT INTO experimenteditor_spnpgnentry VALUES(3162,65093,1881,'Rear  Nominal Lower Link Force',8,'This measurement provides an indication of draft at the lower links of the rear three point hitch. Nominal lower link force may be expected to be approximately linear with respect to draft and may be proportional to draft for a single hitch position.  This measurement is typically obtained from a transducer on the lower hitch links and is typically used as raw data in draft control. .  A positive value indicates force applied to the tractor opposed to heading.','Primary or Rear Hitch Status','3','100ms','%','-100','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3163,65093,5819,'Rear hitch exit/reason code',5,'This parameter indicates why the Rear Hitch cannot accept remote commands or has most recently stopped accepting remote commands.
