INSERT INTO experimenteditor_spnpgnentry VALUES(3166,65094,1876,'Front Hitch In-work Indication',2,'A measured signal indicating that the front hitch is positioned below (in-work) or above (out-of-work) an adjustable switching threshold.
INSERT INTO experimenteditor_spnpgnentry VALUES(3167,65094,1880,'Front Nominal Lower Link Force',8,'This measurement provides an indication of draft at the lower links of the front three point hitch. Nominal lower link force may be expected to be approximately linear with respect to draft and may be proportional to draft for a single hitch position.  This measurement is typically obtained from a transducer on the lower hitch links and is typically used as raw data in draft control. A positive value indicates force applied to the tractor opposed to heading.','Secondary or Front Hitch Status','3','100ms','%','-100','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3168,65094,1878,'Front Draft',16,'The apparent horizontal force applied to the front hitch by an implement.  A positive value indicates force applied to the tractor opposed to heading.','Secondary or Front Hitch Status','4-5','100ms','N','-320000','8');
