INSERT INTO experimenteditor_spnpgnentry VALUES(3173,65095,1869,'Implement Transport State',2,'Indicates the transport state of an implement connected to a tractor or power unit.
INSERT INTO experimenteditor_spnpgnentry VALUES(3174,65096,1866,'Maximum Time of Tractor Power',8,'The maximum time of remaining tractor or power unit supplied electrical power at the current load.','Wheel-based Speed and Distance','7','100 ms','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3175,65096,1864,'Wheel Based Direction',2,'A measured signal indicating either forward or reverse as the direction of travel.  When speed is zero, indicate the last travel direction until a different direction is detected or selected and engaged.
INSERT INTO experimenteditor_spnpgnentry VALUES(3176,65096,1865,'Key Switch NOT OFF',2,'Indicates the Key Switch of the tractor or power unit is NOT in the Off position. This does not indicate unforeseen power interruption such as those caused by starting the engine or due to connector intermittents.
INSERT INTO experimenteditor_spnpgnentry VALUES(3177,65096,1862,'Wheel Based Speed',16,'A value of the speed of a machine as calculated from the measured wheel or tail shaft speed.','Wheel-based Speed and Distance','1-2','100 ms','m/s','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3178,65096,1863,'Wheel Based Distance',32,'The distance travelled by a machine as calculated from wheel or tail shaft speed.  When distance exceeds 4211081,215 m, the value should be reset to zero and incremented as additional distance accrues.','Wheel-based Speed and Distance','3-6','100 ms','m','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3179,65097,1861,'Ground Based Direction',2,'A measured signal indicating either forward or reverse as the direction of travel.  When speed is zero, indicate the last travel direction until a different direction is detected.
INSERT INTO experimenteditor_spnpgnentry VALUES(3180,65097,1859,'Ground Based Implement Speed',16,'Actual ground speed of a machine, measured by a sensor such as RADAR.','Ground-based Speed and Distance','1-2','100 ms','m/s','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3181,65097,1860,'Ground Based Implement Distance',32,'Actual distance travelled by a machine based on measurements from a sensor such as RADAR.  When distance exceeds 4 211 081.215 m, the value should be reset to zero and incremented as additional distance accrues.','Ground-based Speed and Distance','3-6','100 ms','m','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3182,65098,4176,'Transmission Current Range Display Blank State',2,'State signal indicating a transmission request for the display of the Transmission Current Range parameter (SPN 163) to be blanked or not blanked.  The ''Transmission Current Range Display Blank State'' indicator can be utilized by (but not limited to) the shift console, instrument cluster, or cab display.  Definition of the cause of this state is at the discretion of the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3183,65098,4178,'Transmission Service Indicator',2,'Signal from transmission indicating that some aspect of the gearbox requires servicing, such as the oil, filter, clutch(es) or other component.
INSERT INTO experimenteditor_spnpgnentry VALUES(3184,65098,1850,'Transmission Requested Range Display Blank State',2,'State signal indicating a transmission request for the display of the Transmission Requested Range parameter (SPN162) to be blanked or not blanked.  The ‘Transmission Requested Range Display Blank State’ indicator can be utilized by (but not limited to) the shift console, instrument cluster, or cab display.  Definition of the cause of this state is at the discretion of the transmission manufacturer
INSERT INTO experimenteditor_spnpgnentry VALUES(3185,65098,1849,'Transmission Requested Range Display Flash State',2,'State signal indicating a transmission request for the display of the Transmission Requested Range parameter (SPN 162) to flash or not to flash. The ‘Transmission Requested Range Display Flash State’ indicator can be utilized by (but not limited to) the shift console, instrument cluster, or cab display.  Definition of the cause of this state is at the discretion of the transmission manufacturer. The flash period shall be 700 ms @ 50% duty cycle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3186,65098,3086,'Transmission Ready for Brake Release',2,'This parameter indicates that enough torque / motive force is available at the transmission output shaft to release all the brakes without a risk of unintentional movement in the opposite direction.
INSERT INTO experimenteditor_spnpgnentry VALUES(3187,65098,2945,'Active Shift Console Indicator',2,'Signal from transmission control unit indicating which shift console (primary or secondary) it currently considers as the active shift selector input.
INSERT INTO experimenteditor_spnpgnentry VALUES(3188,65098,2900,'Transmission Engine Crank Enable',2,'State signal from the transmission indicating if the transmission’s status is such that engine cranking is allowed (i.e.  at a minimum, transmission is in neutral and the driveline is disengaged).  As sender of this information, the transmission is responsible for correct indication immediately upon first broadcast of this parameter.  
INSERT INTO experimenteditor_spnpgnentry VALUES(3189,65098,1851,'Transmission Shift Inhibit Indicator',2,'State signal indicating a transmission request for the Shift Inhibit Indicator to be active or inactive. The shift inhibit indicator can be of lamp or text form, located on (but not limited to) the shift console, instrument cluster, or cab display.  Definition of the cause of the ‘range inhibit’ state is at the discretion of the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3190,65098,2539,'Transmission Mode 4 Indicator',2,'This state signal is the transmission’s indication that it is operating under transmission mode 4 (SPN 1855) as commanded via the TC1 message (PGN 256).  The definition of the transmission mode is left to the discretion of the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3191,65098,2538,'Transmission Mode 3 Indicator',2,'This state signal is the transmission’s indication that it is operating under transmission mode 3 (SPN 1854) as commanded via the TC1 message (PGN 256).  The definition of the transmission mode is left to the discretion of the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3192,65098,2537,'Transmission Mode 2 Indicator',2,'This state signal is the transmission’s indication that it is operating under transmission mode 2 (SPN 1853) as commanded via the TC1 message (PGN 256).  The definition of the transmission mode is left to the discretion of the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3193,65098,2536,'Transmission Mode 1 Indicator',2,'This state signal is the transmission’s indication that it is operating under transmission mode 1 (SPN 1852) as commanded via the TC1 message (PGN 256).  The definition of the transmission mode is left to the discretion of the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3194,65098,3289,'Transmission Requested Gear Feedback',8,'Feedback of the SPN 525 Transmission Requested Gear input as received from the shift selector, ABS or engine via PGN 256, Transmission Control 1 (TC1) or other transmission selector input.  Scaling, values and parameter specific indicators are identical to those listed for SPN 525 Requested Gear.
INSERT INTO experimenteditor_spnpgnentry VALUES(3195,65098,4250,'Transmission Mode 5 Indicator',2,'Indicates whether transmission mode 5 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4246.
INSERT INTO experimenteditor_spnpgnentry VALUES(3196,65098,4251,'Transmission Mode 6 Indicator',2,'Indicates whether transmission mode 6 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4247.
INSERT INTO experimenteditor_spnpgnentry VALUES(3197,65098,4252,'Transmission Mode 7 Indicator',2,'Indicates whether transmission mode 7 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4248.
INSERT INTO experimenteditor_spnpgnentry VALUES(3198,65098,4253,'Transmission Mode 8 Indicator',2,'Indicates whether transmission mode 8 is enabled. Modes are manufacturer specific and are not necessarily mutually exclusive. See also SPN 4249.
INSERT INTO experimenteditor_spnpgnentry VALUES(3199,65098,4261,'Transmission Reverse Gear Shift Inhibit Status',2,'Reflects the status of transmission reverse inhibit activity in response to requests via SPN 4242 - Transmission Reverse Gear Shift Inhibit Request.  Typically broadcast by the transmission controller.
INSERT INTO experimenteditor_spnpgnentry VALUES(3200,65098,5344,'Transmission Warning Indicator',2,'Signal from transmission indicating that some aspect of its operation is not functioning correctly, and as a result, transmission operation may be altered or restricted.  The indicator is typically a lamp.  Distinctions in meaning between the continuous and flashing are left to the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(3201,65099,1845,'Transmission Torque Limit',16,'Parameter provided to the engine from the transmission as a torque limit to be invoked by the engine in the event that J1939 communication with the transmission is lost.
INSERT INTO experimenteditor_spnpgnentry VALUES(3202,65100,1840,'Rear Black Out Marker Select',2,'Rear Black Out Marker Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3203,65100,1839,'Front Black Out Marker Lamp Select',2,'Front Black Out Marker Lamp Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3204,65100,1838,'Convoy Lamp Select',2,'Black Out Convoy Lamp Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3205,65100,1837,'Convoy Driving Lamp Select',2,'Black Out Convoy Driving Lamp Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3206,65100,1841,'Black Out Brake/Stop Lamp Select',2,'Black Out Brake/Stop Lamp Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3207,65100,1843,'Night Vision Illuminator Select',2,'Night Vision Illuminator Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3208,65100,1842,'Black Out Work Lamp Select',2,'Black Out Work Lamp Selection
INSERT INTO experimenteditor_spnpgnentry VALUES(3209,65100,1844,'Operators Black Out Intensity Selection',8,'Operators Selection of lamp intensity in black out mode.  This parameter provides the operators selected illumination intensity as a percentage of available full scale.  This parameter would be typically used as a dash or instrument cluster intensity adjustment.','Military Lighting Command','8','500ms or upon state change, but not faster than 100 ms.','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3210,65101,1834,'Engine Total Average Fuel Rate',16,'Average fuel rate, equal to total fuel used divided by total engine hours, over the life of the engine','Total Averaged Information','1-2','On request','l/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3211,65101,1835,'Engine Total Average Fuel Economy',16,'Average fuel economy, equal to total vehicle distance divided by total fuel used, over the life of the engine','Total Averaged Information','3-4','On request','km/L','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3212,65102,1821,'Position of doors',4,'Signal which indicates the actual position of the doors.
INSERT INTO experimenteditor_spnpgnentry VALUES(3213,65102,1820,'Ramp / Wheel Chair Lift Position',2,'Signal which indicates the actual position of the ramp / wheel chair lift.
INSERT INTO experimenteditor_spnpgnentry VALUES(3214,65102,3411,'Status 2 of doors',2,'Composite indication of all bus door statuses. Enabled means the bus doors are able to be automatically opened or closed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3215,65103,1813,'VDC Information Signal',2,'This parameter commands the VDC information signal, for example a dash lamp.
INSERT INTO experimenteditor_spnpgnentry VALUES(3216,65103,1814,'VDC Fully Operational',2,'Signal that indicates whether VDC is fully operational or whether its functionality is reduced by a permanent or temporary (e.g. low voltage) defect, by intended action (e.g. disabled by a switch or during special diagnostic procedures), not configured or not yet fully initialized (e.g. missing initialization or configuration message). VDC contains ROP and YC.
INSERT INTO experimenteditor_spnpgnentry VALUES(3217,65103,1815,'VDC brake light request',2,'Indicates whether VDC requests to turn the vehicle brake lights on
INSERT INTO experimenteditor_spnpgnentry VALUES(3218,65103,1816,'ROP Engine Control active',2,'State Signal which indicates that the Roll Over Prevention (ROP) has commanded engine control to be active. Within the physical limits, ROP attempts to prevent rolling over of the vehicle. Active means that ROP actually tries to control the engine. This state signal is independent of other control commands to the engine which may have higher priority.
INSERT INTO experimenteditor_spnpgnentry VALUES(3219,65103,1818,'ROP Brake Control active',2,'State signal which indicates that Roll over Prevention (ROP) has activated brake control. Active means that ROP actually controls wheel brake pressure at one or more wheels of the vehicle or vehicle combination. Within the physical limits, ROP attempts to prevent rolling over of the vehicle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3220,65103,1817,'YC Engine Control active',2,'State Signal which indicates that the Yaw Control (YC) has commanded engine control to be active. Within the physical limits, YC attempts to prevent yawing of the vehicle. Active means that YC actually tries to control the engine. This state signal is independent of other control commands to the engine which may have higher priority.
INSERT INTO experimenteditor_spnpgnentry VALUES(3221,65103,1819,'YC Brake Control active',2,'State signal which indicates that Yaw Control (YC) has activated brake control. Active means that YC actually controls wheel brake pressure at one or more wheels of the vehicle or vehicle combination. Within the physical limits, YC attempts to prevent yawing of the vehicle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3222,65103,5624,'Trailer-VDC Active',2,'The trailer-VDC (Vehicle Dynamic Control) is an electronic vehicle stability function within the (semi) trailer braking system. It acts to stabilize the (semi) trailer during dynamic maneuvers. VDC includes Roll Over Prevention (ROP) and/or Yaw Control (YC), However, the latter information is not individually available and the VDC active parameter will be set in both cases.
INSERT INTO experimenteditor_spnpgnentry VALUES(3223,65104,1800,'Battery 1 Temperature',8,'Temperature of the battery 1.  The relation to physical location is determined by the equipment manufacturer.','Battery Temperature','1','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3224,65104,1801,'Battery 2 Temperature',8,'Temperature of the battery 2. The relation to physical location is determined by the equipment manufacturer.','Battery Temperature','2','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3225,65105,5023,'ACC usage demand',2,'This parameter indicates the drivers demand to activate or deactivate ACC keeping distance control.
INSERT INTO experimenteditor_spnpgnentry VALUES(3226,65105,1799,'Requested ACC Distance Mode',3,'The Requested Distance Control Mode to the ACC system from the operators interface.
INSERT INTO experimenteditor_spnpgnentry VALUES(3227,65106,1795,'Alternator Current (High Range/Resolution)',16,'This parameter indicates the amount of electrical current output from the alternator of the main vehicle.  Alternator Current (SPN 115) has a lower range and resolution.','Vehicle Electrical Power #3','1-2','1 s','Amps','-1600','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3228,65106,2579,'Net Battery Current (High Range/Resolution)',16,'Net flow of electrical current into/out-of the battery or batteries.  This parameter is the high range and resolution of SPN 114 - Net Battery Current.','Vehicle Electrical Power #3','3-4','1 s','Amps','-1600','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3229,65107,1776,'Low Limit Threshold for Maximum RPM from Retarder',8,'Minimum allowable value for maximum continuous retarder speed','Retarder Continuous Torque & Speed Limit','1','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3230,65107,1777,'High Limit Threshold for Minimum Continuous RPM from Retarder',8,'Maximum allowable value for minimum continuous retarder speed','Retarder Continuous Torque & Speed Limit','2','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3231,65107,1778,'Low Limit Threshold for Maximum Torque from Retarder',8,'Minimum allowable value for maximum continuous retarder torque.','Retarder Continuous Torque & Speed Limit','3','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3232,65107,1779,'High Limit Threshold for Minimum Continuous Torque from Retarder',8,'Maximum allowable value for minimum continuous retarder torque.','Retarder Continuous Torque & Speed Limit','4','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3233,65107,1780,'Maximum Continuous Retarder Speed ',8,'Applied limit for maximum continuous retarder RPM','Retarder Continuous Torque & Speed Limit','5','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3234,65107,1781,'Minimum Continuous Retarder Speed',8,'Applied limit for minimum continuous retarder RPM','Retarder Continuous Torque & Speed Limit','6','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3235,65107,1782,'Maximum Continuous Retarder Torque',8,'Applied limit for maximum continuous retarder torque.','Retarder Continuous Torque & Speed Limit','7','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3236,65107,1783,'Minimum Continuous Retarder Torque',8,'Applied limit for minimum continuous retarder torque','Retarder Continuous Torque & Speed Limit','8','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3237,65108,1768,'Engine Low Limit Threshold for Maximum RPM from Engine',8,'Minimum allowable value for maximum continuous RPM from engine','Engine Continuous Torque & Speed Limit','1','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3238,65108,1769,'Engine High Limit Threshold for Minimum Continuous Engine RPM',8,'Maximum allowable value for minimum continuous RPM from engine','Engine Continuous Torque & Speed Limit','2','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3239,65108,1770,'Engine Low Limit Threshold for Maximum Torque from Engine',8,'Minimum allowable value for maximum continuous torque from engine','Engine Continuous Torque & Speed Limit','3','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3240,65108,1771,'Engine High Limit Threshold for Minimum Continuous Torque from Engine',8,'Maximum allowable value for minimum continuous torque from engine','Engine Continuous Torque & Speed Limit','4','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3241,65108,1772,'Engine Maximum Continuous RPM',8,'Applied limit for maximum continuous engine RPM','Engine Continuous Torque & Speed Limit','5','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3242,65108,1773,'Engine Minimum Continuous RPM',8,'Applied limit for minimum continuous engine RPM','Engine Continuous Torque & Speed Limit','6','5 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3243,65108,1774,'Engine Maximum Continuous Torque',8,'Applied limit for maximum continuous engine torque.','Engine Continuous Torque & Speed Limit','7','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3244,65108,1775,'Engine Minimum Continuous Torque',8,'Applied limit for minimum continuous engine torque','Engine Continuous Torque & Speed Limit','8','5 s','%','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3245,65109,1767,'Specific Heat Ratio',16,'The specific heat ratio of the fuel.','Gaseous Fuel Properties','1-2','On request','Ratio','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3246,65109,5684,'Reference Engine Gas Mass Flow Rate',16,'Configuration of the mass flow rate of gaseous fuel expected for 100% engine fuel valve control command.
INSERT INTO experimenteditor_spnpgnentry VALUES(3247,65109,4245,'Fuel energy content',16,'Energy content (lower heating value) of the gaseous fuel.
INSERT INTO experimenteditor_spnpgnentry VALUES(3248,65110,1761,'Aftertreatment 1 Diesel Exhaust Fluid Tank Level',8,'Ratio of volume of diesel exhaust fluid to the total volume of diesel exhaust fluid storage container. 
INSERT INTO experimenteditor_spnpgnentry VALUES(3249,65110,3031,'Aftertreatment 1 Diesel Exhaust Fluid Tank Temperature',8,'Temperature of the diesel exhaust fluid in the storage tank.','Aftertreatment 1 Diesel Exhaust Fluid Tank 1 Information','2','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3250,65110,3532,'Aftertreatment 1 Diesel Exhaust Fluid Tank Level Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI that applies to the most significant failure of the diesel exhaust fluid tank level sensor.  This FMI is applicable to either the diesel exhaust fluid tank level 1 or diesel exhaust fluid tank level 2 parameters.','Aftertreatment 1 Diesel Exhaust Fluid Tank 1 Information','5.1','1 s','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3251,65110,5245,'Aftertreatment 1 DEF Tank Low Level Indicator',3,'The desired illumination of the driver''s warning indicator for diesel exhaust fluid (DEF) tank low level.
INSERT INTO experimenteditor_spnpgnentry VALUES(3252,65110,4365,'Aftertreatment 1 SCR Catalyst Reagent Tank 1 Temperature Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the SCR catalyst reagent tank 1 temperature, by the manufacturer’s control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Diesel Exhaust Fluid Tank 1 Information','6.1','1 s','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3253,65110,5246,'Aftertreatment SCR Operator Inducement Severity',3,'Severity status of the operator inducement system for anomalies with the SCR system, such as tampering, low DEF quality, and DEF tank level.  Higher numerical levels indicate more severe levels of inducement.  Level 1 is the least severe.
INSERT INTO experimenteditor_spnpgnentry VALUES(3254,65110,3363,'Aftertreatment 1 Diesel Exhaust Fluid Tank Heater',8,'Percentage of heating applied to the aftertreatment 1 diesel exhaust fluid tank heater.  A value of 0% means no heating applied, a value of 100% means full heating applied.  The diesel exhaust fluid tank heater warms the diesel exhaust fluid in the diesel exhaust fluid tank.  See SPN 5137 for the command for this tank heater.','Aftertreatment 1 Diesel Exhaust Fluid Tank 1 Information','7','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3255,65110,4366,'Aftertreatment 1 SCR Catalyst Reagent Tank 1 Heater Preliminary FMI',5,'Used to identify the applicable J1939-73 FMI detected in the SCR catalyst reagent tank 1 heater, by the manufacturer’s control software in exhaust bank 1. When there is no failure FMI 31 is sent. In the case of multiple failures the most severe is communicated.','Aftertreatment 1 Diesel Exhaust Fluid Tank 1 Information','8.1','1 s','binary','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3256,65110,3517,'Aftertreatment 1 Diesel Exhaust Fluid Tank Level 2',16,'The measure of the diesel exhaust fluid level in the diesel exhaust fluid tank.','Aftertreatment 1 Diesel Exhaust Fluid Tank 1 Information','3-4','1 s','m','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3257,65111,1729,'Damper Stiffness Front Axle',8,'Damper stiffness information of the shock absorber control at the front axle','Air Suspension Control 5','1','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3258,65111,1730,'Damper Stiffness Rear Axle',8,'Damper stiffness information of the shock absorber control at the rear axle','Air Suspension Control 5','2','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3259,65111,1731,'Damper Stiffness Lift / Tag Axle',8,'Damper stiffness information of the shock absorber control at the lift of tag axle','Air Suspension Control 5','3','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3260,65111,1833,'Electronic Shock Absorber Control Mode -  Front Axle',2,'Signal which indicates the current mode of operation of the electronic shock absorber control at the front axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3261,65111,1832,'Electronic Shock Absorber Control Mode - Rear Axle',2,'Signal which indicates the current mode of operation of the electronic shock absorber control at the rear axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3262,65111,1831,'Electronic Shock Absorber Control Mode - Lift/Tag Axle',2,'Signal which indicates the current mode of operation of the electronic shock absorber control at the lift/tag axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3263,65112,1725,'Bellow Pressure Front Axle Left',16,'Information of the pressure of the air suspension bellow at the left side of the front axle','Air Suspension Control 4','1-2','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3264,65112,1726,'Bellow Pressure Front Axle Right',16,'Information of the pressure of the air suspension bellow at the right side of the front axle','Air Suspension Control 4','3-4','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3265,65112,1727,'Bellow Pressure Rear Axle Left',16,'Information of the pressure of the air suspension bellow at the left side of the rear axle','Air Suspension Control 4','5-6','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3266,65112,1728,'Bellow Pressure Rear Axle Right',16,'Information of the pressure of the air suspension bellow at the right side of the rear axle','Air Suspension Control 4','7-8','100 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3267,65113,1721,'Relative Level Front Axle Left',16,'Information of the height at the left side of the front axle referred to normal level 1.  For explanations of normal level 1 see SPN 1734 - Nominal Level Front Axle.','Air Suspension Control 3','1-2','100 ms','m','-3.2','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3268,65113,1722,'Relative Level Front Axle Right',16,'Information of the height at the right side of the front axle referred to normal level 1.  For explanations of normal level 1 see SPN 1734 - Nominal Level Front Axle.','Air Suspension Control 3','3-4','100 ms','m','-3.2','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3269,65113,1724,'Relative Level Rear Axle Left',16,'Information of the height at the left side of the rear axle referred to normal level 1.  For explanations of normal level 1 see parameter SPN 1734 - Nominal Level Front Axle.','Air Suspension Control 3','5-6','100 ms','m','-3.2','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3270,65113,1723,'Relative Level Rear Axle Right',16,'Information of the height at the left side of the rear axle referred to normal level 1.  For explanations of normal level 1 see parameter SPN 1734 - Nominal Level Front Axle.','Air Suspension Control 3','7-8','100 ms','m','-3.2','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3271,65114,1734,'Nominal Level Front Axle',4,'Signal which indicates the nominal (desired) height of the front axle to be controlled by the suspension system.
INSERT INTO experimenteditor_spnpgnentry VALUES(3272,65114,1733,'Nominal Level Rear Axle',4,'Signal which indicates the nominal (desired) height of the rear axle to be controlled by the suspension system.
INSERT INTO experimenteditor_spnpgnentry VALUES(3273,65114,1738,'Below Nominal Level Front Axle',2,'Signal which indicates whether the actual height of the front axle is below the nominal (desired) level for the front axle. For explanations of nominal level see parameter SPN 1734 - Nominal Level Front Axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3274,65114,1754,'Below Nominal Level Rear Axle',2,'Signal which indicates whether the actual height of the rear axle is below the nominal (desired) level for the rear axle. For explanations of nominal level see SPN 1734 - Nominal Level Front Axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3275,65114,1737,'Above Nominal Level Front Axle',2,'Signal which indicates whether the actual height of the front axle is above the nominal (desired) level of the front axle. For explanations of nominal level see SPN 1734 - Nominal Level Front Axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3276,65114,1736,'Above Nominal Level Rear Axle',2,'Signal which indicates whether the actual height of the rear axle is above the nominal (desired) level of the rear axle. For explanations of nominal level see parameter SPN 1734 - Nominal Level Front Axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3277,65114,1740,'Lowering Control Mode Front Axle',2,'Signal which indicates the actual lowering level change at the front axle
INSERT INTO experimenteditor_spnpgnentry VALUES(3278,65114,1755,'Lowering Control Mode Rear Axle',2,'Signal which indicates the actual lowering level change at the rear axle
INSERT INTO experimenteditor_spnpgnentry VALUES(3279,65114,1739,'Lifting Control Mode Front Axle',2,'Signal which indicates the actual lifting level change at the front axle
INSERT INTO experimenteditor_spnpgnentry VALUES(3280,65114,1756,'Lifting Control Mode Rear Axle',2,'Signal which indicates the actual lifting level change at the rear axle
INSERT INTO experimenteditor_spnpgnentry VALUES(3281,65114,1742,'Kneeling Information',4,'Signal which indicates the actual level change in case of kneeling function
INSERT INTO experimenteditor_spnpgnentry VALUES(3282,65114,1741,'Level Control Mode',4,'Signal which indicates the actual control mode of the air suspension system
INSERT INTO experimenteditor_spnpgnentry VALUES(3283,65114,1746,'Security Device',2,'The signal which indicates the status of the security device.  An example of a security device is a curbstone feeler installed beneath the doors of a bus. If the security device becomes active during kneeling the kneeling process (lowering) is stopped and the vehicle lifts back to the starting level.
INSERT INTO experimenteditor_spnpgnentry VALUES(3284,65114,1745,'Vehicle Motion Inhibit',2,'Signal which indicates whether vehicle motion is inhibited.
INSERT INTO experimenteditor_spnpgnentry VALUES(3285,65114,1744,'Door Release',2,'Signal which indicates that the doors may be opened. [Please note: doors instead of door!]
INSERT INTO experimenteditor_spnpgnentry VALUES(3286,65114,1743,'Lift Axle 1 Position',2,'Signal which indicates the position / load condition of lift axle / tag axle #1.   Numbering of lift/tag axles starts at front axle.
INSERT INTO experimenteditor_spnpgnentry VALUES(3287,65114,1824,'Front Axle in Bumper Range',2,'Signal which indicates that the vehicle height at the front axle (SPNs 1721 and 1722) is within the bumper range.
INSERT INTO experimenteditor_spnpgnentry VALUES(3288,65114,1823,'Rear Axle in Bumper Range',2,'Signal which indicates that the vehicle height at the rear axle (SPNs 1723 and 1724) is within the bumper range.
INSERT INTO experimenteditor_spnpgnentry VALUES(3289,65114,1822,'Lift Axle 2 Position',2,'Signal which indicates the position / load condition of lift axle / tag axle #2.   Numbering of lift/tag axles starts at front axle.
