INSERT INTO experimenteditor_spnpgnentry VALUES(3314,65128,2602,'Hydraulic Oil Level',8,'This parameter indicates the level of the hydraulic fluid in tank as a ratio of current volume to total tank volume.  This parameter is intended for reporting the hydraulic fluid level in the system tank or reservoir.  This hydraulic fluid is for the entire hydraulics system of a piece of equipment.','Vehicle Fluids','3','1 s','%','0','8');
