INSERT INTO experimenteditor_spnpgnentry VALUES(3319,65130,1380,'Engine Oil Level Remote Reservoir',8,'Ratio of current volume of engine oil in a remote reservoir to the maximum required volume.  If a single switch (on/off) is used, 20% and 100% respectively will be used where 100% means no oil needs to be added and 20% means oil needs to be added.  If two switches are used, 20%, 50%, and 100% will be used where 20% indicates the oil is critically low, 50% indicates the oil level is low, and 100% means no oil needs to be added.  For continuous sensors, the actual measured percent will be used.','Engine Fuel/lube systems','1','0.5 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3320,65130,1381,'Engine Fuel Supply Pump Intake Pressure',8,'Absolute pressure of fuel at the fuel supply pump intake.  See Figures SPN16_A & SPN16_B','Engine Fuel/lube systems','2','0.5 s','kPa','0','8');
