INSERT INTO experimenteditor_spnpgnentry VALUES(3322,65130,3548,'Engine Waste Oil Reservoir Level',8,'Level of crankcase blowby emulsion collected by a container.  Normalized to percent, 0% represents completely empty and 100% represents completely full.','Engine Fuel/lube systems','4','0.5 s','%','0','8');
