INSERT INTO experimenteditor_spnpgnentry VALUES(3361,65135,1590,'Adaptive Cruise Control Mode',3,'This parameter is used to indicate the current state, or mode, of operation by the Adaptive Cruise Control (ACC) device. The states characterize independent system states (e.g., it is not possible to express distance control active and overtake mode simultaneously). ACC must not switch itself off while active because the driver expects it to work. So if an error occurs, the ACC must signal that to the driver so that the driver knows that he has to switch off the ACC.
