INSERT INTO experimenteditor_spnpgnentry VALUES(3363,65135,1798,'ACC Target Detected',2,'Signal to indicate to the driver that the ACC system has detected a target. 
INSERT INTO experimenteditor_spnpgnentry VALUES(3364,65135,1797,'ACC System Shutoff Warning',2,'Signal to warn the driver of system deactivation due to non-driver actions. Example: Attempting to control vehicle speed below or above limits of ACC. This signal may be used to activate warning sounds or indicators.
INSERT INTO experimenteditor_spnpgnentry VALUES(3365,65135,1796,'ACC Distance Alert Signal',2,'Signal to indicate to the operator that the ACC system is not able to maintain the distance to the target. Example: Target stopping rapidly. This signal may be used to activate warning sounds or indicators.
INSERT INTO experimenteditor_spnpgnentry VALUES(3366,65135,5022,'Forward Collision Warning',2,'This parameter indicates if a collision is imminent and strong driver reaction either by braking hard or by an avoidance maneuver are imperative to prevent a collision.  
INSERT INTO experimenteditor_spnpgnentry VALUES(3367,65135,1591,'Road curvature',16,'Estimated value of the current road curvature for use by the adaptive cruise control system.  Positive values are used for left curves.  Curvature is the inverse of the radius and is zero for straight roads.','Adaptive Cruise Control 1','5-6','100ms or upon state change, but not faster than 20 ms.','1/km','-250','8');
