INSERT INTO experimenteditor_spnpgnentry VALUES(3513,65168,1257,'Transmission Gear Ratio 2',16,'Gear ratio value stored in the ECU that is used to define a range of transmission gears for which a limit is applied to the engine output torque.  Transmission gear ratio 2 should be the numerically highest transmission gear ratio breakpoint less than transmission gear ratio 1 (see SPN 1255) that defines ratio ranges for torque limits.','Engine Torque History','20-21','On request','','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3514,65168,1258,'Engine Torque Limit 2, Transmission',16,'Limit applied to the engine output torque during vehicle operation in transmission gear ratios numerically less than or equal to transmission gear ratio 1 (see SPN 1255) and numerically greater than transmission gear ratio 2 (see.SPN 1257).  For example, with transmission gear ratio 1 equal to 12.0:1 and transmission gear ratio 2 equal to 5.0:1, vehicle operation in a transmission gear with a ratio of 6.0:1 will result in the application of engine torque limit 2, transmission.','Engine Torque History','22-23','On request','Nm','0','Variable');
