INSERT INTO experimenteditor_spnpgnentry VALUES(3516,65168,1260,'Engine Torque Limit 3, Transmission',16,'Limit applied to the engine output torque during vehicle operation in transmission gear ratios numerically less than or equal to transmission gear ratio 2 (see SPN 1257) and numerically greater than transmission gear ratio 3 (see.SPN 1259).  For example, with transmission gear ratio 2 equal to 5.0:1 and transmission gear ratio 3 equal to 2.0:1, vehicle operation in a transmission gear with a ratio of 3.0:1 will result in the application of engine torque limit 3, transmission.','Engine Torque History','26-27','On request','Nm','0','Variable');
