INSERT INTO experimenteditor_spnpgnentry VALUES(3649,65199,1039,'Trip Fuel (Gaseous)',32,'Total fuel consumed (trip drive fuel + trip PTO governor moving fuel + trip PTO governor non-moving fuel + trip idle fuel) since the last trip reset.','Fuel Consumption (Gaseous)','1-4','On request','kg','0','8');
