INSERT INTO experimenteditor_spnpgnentry VALUES(3651,65200,1034,'Trip Cruise Time',32,'Total time accumulated while the engine is in the cruise hold state, excluding time in accelerator override, since the last trip reset.','Trip Time Information 2','01-04','On request','Seconds','0','20');
INSERT INTO experimenteditor_spnpgnentry VALUES(3652,65200,1035,'Trip PTO Governor Time',32,'Total time accumulated while the engine is in the PTO or remote PTO governor hold state since the last trip reset.','Trip Time Information 2','05-08','On request','Seconds','0','20');
INSERT INTO experimenteditor_spnpgnentry VALUES(3653,65200,1036,'Trip Engine Running Time',32,'Total time accumulated while the engine speed is greater than zero since the last trip reset.  Note that time with the ignition switch on but engine speed at zero is not included.','Trip Time Information 2','09-12','On request','Seconds','0','20');
INSERT INTO experimenteditor_spnpgnentry VALUES(3654,65200,1037,'Trip Idle Time',32,'Total time accumulated while the engine speed is greater than zero, both the PTO and remote PTO governors are inactive, and the vehicle speed is less than 2 km/h, since the last trip reset.
