INSERT INTO experimenteditor_spnpgnentry VALUES(3658,65202,1030,'Total Engine PTO Governor Fuel Used (Gaseous)',32,'Total fuel used while the PTO or remote PTO governors are in the hold state and engine speed is above zero, over the life of the engine.
INSERT INTO experimenteditor_spnpgnentry VALUES(3659,65202,1031,'Trip Average Fuel Rate (Gaseous)',16,'Average fuel rate, equal to trip fuel divided by trip time while the engine speed is above zero, since the last trip reset.  This includes idle, engine PTO governor (both moving and non-moving) and drive operation but excludes ignition-on time while the engine speed is at zero rpm.
INSERT INTO experimenteditor_spnpgnentry VALUES(3660,65202,1389,'Engine Fuel Specific Gravity',16,'This parameter conveys the specific gravity of the gaseous fuel being used by the engine.  The specific gravity of the fuel can then be used to compute the density of the fuel.','Fuel Information 1 (Gaseous)','7-8','On request','','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3661,65203,1028,'Total Engine PTO Governor Fuel Used',32,'Total fuel used while the PTO or remote PTO governors are in the hold state and engine speed is above zero, over the life of the engine.
INSERT INTO experimenteditor_spnpgnentry VALUES(3662,65203,1029,'Trip Average Fuel Rate',16,'Average fuel rate, equal to trip fuel divided by trip time while the engine speed is above zero, since the last trip reset.  This includes idle, engine PTO governor (both moving and non-moving) and drive operation but excludes ignition-on time while the engine speed is at zero rpm.
INSERT INTO experimenteditor_spnpgnentry VALUES(3663,65203,5458,'Flexible Fuel Percentage',16,'Measured signal that indicates the percentage of alcohol in the fuel currently being used.  0% means no alcohol in fuel, 100% means alcohol as fuel and nothing else.','Fuel Information (Liquid)','7-8','On request','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3664,65204,1024,'Trip Time in VSL',32,'Total time accumulated when the engine has operated on the vehicle speed limiter (VSL) while not in the cruise hold state, since the last trip reset.  The engine torque mode is equal to road speed governor during this operation.','Trip Time Information 1','01-04','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3665,65204,1025,'Trip Time in Top Gear',32,'Total time accumulated when the vehicle has operated in top gear for a calibrated minimum time, since the last trip reset.','Trip Time Information 1','05-08','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3666,65204,1026,'Trip Time in Gear Down',32,'Total time accumulated when the vehicle has operated in one gear down from the top gear for a calibrated minimum time, since the last trip reset.','Trip Time Information 1','09-12','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3667,65204,1027,'Trip Time in Derate by Engine',32,'Total time accumulated when the engine final fueling has been derated due to an engine protection algorithm, since the last reset.','Trip Time Information 1','13-16','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3668,65205,1020,'Trip Number of Hot Shutdowns',16,'Total number of hot shutdowns since the last trip reset.  A hot shutdown is based on operation at high load or high engine speed or for long operating periods without allowing the engine to cool sufficiently.','Trip Shutdown Information','1-2','On request','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3669,65205,1021,'Trip Number of Idle Shutdowns',16,'Total number of times the engine has been shutdown due to idling too long (at normal idle or fast idle) since the last trip reset.','Trip Shutdown Information','3-4','On request','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3670,65205,1022,'Trip Number of Idle Shutdown Overrides',16,'Total number of times an operator disables idle shutdown to prevent an engine shutdown, since the last trip reset.','Trip Shutdown Information','5-6','On request','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3671,65205,1023,'Trip Sudden Decelerations',16,'Total number of decelerations whenever the vehicle deceleration is more than XYZ km/h/sec (where XYZ is a calibratible threshold), since the last trip reset.  A lengthy deceleration shall be counted as one sudden deceleration.','Trip Shutdown Information','7-8','On request','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3672,65206,1018,'Trip Maximum Vehicle Speed',16,'Maximum vehicle speed achieved while the engine speed is greater than zero and the accelerator pedal position (APS) is at a value greater than 0%, since the last trip reset.','Trip Vehicle Speed/Cruise Distance Information','1-2','On request','kph','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3673,65206,1019,'Trip Cruise Distance',32,'Total distance that the engine has operated in the cruise hold state, excluding time in accelerator override, since the last trip reset.','Trip Vehicle Speed/Cruise Distance Information','3-6','On request','m','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3674,65207,1015,'Trip Drive Average Load Factor',8,'Average engine load factor while engine speed is greater than zero, vehicle speed is greater than or equal to 2 km/h, and both the PTO (moving/non-moving) and remote PTO governors are not in the hold state, since the last trip reset.  Engine operation during cruise control operation is included.
INSERT INTO experimenteditor_spnpgnentry VALUES(3675,65207,1016,'Total Drive Average Load Factor',8,'Average engine load factor while engine speed is greater than zero, vehicle speed is greater than or equal to 2 km/h, and both the PTO (moving/non-moving) and remote PTO governors are not in the hold state, over the life of the engine.  Engine operation during cruise control operation is included.
INSERT INTO experimenteditor_spnpgnentry VALUES(3676,65207,1013,'Trip Maximum Engine Speed',16,'Maximum engine speed achieved since the last trip reset.','Engine Speed/Load Factor Information','1-2','On request','rpm','0','10');
INSERT INTO experimenteditor_spnpgnentry VALUES(3677,65207,1014,'Trip Average Engine Speed',16,'Average speed of the engine since the last trip reset.
