INSERT INTO experimenteditor_spnpgnentry VALUES(3679,65208,1007,'Trip Drive Fuel Used (Gaseous)',32,'Total fuel consumed while the engine speed is greater than zero, vehicle speed is greater than or equal to 2 km/h, and neither the PTO or the remote PTO governors are controlling the engine power output, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3680,65208,1008,'Trip PTO Governor Moving Fuel Used (Gaseous)',32,'Total fuel consumed while the PTO or remote PTO governors are in the hold state, the engine speed is greater than zero, and vehicle speed is greater than or equal to 2 km/h, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3681,65208,1009,'Trip PTO Governor Non-moving Fuel Used (Gaseous)',32,'Total fuel consumed while the PTO or remote PTO governors are in the hold state, the engine speed is greater than zero, and vehicle speed is less than to 2 km/h, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3682,65208,1010,'Trip Vehicle Idle Fuel Used (Gaseous)',32,'Total fuel consumed while neither the PTO or remote PTO governors are active, the engine speed is greater than zero, and vehicle speed is less than to 2 km/h, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3683,65208,1011,'Trip Cruise Fuel Used (Gaseous)',32,'Total fuel consumed while the engine is in the cruise hold state since the last trip reset.  If both cruise control and VSL (vehicle speed limiter) are commanding the same amount of fuel, the cruise control is deemed the active torque mode and fuel will be accumulated in \'trip cruise fuel used\' parameter.  If fuel commanded due to the accelerator pedal position is larger than fuel commanded by cruise control (e.g., accelerator override torque mode), the cruise control is not deemed the active torque mode and fuel will not be accumulated in the \'trip cruise fuel used\' parameter.
INSERT INTO experimenteditor_spnpgnentry VALUES(3684,65208,1012,'Trip Drive Fuel Economy (Gaseous)',16,'Trip drive fuel economy is equal to the distance traveled by vehicle in the drive state (engine speed greater than zero, vehicle speed greater than or equal to 2 km/h, and neither the PTO or remote PTO governors are controlling engine power output) divided by trip drive fuel used (SPN 1007), since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3685,65209,1001,'Trip Drive Fuel Used',32,'Total fuel consumed while the engine speed is greater than zero, vehicle speed is greater than or equal to 2 km/h, and neither the PTO or the remote PTO is controlling the engine power output, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3686,65209,1002,'Trip PTO Governor Moving Fuel Used',32,'Total fuel consumed while either the PTO or remote PTO governors are in the hold state, the engine speed is greater than zero, and vehicle speed is greater than or equal to 2 km/h, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3687,65209,1003,'Trip PTO Governor Non-moving Fuel Used',32,'Total fuel consumed while either the PTO or remote PTO governors are in the hold state, the engine speed is greater than zero, and vehicle speed is less than 2 km/h, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3688,65209,1004,'Trip Vehicle Idle Fuel Used',32,'Total fuel consumed while neither the PTO or remote PTO governor is in the hold state, the engine speed is greater than zero, and vehicle speed is less than 2 km/h, since the last trip reset.
INSERT INTO experimenteditor_spnpgnentry VALUES(3689,65209,1005,'Trip Cruise Fuel Used',32,'Total fuel consumed while the engine is in the cruise hold state since the last trip reset.  If both cruise control and VSL (vehicle speed limiter) are commanding the same amount of fuel, the cruise control is deemed the active torque mode and fuel will be accumulated in \'trip cruise fuel used\' parameter.  If fuel commanded due to the accelerator pedal position is larger than fuel commanded by cruise control (e.g., accelerator override torque mode), the cruise control is not deemed the active torque mode and fuel will not be accumulated in the \'trip cruise fuel used\' parameter.
INSERT INTO experimenteditor_spnpgnentry VALUES(3690,65209,1006,'Trip Drive Fuel Economy',16,'Trip drive fuel economy is equal to the distance traveled by vehicle in the drive state (engine speed greater than zero, vehicle speed greater than or equal to 2 km/h, and neither the PTO or remote PTO governors are controlling engine power output) divided by trip drive fuel used (SPN 1001), since the last trip reset.
