INSERT INTO experimenteditor_spnpgnentry VALUES(3692,65210,999,'Trip Gear Down Distance',32,'Total distance accumulated while the vehicle has operated in the gear which is one gear down from top gear and exceeds a calibrated minimum time (typically the time to shift the transmission) since the last trip reset.','Trip Distance Information','5-8','On request','m','0','12');
INSERT INTO experimenteditor_spnpgnentry VALUES(3693,65210,1000,'Trip Distance in Top Gear',32,'Total distance accumulated while the vehicle has operated in top gear for a calibrated minimum time since the last trip reset.','Trip Distance Information','9-12','On request','m','0','12');
INSERT INTO experimenteditor_spnpgnentry VALUES(3694,65211,994,'Trip Fan On Time',32,'Total time the fan has been on (due to an automatic trigger or manual trigger) since the last trip reset.  The fan could be requested to be on by the engine system, a manual switch, and/or the A/C system.  Whichever system requests the fan activation first shall have the time accumulated against it.  The sum total of these three values shall equal the trip fan on time.
INSERT INTO experimenteditor_spnpgnentry VALUES(3695,65211,995,'Trip Fan On Time Due to the Engine System',32,'Total time the fan has been on due to engine triggers (i.e., excluding time on due to an operator manual switch or A/C system) since the last trip reset.  For the time to be accumulated against the engine system, it is necessary that it be the first to request the fan activation or it be the only system requesting fan activation.','Trip Fan Information','05-08','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3696,65211,996,'Trip Fan On Time Due to a Manual Switch',32,'Total time the fan has been on due to manual activation by the operator (i.e., excluding time on due to automatic triggers) since the last trip reset.  For the time to be accumulated against the manual switch, it is necessary that it be the first to request the fan activation or it be the only system requesting fan activation.','Trip Fan Information','09-12','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3697,65211,997,'Trip Fan On Time Due to the A/C System',32,'Total time the fan has been on due to the A/C system since the last trip reset.  For the time to be accumulated against the A/C system, it is necessary that it be the first to request the fan activation or it be the only system requesting fan activation.','Trip Fan Information','13-16','On request','Seconds','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3698,65212,990,'Total Compression Brake Distance',32,'Total distance over which the compression brakes have been active for the life of the engine.','Compression/Service Brake Information','01-04','On request','m','0','16');
INSERT INTO experimenteditor_spnpgnentry VALUES(3699,65212,991,'Trip Compression Brake Distance',32,'Total distance over which the compression brakes have been active since the last trip reset.','Compression/Service Brake Information','05-08','On request','m','0','16');
