INSERT INTO experimenteditor_spnpgnentry VALUES(3701,65212,993,'Trip Service Brake Applications',32,'Total number of times the service brakes have been activated since the last trip reset.  Brake applications of less than 0.5 s are not counted and lengthy brake applications (longer than 0.5 s) are counted as a single event.
INSERT INTO experimenteditor_spnpgnentry VALUES(3702,65213,975,'Estimated Percent Fan Speed',8,'Estimated fan speed as a ratio of the fan drive (current speed) to the fully engaged fan drive (maximum fan speed).  A two state fan (off/on) will use 0% and 100% respectively.  A three state fan (off/intermediate/on) will use 0%, 50% and 100% respectively.  A variable speed fan will use 0% to 100%. Multiple fan systems will use 0 to 100% to indicate the percent cooling capacity being provided.
INSERT INTO experimenteditor_spnpgnentry VALUES(3703,65213,977,'Fan Drive State',4,'This parameter is used to indicate the current state or mode of operation by the fan drive.
INSERT INTO experimenteditor_spnpgnentry VALUES(3704,65213,4212,'Fan Drive Bypass Command Status',8,'Status of the Fan Drive Bypass Command as being commanded by the ECU.  The fan drive bypass diverts pump pressure away from the hydraulic motor to maintain the fan drive pressure.  0% is defined as no bypass (i.e. diverting no fan drive pressure) and 100% is defined as full bypass (i.e. diverting the maximum fan drive pressure) from the fan motor.','Fan Drive #1','7','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3705,65213,1639,'Fan Speed',16,'The speed of the fan associated with engine coolant system.','Fan Drive #1','3-4','1 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3706,65213,4211,'Hydraulic Fan Motor Pressure',16,'The hydraulic pressure used to drive the fan system, sensed before the hydraulic fan motor.','Fan Drive #1','5-6','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3707,65214,3669,'Engine Rotation Direction',2,'Direction of engine rotation, as reported by the engine.  Direction convention as viewed by an observer standing at the rear of the engine, viewing the flywheel.
