INSERT INTO experimenteditor_spnpgnentry VALUES(3805,65232,1224,'Test Identifier',8,'The TID has 2 methods to designate the test to be run. The first method uses the TID alone and these test identifiers are manufacturer-defined test identifiers. For this first use there are 64 valid test identifiers, 1 to 64. The second method uses the TID and the SPN / FMI to identify the test.','Test Results for Non-continuously Monitored Systems','1','Sent in response to PGN 58112 when the results are available','count','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3806,65232,1225,'Test Type/Component Identifier',8,'This parameter identifies the non-continuously monitored component identifier that was tested. These component identifiers are defined by the manufacturer. They are necessary when multiple components or systems are present on the vehicle and have the same definition of test identifier.','Test Results for Non-continuously Monitored Systems','2','Sent in response to PGN 58112 when the results are available','count','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3807,65232,1226,'Test Value',16,'The test value collected during the test. If the test performed does not have both a test limit minimum and maximum, then the appropriate limit value (Maximum or Minimum) should be set to all ones. SAE J1939-71 defines this to mean not available.','Test Results for Non-continuously Monitored Systems','3-4','Sent in response to PGN 58112 when the results are available','Request Dependent','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3808,65232,1227,'Test Limit Maximum',16,'The test value must be less than or equal to Test Limit Maximum in order for the test to pass.','Test Results for Non-continuously Monitored Systems','5-6','Sent in response to PGN 58112 when the results are available','Request Dependent','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3809,65232,1228,'Test Limit Minimum',16,'The test value must be greater than or equal to Test Limit Minimum in order for the test to pass.','Test Results for Non-continuously Monitored Systems','7-8','Sent in response to PGN 58112 when the results are available','Request Dependent','0','Variable');
