INSERT INTO experimenteditor_spnpgnentry VALUES(3811,65234,1229,'Test Identifiers Supported',64,'Indicates the test identifiers that the controller supports. Each bit is assigned to one test. Therefore, we can have up to 64 tests without having to use the transport protocol of SAE J1939-21. The assignment of a given test identifier to a given bit is manufacturer specific','Non-continuously Monitored System Test Identifiers Support','1-8','On request','bit-mapped','0','8');
