INSERT INTO experimenteditor_spnpgnentry VALUES(3849,65241,1083,'Auxiliary I/O Channel #1',16,'Auxiliary channel of data (16 bit) read by the ECU.  This data is in A/D counts and is manufacturer specific.  It may be configured uniquely per application.','Auxiliary Input/Output Status 1','5-6','manufacturer defined, not faster than 100 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3850,65241,1084,'Auxiliary I/O Channel #2',16,'Auxiliary channel of data (16 bit) read by the ECU.  This data is in A/D counts and is manufacturer specific.  It may be configured uniquely per application.','Auxiliary Input/Output Status 1','7-8','manufacturer defined, not faster than 100 ms','count','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3851,65242,965,'Number of Software Identification Fields',8,'Number of software identification designators represented in the software identification parameter group.','Software Identification','1','On request','step','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3852,65242,234,'Software Identification',1600,'Software identification of an electronic module.  As an example, this parameter may be represented with ASCII characters MMDDYYaa where MM is the month, DD is the day, YY is the year, and aa is the revision number.
INSERT INTO experimenteditor_spnpgnentry VALUES(3853,65243,164,'Engine Injection Control Pressure',16,'The gage pressure of the engine oil in the hydraulic accumulator that powers an intensifier used for fuel injection.','Engine Fluid Level/Pressure 2','1-2','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3854,65243,157,'Engine Injector Metering Rail 1 Pressure',16,'The gage pressure of fuel in the primary, or first, metering rail as delivered from the supply pump to the injector metering intake.  See Figure SPN16_A.','Engine Fluid Level/Pressure 2','3-4','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3855,65243,156,'Engine Injector Timing Rail 1 Pressure',16,'The gage pressure of fuel in the timing rail delivered from the supply pump to the injector timing intake.','Engine Fluid Level/Pressure 2','5-6','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3856,65243,1349,'Engine Injector Metering Rail 2 Pressure',16,'The gage pressure of fuel in the metering rail #2 as delivered from the supply pump to the injector metering intake.  See Figure SPN16_A for fuel system related parameters.  Although the figure does not show rail #2 it does show the relationship of rail pressure to other signals.','Engine Fluid Level/Pressure 2','7-8','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3857,65244,236,'Engine Total Idle Fuel Used',32,'Accumulated amount of fuel used during vehicle operation while under idle conditions.','Idle Operation','1-4','On request','l','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3858,65244,235,'Engine Total Idle Hours',32,'Accumulated time of operation of the engine while under idle conditions.','Idle Operation','5-8','On request','Seconds','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3859,65245,104,'Engine Turbocharger Lube Oil Pressure 1',8,'Gage pressure of oil in turbocharger lubrication system.','Turbocharger','1','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3860,65245,1665,'Engine Turbocharger Oil Level Switch',2,'Switch signal which indicates the presence of oil at the turbocharger
INSERT INTO experimenteditor_spnpgnentry VALUES(3861,65245,103,'Engine Turbocharger 1 Speed',16,'Rotational velocity of rotor in the turbocharger.','Turbocharger','2-3','1 s','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3862,65246,82,'Engine Air Start Pressure',8,'Gage pressure of air in an engine starting system that utilizes compressed air to provide the force required to rotate the crankshaft.','Air Start Pressure','1','On request','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3863,65247,514,'Nominal Friction - Percent Torque',8,'The calculated torque that indicates the amount of torque required by the basic engine itself added by the loss torque of accessories. It contains the frictional and thermodynamic loss of the engine itself, pumping torque loss (SPN 5398), and the losses of fuel, oil and cooling pumps.  The data is transmitted in indicated torque as a percent of reference engine torque (see the engine configuration message, PGN 65251).
INSERT INTO experimenteditor_spnpgnentry VALUES(3864,65247,519,'Engine''s Desired Operating Speed Asymmetry Adjustment',8,'This byte is utilized in transmission gear selection routines and indicates the engine''s preference of lower versus higher engine speeds should its desired speed not be achievable.  This is a scaled ratio such that 125 represents an equal preference for a speed lower or higher that the engine''s indicated desired speed.  The higher the asymmetry adjustment value is above 125, the more the engine prefers to be operated at or above its indicated desired speed.  Conversely, the lower the asymmetry adjustment value is below 125, the more the engine prefers to operate at or below its indicated desired speed.  Typically, the engine''s asymmetry adjustment will be predicated on fuel consumption considerations, and under these conditions, the method for computing the asymmetry adjustment is indicated in Figure SPN519_A. The engine may include other factors into its asymmetry adjustment calculation such as temperatures, pressures, and other operating parameters.','Electronic Engine Controller 3','4','250 msec (preferred) or Engine Speed Dependent (if required by application)','Ratio','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3865,65247,2978,'Estimated Engine Parasitic Losses - Percent Torque',8,'The calculated torque that indicates the estimated amount of torque loss due to engine parasitics, such as cooling fan, air compressor, air conditioning, etc. It is expressed as a percent of Engine Reference Torque.  
INSERT INTO experimenteditor_spnpgnentry VALUES(3866,65247,3237,'Aftertreatment 1 Intake Dew Point',2,'Indicates that the temperature on the intake side of the aftertreatment system has exceeded the dew point, as estimated by the ECM in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(3867,65247,3238,'Aftertreatment 1 Exhaust Dew Point',2,'Indicates that the temperature on the exhaust side of the aftertreatment has exceeded the dew point, as estimated by the ECM in exhaust bank 1.
INSERT INTO experimenteditor_spnpgnentry VALUES(3868,65247,3239,'Aftertreatment 2 Intake Dew Point',2,'Indicates that the temperature on the intake side of the aftertreatment system has exceeded the dew point, as estimated by the ECM in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(3869,65247,3240,'Aftertreatment 2 Exhaust Dew Point',2,'Indicates that the temperature on the exhaust side of the aftertreatment has exceeded the dew point, as estimated by the ECM in exhaust bank 2.
INSERT INTO experimenteditor_spnpgnentry VALUES(3870,65247,515,'Engine''s Desired Operating Speed',16,'An indication by the engine of the optimal operating speed of the engine for the current existing conditions.  These conditions may include the torque generated to accommodate powertrain demands from the operator (via the accelerator pedal), cruise control, road speed limit governors, or ASR.  Dynamic commands from functions such as smoke control or shift control are excluded from this calculation.','Electronic Engine Controller 3','2-3','250 msec (preferred) or Engine Speed Dependent (if required by application)','rpm','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3871,65247,3236,'Aftertreatment 1 Exhaust Gas Mass Flow',16,'Measured/calculated exhaust gas mass upstream of the aftertreatment system in exhaust bank 1 and 2.','Electronic Engine Controller 3','6-7','250 msec (preferred) or Engine Speed Dependent (if required by application)','kg/h','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3872,65248,244,'Trip Distance',32,'Distance traveled during all or part of a journey.
INSERT INTO experimenteditor_spnpgnentry VALUES(3873,65248,245,'Total Vehicle Distance',32,'Accumulated distance traveled by vehicle during its operation.
INSERT INTO experimenteditor_spnpgnentry VALUES(3874,65249,901,'Retarder Type',4,'A vehicle retarder is a supplementary device to the wheel brakes for the driver to better control the vehicle.  The wheel brakes used in the vehicle are not designed for continuous retarding operation.  In a prolonged period of braking, the brakes can be thermally over-stressed, causing the braking effect to be reduced or even lead to complete braking system failure.  The vehicle retarder is designed for continuous operation for braking during downhill operation and is also used for braking the vehicle to comply with speed limits and traffic conditions.
INSERT INTO experimenteditor_spnpgnentry VALUES(3875,65249,902,'Retarder Location',4,'This parameter defines whether the “torque/speed curve” defined by the retarder configuration message (PGN 65249) is dependent on engine rpm, output shaft rpm, or other parameter.  The data type of this parameter is measured.
INSERT INTO experimenteditor_spnpgnentry VALUES(3876,65249,557,'Retarder Control Method (Retarder Configuration)',8,'This parameter identifies the number of steps used by the retarder.','Retarder Configuration','02','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','step','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3877,65249,551,'Percent Torque At Idle, Point 1 (Retarder Configuration)',8,'The torque limit that indicates the available retarder torque which can be provided by the retarder at idle speed.  The data is transmitted in indicated torque as a percent of the reference retarder torque.','Retarder Configuration','05','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3878,65249,552,'Percent Torque At Maximum Speed, Point 2 (Retarder Configuration)',8,'The torque limit that indicates the available retarder torque which can be provided by the retarder at its maximum speed.  Please reference PGN 65249.  The data is transmitted in indicated torque as a percent of the reference retarder torque.','Retarder Configuration','08','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3879,65249,553,'Percent Torque At Point 3 (Retarder Configuration)',8,'The torque limit that indicates the available retarder torque which can be provided by the retarder at points 3 and 4 of the retarder torque map.  Please reference PGN 65249.  The data is transmitted in indicated torque as a percent of the reference retarder torque.','Retarder Configuration','11','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3880,65249,554,'Percent Torque At Point 4 (Retarder Configuration)',8,'The torque limit that indicates the available retarder torque which can be provided by the retarder at points 3 and 4 of the retarder torque map.  Please reference PGN 65249.  The data is transmitted in indicated torque as a percent of the reference retarder torque.','Retarder Configuration','14','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3881,65249,555,'Percent Torque At Peak Torque, Point 5 (Retarder Configuration)',8,'The torque limit that indicates the available retarder torque which can be provided by the retarder at point 5 of the retarder torque map.  Please reference PGN 65249.  The data is transmitted in indicated torque as a percent of the reference retarder torque.','Retarder Configuration','19','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3882,65249,546,'Retarder Speed At Idle, Point 1 (Retarder Configuration)',16,'Please reference PGN 65249','Retarder Configuration','03-04','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3883,65249,548,'Maximum Retarder Speed, Point 2 (Retarder Configuration)',16,'Maximum speed of retarder (Please reference PGN 65249).','Retarder Configuration','06-07','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3884,65249,549,'Retarder Speed At Point 3 (Retarder Configuration)',16,'Retarder speed of point 3 of the engine retarder torque map.  Please reference PGN 65249.','Retarder Configuration','09-10','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3885,65249,550,'Retarder Speed At Point 4 (Retarder Configuration)',16,'Retarder speed of point 4 of the engine retarder torque map.  Please reference PGN 65249.','Retarder Configuration','12-13','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3886,65249,547,'Retarder Speed At Peak Torque, Point 5 (Retarder Configuration)',16,'Please reference PGN 65249','Retarder Configuration','15-16','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3887,65249,556,'Reference Retarder Torque (Retarder Configuration)',16,'This parameter is the 100% reference value for all defined indicated retarder torque parameters.  It is only defined once and doesn''t change if a different retarder torque map becomes valid.','Retarder Configuration','17-18','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','Nm','0','19');
INSERT INTO experimenteditor_spnpgnentry VALUES(3888,65250,958,'Number of Reverse Gear Ratios',8,'Number of reverse gear ratios in the transmission, provided as part of the transmission configuration.','Transmission Configuration','1','On request','gear value','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3889,65250,957,'Number of Forward Gear Ratios',8,'Number of forward gear ratios in the transmission, provided as part of the configuration.','Transmission Configuration','2','On request','gear value','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3890,65250,581,'Transmission Gear Ratio',16,'The transmission configuration describes the number of forward gears, the number of reverse gears, and the ratio of each gear with the following resolution.','Transmission Configuration','3-4','On request','Ratio','0','Variable');
INSERT INTO experimenteditor_spnpgnentry VALUES(3891,65251,539,'Engine Percent Torque At Idle, Point 1 (Engine Configuration)',8,'The torque limit that indicates the available engine torque which can be provided by the engine at idle speed.  This parameter may be influenced by engine temperature (after power up) and other stationary changes (calibration offsets, sensor failures, etc.)  See also SPN 188.  The data is transmitted in indicated torque as a percent of the reference engine torque.','Engine Configuration 1','03','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3892,65251,540,'Engine Percent Torque At Point 2 (Engine Configuration)',8,'The torque limit that indicates the available engine torque which can be provided by the engine at point 2 of the engine map (see PGN 65251 and supporting documents).  In engine configuration mode 1 and 3 (see Table PGN65251_A see PGN 65251), point 2 is defined as the kick-in point from which torque is reduced to zero.  In mode 2, there are no special requirements for the definition of this point.  The data is transmitted in indicated torque as a percent of the reference engine torque.','Engine Configuration 1','06','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3893,65251,541,'Engine Percent Torque At Point 3 (Engine Configuration)',8,'The torque limit that indicates the available engine torque which can be provided by the engine at point 3, 4, and 5 of the engine map (see PGN 65251 and supporting documents)..  It is required that one of these points indicate the peak torque point for the current engine torque map.  Points 3, 4, and 5 lie between idle and point 2.  The data is transmitted in indicated torque as a percent of the reference engine torque.','Engine Configuration 1','09','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3894,65251,542,'Engine Percent Torque At Point 4 (Engine Configuration)',8,'The torque limit that indicates the available engine torque which can be provided by the engine at point 3, 4, and 5 of the engine map (see PGN 65251 and supporting documents).  It is required that one of these points indicate the peak torque point for the current engine torque map.  Points 3, 4, and 5 lie between idle and point 2.  The data is transmitted in indicated torque as a percent of the reference engine torque.','Engine Configuration 1','12','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3895,65251,543,'Engine Percent Torque At Point 5 (Engine Configuration)',8,'The torque limit that indicates the available engine torque which can be provided by the engine at point 3, 4, and 5 of the engine map (see PGN 65251 and supporting documents).  It is required that one of these points indicate the peak torque point for the current engine torque map.  Points 3, 4, and 5 lie between idle and point 2.  The data is transmitted in indicated torque as a percent of the reference engine torque.','Engine Configuration 1','15','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3896,65251,534,'Engine Maximum Momentary Override Time Limit (Engine Configuration)',8,'The maximum time limit allowed to override the engine''s high idle speed.','Engine Configuration 1','24','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','Seconds','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3897,65251,535,'Engine Requested Speed Control Range Lower Limit (Engine Configuration)',8,'The minimum engine speed that the engine will allow when operating in a speed control/limit mode.','Engine Configuration 1','25','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3898,65251,536,'Engine Requested Speed Control Range Upper Limit (Engine Configuration)',8,'The maximum engine speed regardless of load that the engine will allow when operating in a speed control/limit mode, excluding any maximum momentary engine override speed, if supported.','Engine Configuration 1','26','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3899,65251,537,'Engine Requested Torque Control Range Lower Limit (Engine Configuration)',8,'The minimum engine torque that the engine will allow when operating in a torque control/limit mode.','Engine Configuration 1','27','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3900,65251,538,'Engine Requested Torque Control Range Upper Limit (Engine Configuration)',8,'The maximum engine torque that the engine will allow when operating in a torque control/limit mode.','Engine Configuration 1','28','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','%','-125','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3901,65251,3344,'Support Variable Rate TSC1 Message',8,'This parameter indicates which TSC1 transmission rates are supported by the engine ECU in addition to the required 10ms transmission rate for temporary powertrain control purposes. 
INSERT INTO experimenteditor_spnpgnentry VALUES(3902,65251,3345,'Support TSC1 Control Purpose Group 1',8,'This parameter indicates which TSC1 control purposes are supported in group 1 of 4. One bit is used to convey the support of each Control Purpose. A value of 0 equals supported and a value of 1 equals not supported. This bit logic is used to allow the default to FF to be backward compatible.
INSERT INTO experimenteditor_spnpgnentry VALUES(3903,65251,3346,'Support TSC1 Control Purpose Group 2',8,'This parameter indicates which TSC1 control purposes are supported in group 2 of 4. One bit is used to convey the support of each Control Purpose. A value of 0 equals supported and a value of 1 equals not supported. This bit logic is used to allow the default to FF to be backward compatible.
INSERT INTO experimenteditor_spnpgnentry VALUES(3904,65251,3347,'Support TSC1 Control Purpose Group 3',8,'This parameter indicates which TSC1 control purposes are supported in group 3 of 4. One bit is used to convey the support of each Control Purpose. A value of 0 equals supported and a value of 1 equals not supported. This bit logic is used to allow the default to FF to be backward compatible.
INSERT INTO experimenteditor_spnpgnentry VALUES(3905,65251,3348,'Support TSC1 Control Purpose Group 4',8,'This parameter indicates which TSC1 control purposes are supported in group 4 of 4. One bit is used to convey the support of each Control Purpose. A value of 0 equals supported and a value of 1 equals not supported. This bit logic is used to allow the default to FF to be backward compatible.
INSERT INTO experimenteditor_spnpgnentry VALUES(3906,65251,188,'Engine Speed At Idle, Point 1 (Engine Configuration)',16,'Stationary low idle speed of engine which includes influences due to engine temperature (after power up) and other stationary changes (calibration offsets, sensor failures, etc).  This parameter is point 1 of the engine configuration map (see PGN 65251).','Engine Configuration 1','01-02','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3907,65251,528,'Engine Speed At Point 2 (Engine Configuration)',16,'Engine speed of point 2 of the engine torque map (see PGN 65251 and supporting document).  In engine configuration mode 1 and 3, point 2 is defined as the kick-in point from which torque is reduced to zero.  In mode 2 (see Table PGN65251_A), there are no special requirements for the definition of this point.','Engine Configuration 1','04-05','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3908,65251,529,'Engine Speed At Point 3 (Engine Configuration)',16,'Engine speed of point 3, 4, and 5 of the engine torque map (see PGN 65251 and supporting document).  It is recommended that one of these points indicate the peak torque point for the current engine torque map.  Points 3, 4, and 5 are optional and lie between idle and point 2.','Engine Configuration 1','07-08','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3909,65251,530,'Engine Speed At Point 4 (Engine Configuration)',16,'Engine speed of point 3, 4, and 5 of the engine torque map (see PGN 65251 and supporting document).  It is recommended that one of these points indicate the peak torque point for the current engine torque map.  Points 3, 4, and 5 are optional and lie between idle and point 2.','Engine Configuration 1','10-11','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3910,65251,531,'Engine Speed At Point 5 (Engine Configuration)',16,'Engine speed of point 3, 4, and 5 of the engine torque map (see PGN 65251 and supporting document).  It is recommended that one of these points indicate the peak torque point for the current engine torque map.  Points 3, 4, and 5 are optional and lie between idle and point 2.','Engine Configuration 1','13-14','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3911,65251,532,'Engine Speed At High Idle, Point 6 (Engine Configuration)',16,'Engine speed of high idle (point 6) of the engine torque map (see PGN 65251 and supporting document).  In engine configuration mode 3 (see Figure PGN65251_C), point 6 is not defined by the engine torque map but by the governor characteristic and the zero torque line.','Engine Configuration 1','16-17','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3912,65251,545,'Engine Gain (Kp) Of The Endspeed Governor (Engine Configuration)',16,'The endspeed governor is defined as a linear line with the following equations (Capital letters mean physical values, small letters mean normalized values).  Refer to Figures PGN65251_A and PGN65251_B.
INSERT INTO experimenteditor_spnpgnentry VALUES(3913,65251,544,'Engine Reference Torque (Engine Configuration)',16,'This parameter is the 100% reference value for all defined indicated engine torque parameters.  It is only defined once and doesn''t change if a different engine torque map becomes valid.','Engine Configuration 1','20-21','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','Nm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3914,65251,533,'Engine Maximum Momentary Override Speed, Point 7 (Engine Configuration)',16,'The maximum engine speed above high idle allowed by the engine control during a momentary high idle override.  This duration of the override is limited by the maximum momentary override time limit, SPN 534.','Engine Configuration 1','22-23','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','rpm','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3915,65251,1712,'Engine Extended Range Requested Speed Control Range Upper Limit (Engine configuration)',16,'The maximum engine speed regardless of load that the engine will allow when operating in a speed control/limit mode, excluding any maximum momentary engine override speed, if supported.  
INSERT INTO experimenteditor_spnpgnentry VALUES(3916,65251,1794,'Engine Moment of Inertia',16,'Moment of inertia for the engine, including items driven full-time by the engine such as fuel, oil and cooling pumps.  The inertia from the following items are not included: flywheel, alternator, compressor, fan, and other engine-driven accessories.','Engine Configuration 1','31-32','Every 5 s and on change of torque/speed points of more than 10% since last transmission but no faster than every 500 ms','kg/m²','0','39');
INSERT INTO experimenteditor_spnpgnentry VALUES(3917,65251,1846,'Engine Default Torque Limit',16,'Companion parameter to Transmission Torque Limit (SPN 1845).  This “echo” parameter provides confirmation to the transmission that the engine has received and will invoke the requested Transmission Torque Limit in the event that J1939 communication is lost between the two devices.
INSERT INTO experimenteditor_spnpgnentry VALUES(3918,65252,593,'Engine Idle Shutdown has Shutdown Engine',2,'Status signal which identifies whether or not the engine has been shutdown by the idle shutdown timer system.  See Figure SPN590_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3919,65252,594,'Engine Idle Shutdown Driver Alert Mode',2,'Status signal which indicates the status of the driver alert mode of the idle shutdown timer system.  While the driver alert mode is active, the idle shutdown timer may be overridden.  See Figure SPN590_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3920,65252,592,'Engine Idle Shutdown Timer Override',2,'Status signal which indicates the status of the override feature of the idle shutdown timer system.  See Figure SPN590_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3921,65252,590,'Engine Idle Shutdown Timer State',2,'Status signal which indicates the current mode of operation of the idle shutdown timer system.  See Figure SPN590_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3922,65252,591,'Engine Idle Shutdown Timer Function',2,'Parameter which indicates the configuration of the idle shutdown timer system.
INSERT INTO experimenteditor_spnpgnentry VALUES(3923,65252,985,'A/C High Pressure Fan Switch',2,'Switch signal which indicates that the pressure in the coolant circuit of an air conditioning system is high and the fan may be engaged.
INSERT INTO experimenteditor_spnpgnentry VALUES(3924,65252,875,'Refrigerant Low Pressure Switch',2,'Switch signal which indicates the position of the low pressure switch in the coolant circuit of an air conditioning system.  When the switch is enabled, the pressure inside the circuit is too low and the compressor clutch may be disengaged.
INSERT INTO experimenteditor_spnpgnentry VALUES(3925,65252,605,'Refrigerant High Pressure Switch',2,'Switch signal which indicates the position of the high pressure switch in the coolant circuit of an air conditioning system.  When the switch is enabled, the pressure inside the circuit is too high and the compressor clutch may be disengaged.
INSERT INTO experimenteditor_spnpgnentry VALUES(3926,65252,1081,'Engine Wait to Start Lamp',2,'Lamp signal which indicates that the engine is too cold to start and the operator should wait until the signal becomes inactive (turns off).  See SPN 5416 for the lamp operating condition.
INSERT INTO experimenteditor_spnpgnentry VALUES(3927,65252,1110,'Engine Protection System has Shutdown Engine',2,'Status signal which indicates whether or not the engine protection system has shutdown the engine.  See Figure SPN1107_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3928,65252,1109,'Engine Protection System Approaching Shutdown',2,'Status signal which indicates that engine shutdown is imminent.  This engine protection signal can be a result of different systems failing, i.e., engine overheating. See Figure SPN1107_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3929,65252,1108,'Engine Protection System Timer Override',2,'Status signal which indicates the status of the override feature of the engine protection system timer. See Figure SPN1107_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3930,65252,1107,'Engine Protection System Timer State',2,'Status signal which indicates the current mode of the engine protection system timer system.  See Figure SPN1107_A.
INSERT INTO experimenteditor_spnpgnentry VALUES(3931,65252,1111,'Engine Protection System Configuration',2,'Parameter which indicates the configuration of the engine shutdown system.
INSERT INTO experimenteditor_spnpgnentry VALUES(3932,65252,2815,'Engine Alarm Acknowledge',2,'The Engine Alarm Acknowledge Input signal as measured by the reporting ECM.  The Engine Alarm Acknowledge is a mechanism for external acknowledgement of the SPN 2814,  Engine Alarm Output Command. 
INSERT INTO experimenteditor_spnpgnentry VALUES(3933,65252,2814,'Engine Alarm Output Command Status',2,'State signal which indicates when the Alarm driver output is being driven. Not active means the Controller has no alarm level conditions.
INSERT INTO experimenteditor_spnpgnentry VALUES(3934,65252,2813,'Engine Air Shutoff Command Status',2,'State signal which indicates when the Air Shutoff  driver output is being driven. Disabled means controller wants air flowing to the engine. Status of the airflow  shutoff as being commanded by the ECU.
INSERT INTO experimenteditor_spnpgnentry VALUES(3935,65252,2812,'Engine Overspeed Test',2,'The engine overspeed test signal as measured by the reporting ECM.  Engine Overspeed Test is a mechanism to simulate engine overspeed situations, while operating the engine within the engine''s safe operating range.
INSERT INTO experimenteditor_spnpgnentry VALUES(3936,65252,3667,'Engine Air Shutoff Status',2,'State signal which indicates the actual measured position of the Air Shutoff.
INSERT INTO experimenteditor_spnpgnentry VALUES(3937,65252,5404,'PTO Shutdown has Shutdown Engine',2,'Status signal which identifies whether or not the engine has been shutdown by the PTO shutdown system.
INSERT INTO experimenteditor_spnpgnentry VALUES(3938,65252,5566,'Coolant Level Engine Protection Shutdown Status',2,'Parameter which indicates the configuration of the coolant level engine protection shutdown.
INSERT INTO experimenteditor_spnpgnentry VALUES(3939,65253,247,'Engine Total Hours of Operation',32,'Accumulated time of operation of engine.','Engine Hours, Revolutions','1-4','On request','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3940,65253,249,'Engine Total Revolutions',32,'Accumulated number of revolutions of engine crankshaft during its operation.','Engine Hours, Revolutions','5-8','On request','r','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3941,65254,959,'Seconds',8,'The seconds component of the current time of day.  This should be reported as the seconds component of the current time at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the seconds component of the current time at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the time of day (SPNs 959, 960, and 961) is the current UTC time or a local time zone time.  Refer to SPN 1602 for details.','Time/Date','1','On request','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3942,65254,960,'Minutes',8,'The minutes component of the current time of day.  This should be reported as the minutes component of the current time at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the minutes component of the current time at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the time of day (SPNs 959, 960, and 961) is the current UTC time or a local time zone time.  Refer to SPN 1602 for details.','Time/Date','2','On request','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3943,65254,961,'Hours',8,'The hour component of the current time of day.  This should be reported as the hour component of the current time at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the hour component of the current time at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if time of day (SPNs 959, 960, and 961) is the current UTC time or a local time zone time.  Refer to SPN 1602 for details.','Time/Date','3','On request','Seconds','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3944,65254,963,'Month',8,'The month component of the current calendar date.  This should be reported as the month component of the current date at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the month component of the current date at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the calendar date (SPNs 962, 963, and 964) is the current UTC date or a local time zone date.  Refer to SPN 1602 for details.
INSERT INTO experimenteditor_spnpgnentry VALUES(3945,65254,962,'Day',8,'The day component of the current calendar date.  This should be reported as the day component of the current date at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the day component of the current date at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the calendar date (SPNs 962, 963, and 964) is the current UTC date or a local time zone date.  Refer to SPN 1602 for details.
INSERT INTO experimenteditor_spnpgnentry VALUES(3946,65254,964,'Year',8,'The year component of the current calendar date.  This should be reported as the year component of the current date at UTC (Universal Time Coordinate), a.k.a. GMT; however, it may be reported as the year component of the current date at a local time zone.  The Local Hour Offset parameter (SPN 1602) is used to indicate if the calendar date (SPNs 962, 963, and 964) is the current UTC date or a local time zone date.  Refer to SPN 1602 for details.
INSERT INTO experimenteditor_spnpgnentry VALUES(3947,65254,1601,'Local minute offset',8,'The minute component of the offset between the UTC time and date and a local time zone time and date.  This is the number of minutes to add to UTC (Universal Time Coordinate) time and date to convert to the time and date in the local time zone .  The Local Offset is a positive value for time zones East of the Prime Meridian to the International Date Line.  The Local Offset is a negative value for time zones West of the Prime Meridian to the International Date Line.
INSERT INTO experimenteditor_spnpgnentry VALUES(3948,65254,1602,'Local hour offset',8,'The hour component of the offset between the UTC (Universal Time Coordinate) time and date and a local time zone time and date.  This is the number of hours to add to UTC, a.k.a. GMT, time and date to convert to the time and date in the local time zone.  This parameter indicates the time reference of the data reported in the Time and Date SPNs 959, 960. 961, 962, 963, and 964.  The Local Offset is a positive value for time zones East of the Prime Meridian to the International Date Line.  The Local Offset is a negative value for time zones West of the Prime Meridian to the International Date Line. 
