INSERT INTO experimenteditor_spnpgnentry VALUES(3952,65256,517,'Navigation-Based Vehicle Speed',16,'Speed of the vehicle as calculated from a device such as a Global Positioning System (GPS).','Vehicle Direction/Speed','3-4','On request','kph','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3953,65256,583,'Pitch',16,'Pitch (rotation about the y-axis) of the vehicle as calculated by the navigation device(s).  The pitch angle for an angle of ascent is reported with a positive value. This parameter is defined according to a Z-Down axis system and the sign of the value is in accordance to the right-hand rule, as specified in SAE J670.  As specified in SAE J670, a Z-Down Axis System has positive X directed forward, positive Y to the right, and positive Z directed down.','Vehicle Direction/Speed','5-6','On request','deg','-200','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3954,65256,580,'Altitude',16,'Altitude of the vehicle referenced to sea level at standard atmospheric pressure and temperature.','Vehicle Direction/Speed','7-8','On request','m','-2500','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3955,65257,182,'Engine Trip Fuel',32,'Fuel consumed during all or part of a journey.  See SPN 5053 for alternate resolution.','Fuel Consumption (Liquid)','1-4','On request','l','0','8');
