INSERT INTO experimenteditor_spnpgnentry VALUES(3971,65262,52,'Engine Intercooler Temperature',8,'Temperature of liquid found in the intercooler located after the turbocharger.','Engine Temperature 1','7','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(3972,65262,1134,'Engine Intercooler Thermostat Opening',8,'The current position of the thermostat used to regulate the temperature of the engine intercooler.  A value of 0% represents the thermostat being completely closed and 100% represents the thermostat being completely open.','Engine Temperature 1','8','1 s','%','0','8');
