INSERT INTO experimenteditor_spnpgnentry VALUES(3983,65264,980,'Engine PTO Governor Enable Switch',2,'Switch signal which indicates that the PTO governor toggle switch is in the enabled (ON) position and therefore it is possible to manage the PTO control function.
INSERT INTO experimenteditor_spnpgnentry VALUES(3984,65264,979,'Engine Remote PTO Governor Preprogrammed Speed Control Switch',2,'Switch signal which indicates that the remote PTO governor  toggle switch is in the enabled (ON) position.  If the toggle switch is enabled and other conditions are satisfied then the remote PTO governor feature is activated and the PTO governor will control at the preprogrammed speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3985,65264,978,'Engine Remote PTO Governor Variable Speed Control Switch',2,'Switch signal which indicates that the remote PTO governor toggle switch is in the enabled (ON) position.  If the toggle switch is enabled and other conditions are satisfied then the remote PTO governor feature is activated and the PTO governor will control at a variable speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3986,65264,984,'Engine PTO Governor Set Switch',2,'Switch signal of the PTO control activator which indicates that the activator is in the position to \'set\' the engine PTO governor set speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3987,65264,983,'Engine PTO Governor Coast/Decelerate Switch',2,'Switch signal of the PTO control activator which indicates that the activator is in the position to \'coast/decelerate\' the PTO governor set speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3988,65264,982,'Engine PTO Governor Resume Switch',2,'Switch signal of the PTO control activator which indicates that the activator is in the position to \'resume\' a previously established PTO governor set speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3989,65264,981,'Engine PTO Governor Accelerate Switch',2,'Switch signal of the PTO control activator which indicates that the activator is in the position to \'accelerate\' the PTO governor set speed.
INSERT INTO experimenteditor_spnpgnentry VALUES(3990,65264,2897,'Operator Engine PTO Governor Memory Select Switch',2,'Measured state of the operator’s engine PTO governor memory select switch. This switch selects which of the two available memory locations is to be used to store the dynamically assigned value. This speed will be set using the PTO governor set switch and modified using the PTO governor accelerate and coast/decelerate switches.
INSERT INTO experimenteditor_spnpgnentry VALUES(3991,65264,3447,'Remote PTO Governor Preprogrammed Speed Control Switch #2',2,'Switch signal which indicates that the remote PTO governor toggle switch #2 is in the enabled (ON) position. If the toggle switch is enabled and other conditions are satisfied then the remote PTO governor control feature is activated and the PTO governor will control at the preprogrammed speed #2.
INSERT INTO experimenteditor_spnpgnentry VALUES(3992,65264,3448,'Auxiliary Input Ignore Switch',2,'Switch signal which overrides other switch input''s ability to disable an engine''s operating condition.
INSERT INTO experimenteditor_spnpgnentry VALUES(3993,65264,186,'Power Takeoff Speed',16,'Rotational velocity of device used to transmit engine power to auxiliary equipment.','Power Takeoff Information','2-3','100 ms','rpm','0','8');
