INSERT INTO experimenteditor_spnpgnentry VALUES(3995,65265,69,'Two Speed Axle Switch',2,'Switch signal which indicates the current axle range.
INSERT INTO experimenteditor_spnpgnentry VALUES(3996,65265,70,'Parking Brake Switch',2,'Switch signal which indicates when the parking brake is set. In general the switch actuated by the operator''s park brake control, whether a pedal, lever or other control mechanism  (see also SPN 619 and 5275).
INSERT INTO experimenteditor_spnpgnentry VALUES(3997,65265,1633,'Cruise Control Pause Switch',2,'Switch signal which indicates the position of the Cruise Control Pause Switch used on Remote Cruise Control applications. The Cruise Control Pause Switch signal temporarily disables the Cruise Control function.
INSERT INTO experimenteditor_spnpgnentry VALUES(3998,65265,3807,'Park Brake Release Inhibit Request',2,'Park Brake Release Inhibit Request signals the desire that an applied park brake remain applied and limit the ability of the vehicle to be moved.  
INSERT INTO experimenteditor_spnpgnentry VALUES(3999,65265,595,'Cruise Control Active',2,'Cruise control is switched on.  It is not ensured that the engine is controlled by cruise control, as in the case of a large driver''s demand the engine is controlled by the driver while cruise control is active (maximum selection of cruise control and driver’s demand).  The cruise control is set to 0 if a switch off condition occurs.
INSERT INTO experimenteditor_spnpgnentry VALUES(4000,65265,596,'Cruise Control Enable Switch',2,'Switch signal which indicates that it is possible to manage the cruise control function.
INSERT INTO experimenteditor_spnpgnentry VALUES(4001,65265,597,'Brake Switch',2,'Switch signal which indicates that the driver operated brake foot pedal is being pressed.  This brake foot pedal is controlling the vehicles’ service brake (total vehicle braking application, not park brakes).  It is necessary for safe drivetrain behavior that the switch activates before the physical braking components are activated (i.e. Disengage the cruise control function prior to the activation of friction brakes).
INSERT INTO experimenteditor_spnpgnentry VALUES(4002,65265,598,'Clutch Switch',2,'Switch signal which indicates that the clutch pedal is being pressed. It is necessary for a safe drivetrain behavior that the clutch switch is set before the clutch is opened (cruise control function).
INSERT INTO experimenteditor_spnpgnentry VALUES(4003,65265,599,'Cruise Control Set Switch',2,'Switch signal of the cruise control activator which indicates that the activator is in the position “set.”
INSERT INTO experimenteditor_spnpgnentry VALUES(4004,65265,600,'Cruise Control Coast (Decelerate) Switch',2,'Switch signal of the cruise control activator which indicates that the activator is in the position “coast (decelerate).”
INSERT INTO experimenteditor_spnpgnentry VALUES(4005,65265,601,'Cruise Control Resume Switch',2,'Switch signal of the cruise control activator which indicates that the activator is in the position “resume.”
INSERT INTO experimenteditor_spnpgnentry VALUES(4006,65265,602,'Cruise Control Accelerate Switch',2,'Switch signal of the cruise control activator which indicates that the activator is in the position “accelerate.”
INSERT INTO experimenteditor_spnpgnentry VALUES(4007,65265,86,'Cruise Control Set Speed',8,'Value of set (chosen) velocity of velocity control system.','Cruise Control/Vehicle Speed 1','6','100 ms','kph','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4008,65265,976,'PTO Governor State',5,'This parameter is used to indicate the current state or mode of operation by the power takeoff (PTO) governor.  In lieu of support for PTO Drive Engagement parameters, this parameter may represent the status of a PTO drive.  The broadcasting device must ensure that each achieved state is conveyed in at least one message broadcast before a transition to another state is allowed.
INSERT INTO experimenteditor_spnpgnentry VALUES(4009,65265,527,'Cruise Control States',3,'This parameter is used to indicate the current state, or mode, of operation by the cruise control device.  This is a status parameter.
INSERT INTO experimenteditor_spnpgnentry VALUES(4010,65265,968,'Engine Idle Increment Switch',2,'Switch signal which indicates the position of the idle increment switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(4011,65265,967,'Engine Idle Decrement Switch',2,'Switch signal which indicates the position of the idle decrement switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(4012,65265,966,'Engine Test Mode Switch',2,'Switch signal which indicates the position of the engine test mode switch.
INSERT INTO experimenteditor_spnpgnentry VALUES(4013,65265,1237,'Engine Shutdown Override Switch',2,'Switch signal which indicates the position of the engine shutdown override switch.  This switch function allows the operator to override an impending engine shutdown.
