INSERT INTO experimenteditor_spnpgnentry VALUES(4015,65266,51,'Engine Throttle Valve 1 Position',8,'The position of the valve used to regulate the supply of a fluid, usually air or fuel/air mixture, to an engine.  0% represents no supply and 100% is full supply.','Fuel Economy (Liquid)','7','100 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4016,65266,3673,'Engine Throttle Valve 2 Position',8,'The sensed position feedback of the valve, coming from a second electrical actuator for a second throttle plate, used to regulate the supply of a fluid, usually air or fuel//air mixture.  0% represents no supply and 100% is full supply. SPN 51 is used for the first throttle position feedback.','Fuel Economy (Liquid)','8','100 ms','%','0','8');
