INSERT INTO experimenteditor_spnpgnentry VALUES(4034,65269,79,'Road Surface Temperature',16,'Indicated temperature of road surface over which vehicle is operating.','Ambient Conditions','7-8','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4035,65270,81,'Engine Diesel Particulate Filter Intake Pressure',8,'Exhaust back pressure as a result of particle accumulation on filter media placed in the exhaust stream.  See SPN 3609 for better resolution.','Intake/Exhaust Conditions 1','1','0.5 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4036,65270,102,'Engine Intake Manifold #1 Pressure',8,'The gage pressure measurement of the air intake manifold. If there are multiple air pressure sensors in the intake stream, this is the last one in flow direction before entering the combustion chamber.  This should be the pressure used to drive gauges and displays. See also SPNs 1127-1130 and SPN 3562  for alternate range and resolution. If there is only one pressure measurement of the air intake manifold to report and this range and resolution is adequate, this parameter should be used.','Intake/Exhaust Conditions 1','2','0.5 s','kPa','0','8');
