INSERT INTO experimenteditor_spnpgnentry VALUES(4041,65270,173,'Engine Exhaust Gas Temperature',16,'Temperature of combustion byproducts leaving the engine.  See SPNs 2433 and 2434 for engines with more than one exhaust gas temperature measurement.','Intake/Exhaust Conditions 1','6-7','0.5 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4042,65271,114,'Net Battery Current',8,'Net flow of electrical current into/out of the battery or batteries.','Vehicle Electrical Power 1','1','1 s','Amps','-125','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4043,65271,115,'Alternator Current',8,'Measure of electrical current flow from the alternator.  Alternator Current (High Range/Resolution) parameter SPN 1795 has a higher range and resolution of the same parameter.','Vehicle Electrical Power 1','2','1 s','Amps','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4044,65271,167,'Charging System Potential (Voltage)',16,'Electrical potential measured at the charging system output.  The charging system may be any device charging the batteries.  This includes alternators, generators, solid state charger and other charging devices.','Vehicle Electrical Power 1','3-4','1 s','Volts','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4045,65271,168,'Battery Potential / Power Input 1',16,'This parameter measures the first source of battery potential as measured at the input of the ECM/actuator etc. coming from one or more batteries, irrespective of the distance between the component and the battery.  This SPN is also used when ECM''s are interconnected in a series configuration, where the source of power is coming directly or indirectly from the same battery/batteries.','Vehicle Electrical Power 1','5-6','1 s','Volts','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4046,65271,158,'Keyswitch Battery Potential',16,'Battery potential measured at the input of the electronic control unit supplied through a keyswitch or similar switching device.','Vehicle Electrical Power 1','7-8','1 s','Volts','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4047,65272,123,'Clutch Pressure',8,'Gage pressure of oil within a wet clutch.','Transmission Fluids 1','1','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4048,65272,124,'Transmission Oil Level 1',8,'First instance of a transmission oil level indicator. Conveys the ratio of volume of transmission sump oil to recommended volume.','Transmission Fluids 1','2','1 s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4049,65272,126,'Transmission Filter Differential Pressure',8,'Change in transmission fluid pressure, measured after the filter, due to accumulation of solid or semisolid material on or in the filter.','Transmission Fluids 1','3','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4050,65272,127,'Transmission Oil Pressure',8,'Gage pressure of lubrication fluid in transmission, measured after pump.','Transmission Fluids 1','4','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4051,65272,3027,'Transmission Oil Level 1 High / Low',8,'First instance of a transmission oil level indicator. Conveys the amount of current volume of transmission sump oil compared to recommended volume. Positive values indicate overfill. Zero means the transmission fluild is filled to the recommended level.
INSERT INTO experimenteditor_spnpgnentry VALUES(4052,65272,3028,'Transmission Oil Level 1 Countdown Timer',4,'Countdown timer for the first instance of a transmission oil level indicator.  Once all vehicle conditions (such as vehicle stopped, etc) are met, some transmissions may require a ‘settling time’ to allow the fluid level to normalize.  This parameter indicates how much of the required settling time remains.  When time reaches 0, a valid oil level measurement value will be broadcast in SPN 3027 Transmission Oil Level High / Low.
INSERT INTO experimenteditor_spnpgnentry VALUES(4053,65272,3026,'Transmission Oil Level 1 Measurement Status',4,'Measurement status for the first instance of a transmission oil level indicator.  Indicates if conditions are acceptable to obtain a valid transmission oil level measurement as conveyed in SPN 124 Transmission Oil Level or SPN 3027 Transmission Oil Level High / Low.  If conditions are not acceptable, this parameter conveys to the operator what prevents conditions from being acceptable.  Only one condition can be conveyed in this parameter at any given point in time.  If multiple conditions exist, it is not important which condition is actually broadcast, as the driver must ‘correct’ each and every condition as it is presented before a valid oil level reading can be made.  If multiple conditions exist that prevent a valid reading, the sender should broadcast one of those conditions until it is corrected; then the next condition can be conveyed to the operator, and so on.
INSERT INTO experimenteditor_spnpgnentry VALUES(4054,65272,177,'Transmission Oil Temperature 1',16,'First instance of transmission lubricant temperature.','Transmission Fluids 1','5-6','1 s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4055,65273,75,'Steering Axle Temperature',8,'Temperature of lubricant in steering axle.','Axle Information','1','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4056,65273,930,'Drive Axle Location',8,'To identify to which of several similar devices (such as tires or fuel tanks) the information applies.
INSERT INTO experimenteditor_spnpgnentry VALUES(4057,65273,579,'Drive Axle Lift Air Pressure',8,'Gage pressure of air in system that utilizes compressed air to provide force between axle and frame.','Axle Information','3','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4058,65273,578,'Drive Axle Temperature',8,'Temperature of axle lubricant in drive axle.','Axle Information','4','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4059,65273,2613,'Drive Axle Lube Pressure',8,'The drive axle lubricant pressure with location determined by Drive Axle Location (SPN 930).','Axle Information','5','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4060,65273,2614,'Steering Axle Lube Pressure',8,'The steering axle lubricant pressure.','Axle Information','8','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4061,65274,116,'Brake Application Pressure',8,'Gage pressure of compressed air or fluid in vehicle braking system measured at the brake chamber when brake shoe (or pad) is placed against brake drum (or disc).','Brakes','1','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4062,65274,117,'Brake Primary Pressure',8,'Gage pressure of air in the primary, or supply side, of the air brake system.','Brakes','2','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4063,65274,118,'Brake Secondary Pressure',8,'Gage pressure of air in the secondary, or service side, of the air brake system.','Brakes','3','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4064,65274,619,'Parking Brake Actuator',2,'Signal which indicates the current state of the actuator(s) that control the parking brake (see also SPN 70 and 5275).
INSERT INTO experimenteditor_spnpgnentry VALUES(4065,65274,3557,'Parking Brake Red Warning Signal',2,'This parameter commands the Parking Brake red optical warning signal.
INSERT INTO experimenteditor_spnpgnentry VALUES(4066,65274,3808,'Park Brake Release Inhibit Status',2,'This parameter provides reports on the status of the Park Brake Release Inhibit function.
INSERT INTO experimenteditor_spnpgnentry VALUES(4067,65275,119,'Hydraulic Retarder Pressure',8,'Gage pressure of oil in hydraulic retarder system.','Retarder fluids','1','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4068,65275,120,'Hydraulic Retarder Oil Temperature',8,'Temperature of oil found in a hydraulic retarder.','Retarder fluids','2','1 s','C','-40','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4069,65275,5346,'Driveline Retarder Overheat Indicator',2,'Signal from the driveline retarder indicating that its fluid temperature is above normal acceptable limits, and as a result, retarder operation may be altered or restricted.  The indicator is typically a lamp.  Distinctions in meaning between the continuous and flashing are left to the transmission manufacturer.
INSERT INTO experimenteditor_spnpgnentry VALUES(4070,65276,80,'Washer Fluid Level',8,'Ratio of volume of liquid to total container volume of fluid reservoir in windshield wash system.','Dash Display','1','1s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4071,65276,96,'Fuel Level 1',8,'Ratio of volume of fuel to the total volume of fuel storage container.
INSERT INTO experimenteditor_spnpgnentry VALUES(4072,65276,95,'Engine Fuel Filter Differential Pressure',8,'Change in fuel delivery pressure, measured across the filter, due to accumulation of solid or semisolid matter on the filter element.  See Figures SPN16_A & SPN16_B.','Dash Display','3','1s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4073,65276,99,'Engine Oil Filter Differential Pressure',8,'Change in engine oil pressure, measured across the filter, due to the filter and any accumulation of solid or semisolid material on or in the filter.','Dash Display','4','1s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4074,65276,38,'Fuel Level 2',8,'Ratio of volume of fuel to the total volume of fuel in the second or right-side storage container.  When Fuel Level 2 is not used, Fuel Level 1 (SPN 96) represents the total fuel in all fuel storage containers.','Dash Display','7','1s','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4075,65276,169,'Cargo Ambient Temperature',16,'Temperature of air inside vehicle container used to accommodate cargo.','Dash Display','5-6','1s','C','-273','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4076,65277,72,'Engine Blower Bypass Valve Position',8,'Relative position of the blower bypass valve.','Alternate Fuel 1','1','500 ms','%','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4077,65277,159,'Engine Gas Supply Pressure',16,'Gage pressure of gas supply to fuel metering device.','Alternate Fuel 1','2-3','500 ms','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4078,65278,73,'Auxiliary Pump Pressure',8,'Gage pressure of auxiliary water pump driven as a PTO device.','Auxiliary Water Pump Pressure','1','1 s','kPa','0','8');
INSERT INTO experimenteditor_spnpgnentry VALUES(4079,65279,97,'Water In Fuel Indicator',2,'Signal which indicates the presence of water in the fuel.
INSERT INTO experimenteditor_spnpgnentry VALUES(4080,65279,5675,'Operator Shift Prompt',2,'Command to activate an indicator that advises the operator to shift to a different gear.  Typically this would be used as part of a fuel economy improvement or drivability aid.
INSERT INTO experimenteditor_spnpgnentry VALUES(4081,65279,5825,'Driver Warning System Indicator Status',3,'The desired illumination of the Euro VI defined driver warning system indicator for relevant malfunctions and diesel exhaust fluid (reagent) tank low level.  Used for Euro VI implementations.  See Euro VI implementing regulation Annex XIII, Section 4 for usage requirements.
INSERT INTO experimenteditor_spnpgnentry VALUES(4082,65279,5826,'Emission Control System Operator Inducement Severity',3,'Severity status of the operator inducement system for anomalies with the emission control system, such as tampering, low diesel exhaust fluid (reagent) quality, diesel exhaust fluid (reagent) tank level, or EGR system errors.  Higher numerical levels indicate more severe levels of inducement.  Level 1 is the least severe.  Used for Euro VI implementations.
