INSERT INTO experimenteditor_spnpgnentry VALUES(5282,NULL,2836,'Battery 1 Potential 2 (Voltage), Switched (obsolete)',NULL,'Electrical potential of the second circuit powered by the primary battery (battery 1) as measured at the input of the electronic control unit supplied through a switching device.
INSERT INTO experimenteditor_spnpgnentry VALUES(5283,NULL,2837,'Identity Number',21,'The Identity Number is a 21-bit field in the name assigned by the ECU manufacturer.   The Identity Number is necessary in circumstances where it is possible that the NAME would not otherwise be unique (i.e. could be identical).  This field should be unique and non-varying with removal of power.  This field is necessary to resolve any address contention.  The manufacturer must provide this uniqueness among products.  It is the manufacturers choice to encode any other information into the identity number, for example, time/date of manufacture, serial number of the module, the vehicle the module is placed into, etc.','','','','bit','0','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5284,NULL,2838,'Manufacturer Code',11,'The Manufacturer Code is an 11-bit field that indicates which company was responsible for the production of the electronic control module for which this NAME is being referenced. Manufacturer codes are assigned by committee and may be found in the SAE J1939 base document.  The Manufacturer Code field is not dependent on any other field in the NAME.','','','','bit','0','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5285,NULL,2839,'Function Instance',5,'The Function Instance is a 5-bit field that identifies the particular occurrence of a Function on the same Vehicle System on a given network.  
INSERT INTO experimenteditor_spnpgnentry VALUES(5286,NULL,2840,'ECU Instance',3,'The ECU Instance is a 3-bit field that indicates which one of a group of electronic control modules associated with a given Function is being referenced.  For example, in the case where a single engine is managed by two separate control units, each of which is attached to the same SAE J1939 network, the ECU Instance Field will be set to 0 for the first ECU and 1 for the second ECU.  
INSERT INTO experimenteditor_spnpgnentry VALUES(5287,NULL,2841,'Function',8,'Function is an 8-bit field defined and assigned by the committee.  When Function has a value of 0 to 127 (See Appendix B, Table B11), its definition is not dependent on any other field.  When Function has a value greater than 127(See Appendix B, Table B12), its definition depends on Vehicle System.  Function, when combined with the Industry Group and the Vehicle System fields identifies a common name for a specific controller.  The common name formed from the combination does not imply any specific capabilities.','','','','bit','0','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5288,NULL,2842,'Vehicle System',3,'A subcomponent of a vehicle, or a component that is analogous to a subcomponent of a vehicle, that includes one or more SAE J1939 segments and may be connected or disconnected from the vehicle. A Vehicle System may be made up of one or more Functions, which have ECU''s that are connected to a SAE J1939 segment of the Vehicle System.
INSERT INTO experimenteditor_spnpgnentry VALUES(5289,NULL,2843,'Vehicle System Instance',4,'Vehicle System Instance is a 4-bit field that is used to identify a particular occurrence of a particular Vehicle System within a connected network.
INSERT INTO experimenteditor_spnpgnentry VALUES(5290,NULL,2844,'Arbitrary Address Capable',1,'This 1-bit field indicates whether a CA is both self-configurable and can use an arbitrary source address to resolve an address claim conflict.  If this bit is set to “1”, the CA will resolve an address conflict with a CA whose NAME has a higher priority (lower numeric value) by selecting an arbitrary source address from the range 128 to 247 inclusive and claiming that source address. A CA which computes its address but can claim only from a more restricted set of addresses is not considered arbitrary address capable (e.g. On-Highway Trailers.)  See section 4.2 of this document for details of the address claim process.','','','','bit','0','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5291,NULL,2846,'Industry Group',3,'Industry Group is a 3-bit field defined and assigned by the committee.  Industry Group definitions may be found in Appendix B.7 of the SAE J1939 base document.  The Industry Group field identifies NAMEs associated with a particular industry that uses SAE J1939, for example: On-Highway Equipment, or Agricultural Equipment.','','','','bit','0','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5292,NULL,2850,'Communications Antenna',NULL,'A failure in the antenna system of a communications unit.  Note: There are several possible communications devices that might be on a J1939 network, it has been planned that the specific type of communications will be identified by the NAME being used by the CA within the particular ecu.  For example the communications antenna on a cellular system would be identified by the antenna SPN being sent from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5293,NULL,2851,'Communications Service Personal Identification Number',NULL,'The Personal Identification Number (PIN) is incorrect or has been blocked.  Thus service of a particular communications unit is prevented.  Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example if the PIN was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5294,NULL,2852,'Communications Service Subscriber Identification Module',NULL,'The hardware key, know as a Subscriber Identification Module (SIM), is either missing or incorrect.  Thus service of a particular communications unit is prevented.  Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example if the SIN was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5295,NULL,2853,'Communications Connection',NULL,'A communications unit has established connection but no data exchanged has occurred (no other knowledge of why). Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example if the connection problem was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5296,NULL,2854,'Communications Carrier',NULL,'The communications unit has suffered carrier loss.  This failure is generally specific to the Global Sytem for Mobile Communications (GSM), a specific type of cellular communications unit.  Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example when the carrier problem was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5297,NULL,2855,'Communications Bit Error Rate',NULL,'The data failure rate is too high for communications to keep working at the specified error rate within the specific communications unit in use. Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example if the SPN was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5298,NULL,2856,'Communications Data Upload',NULL,'A failure has occurred while sending data using a communications unit from the mobile machine to the fixed base. Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example when the failure was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5299,NULL,2857,'Communications Data Download',NULL,'A failure has occurred while sending data using a communications unit from the fixed base to the mobile machine. Note: The specific communications unit would be determinable from the NAME of the CA using the SA of the message using this communications SPN.  For example when the failure was for a Cellular communications unit, then the message would come from the SA of the CA with the NAME Function ''54'' - Communications Unit, Cellular (a radio communications device designed specifically to communicate via the ‘Cellular telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5300,NULL,2858,'Machine Data Configuration 1',NULL,'There is a problem involving the parameter list (along with the parameter locating information) for the data structure for configuring operations within the Controller Application being communicated with.  Note: The specific CA as well as any other information about it would be determinable from the NAME of the CA found by comparing the SA of the particular diagnostic message with the SAs and associated NAMEs from the set of Address Claim messages.  For example if the SPN was for an on-board data logger (SA 251, Function 130), then the message would come from the SA of 251, which would be the data logger CA with the NAME Function ''130'' -  identified within the Global NAME Table.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5301,NULL,2859,'Machine Data Configuration 2',NULL,'There is a problem involving one (or more) of the PGN(s) within the parameter list for the data structure for configuring operations within the Controller Application being communicated with.  Note: The specific CA as well as any other information about it would be determinable from the NAME of the CA found by comparing the SA of the particular diagnostic message with the SAs and associated NAMEs from the set of Address Claim messages.  For example if the SPN was for an on-board data logger (SA 251, Function 130), then the message would come from the SA of 251, which would be the data logger CA with the NAME Function ''130'' -  identified within the Global NAME Table.telephone system’. May be either receiver only, transmitter only or transceiver.) identified within the Global NAME Table.','','','','','','');
