INSERT INTO experimenteditor_spnpgnentry VALUES(5387,NULL,3032,'Right Brake Pedal Position',8,'Ratio of the right brake pedal position to maximum right brake pedal position. 0% means no braking. The maximum of this (Right Brake Pedal Position) and SPN 3033 (Left Brake Pedal Position) should be transmitted as SPN 521 (Brake Pedal Position). For applications with only one brake pedal use SPN 521.','','','','%','0','');
