INSERT INTO experimenteditor_spnpgnentry VALUES(5390,NULL,3050,'Catalyst Bank 1 System Monitor',NULL,'Monitors Catalyst Bank 1 System.  SPN 3050 may be used to represent readiness, in-use ratio, test results, data stream and DTC.  Reported in-use ratio is the lowest numerical ratio of the in-use ratios that are tracked separately for each required monitor that detects malfunctions of the catalyst bank 1 system.','','','','','','');
