INSERT INTO experimenteditor_spnpgnentry VALUES(5464,NULL,3146,'PGN of message being configured',NULL,'This is the PGN of the Proprietarily Configurable Message (PCM) whose configuration is being identified by this Configuration Identification Message.  Operational range includes only those PCMs as identified in the J1939-74 document.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5465,NULL,3147,'Parameter being included',NULL,'This is the SPN of the parameter whose location is presently being identified for grouping into the message whose PGN is in this Configuration Identification Message.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5466,NULL,3148,'Position of configured parameter',NULL,'This is a number identifying a particular parameter’s position within a configured message in particular for differentiating the parameter (identified by SPN) whose location is presently being identified from the other parameters which will be grouped into the message whose PGN is in this Configuration Identification Message. It is used to verify that all of the parameters to be included within the message being configured have been received. A 5 bit slot with the values 0 and 31 is NOT allowed.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5467,NULL,3149,'Message will be used proprietarily',NULL,'This is a single bit flag used to indicate that the message being configured is a member of the set of destination specific proprietarily configurable messages, and that hence the Source Address and Destination Address are needed to interpret the data as with the destination specific proprietary A message of -21.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5468,NULL,3150,'Message will use transport protocol',NULL,'This is a single bit flag used to indicate whether the message being configured is one that will use transport protocol.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5469,NULL,3151,'First parameter only being identified',NULL,'This is a single bit, which is used to identify whether only the first parameter that will be sent within one of the Configurable Messages is being identified with a Configuration Identification Message. This form is to be used on each power-up event for any CA. This function has been generated so that the software can verify that a given message still comes from a particular CA but with the shortest possible initialization times. Identification of the location of individual specific parameters can then be handled with the Parameter Locate message.  A \'0\' means that all the parameters will be transmitted.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5470,NULL,3152,'Number of parameters included',NULL,'This is the number of parameters, which will be grouped into the message whose PGN is in this Configuration Identification Message. It is used in the verification that all of the SPNs to be included within the message being configured have been received. A 5 bit slot with 0 and 31 are NOT allowed  ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5471,NULL,3153,'Starting bit for this parameter',NULL,'The bit position that the LSB of the data for the parameter, whose SPN is identified in bytes 4-6, is to occupy within the configurable message being identified by the PGN in bytes 1-3.  Since this identifies only the position of the LSB it must be remembered that the length is to already be in the CA’s parameter database.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5472,NULL,3154,'Parameter to be located',NULL,'This is the parameter, identified by SPN, that it is desired to locate or to initiate the transmission. Locating implies identifying any message from the given source (i.e. the destination of this Parameter LOCATE MESSAGE), all other CAs when ‘global’ address is used) that contains this particular parameter.','','','','','','');
