INSERT INTO experimenteditor_spnpgnentry VALUES(5544,NULL,3569,'Generator Neutral Earth Fault',NULL,'Some means (usually a core balance current transformer into a matched measurement device) identifies that an imbalance between the current in the live phase(s) and neutral from the generator exceeds a threshold. When this condition occurs, this SPN is triggered to indicate that a fault to earth current is flowing within the generator. Typically used with FMI 31 to indicate that the condition exists.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5545,NULL,3570,'Generator Load Neutral Earth Leakage',NULL,'Some means (usually a core balance current transformer into a matched measurement device) identifies that an imbalance between the current in the live phase(s) and neutral from the load has exceeded a threshold. When this condition occurs, this SPN is triggered to indicate that a fault to earth current is flowing in the load. Typically used with FMI 31 to indicate that the condition exists.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5546,NULL,3571,'Generator Circuit Breaker Opening Time',NULL,'As determined by the genset control, it will attempt to close or open a circuit breaker depending on the operational mode and system status. This parameter indicates the time between the control commanding the breaker to open, and the breaker opening (as measured by the genset control). If the breaker fails to open within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5547,NULL,3572,'Generator Circuit Breaker Closing Time',NULL,'As determined by the genset control, it will attempt to close or open a circuit breaker depending on the operational mode and system status. This parameter indicates the time between the control commanding the breaker to close, and the breaker closing (as measured by the genset control). If the breaker fails to close within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5548,NULL,3573,'Utility Circuit Breaker Opening Time',NULL,'As determined by the genset control, it will attempt to close or open a circuit breaker depending on the operational mode and system status. This parameter indicates the time between the control commanding the breaker to open, and the breaker opening (as measured by the genset control). If the breaker fails to open withinin a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5549,NULL,3574,'Utility Circuit Breaker Closing Time',NULL,'As determined by the genset control, it will attempt to close or open a circuit breaker depending on the operational mode and system status. This parameter indicates the time between the control commanding the breaker to close, and the breaker closing (as measured by the genset control). If the breaker fails to close within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5550,NULL,3575,'Utility to Generator Transfer Time',NULL,'When the genset control commands the generator(s) to pick up load, it transfers the load from the utility to the generator(s). This parameter indicates the time between the genset control requesting the generator(s) to pick up the load, and the completion of the load transfer from the utility to the generator(s). If the transfer fails to complete within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5551,NULL,3576,'Generator to Utility Transfer Time',NULL,'When the genset control commands the generator(s) to drop load, it transfers the load to the utility, and then it disconnects. This parameter indicates the time between the genset control requesting the generator(s) to drop the load, and the completion of the load transfer from the generator(s) to the utility. If the transfer fails to complete within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5552,NULL,3577,'Loss of Electric Utility Grid',NULL,'Typically the determination that utility has failed or no longer available is made by monitoring the voltage supplied by the utility. When the voltage drops below a predetermined level for a specified amount of time, this condition becomes active. In emergency standby generator systems, this is also the signal for starting the generator set. The automatic transfer switch will then switch the load from utility to generator set.
INSERT INTO experimenteditor_spnpgnentry VALUES(5553,NULL,3578,'Generator to Bus Synchronization Time',NULL,'This parameter indicates the time between the command to synchronize to the bus being issued and successful synchronization. If synchonization fails to complete within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5554,NULL,3579,'Generator to Bus Phase Sequence Mismatch',NULL,'This parameter indicates a phase sequence mismatch between the generator and the bus. Typically used with FMI 31 to indicate that the condition exists.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5555,NULL,3580,'Generator Soft Unload Time',NULL,'This parameter indicates the time between the command to soft unload and the completion of the ramp down to an unloaded condition. If the generator fails to unload within a specified amount of time, a diagnostic may be generated.
INSERT INTO experimenteditor_spnpgnentry VALUES(5556,NULL,3581,'Modbus Data Link',NULL,'Identifies the action to be performed on the Modbus communications port.  Parameter mirrors SPN 608 (for J1587 diagnostic) and SPN 639 (for J1939 diagnostic).','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5557,NULL,3582,'Utility Power Supply',NULL,'110/120V (60Hz) or 220/240V (50Hz) alternating current power supply for engine AC auxiliary devices.  This Utility power supply would typically come from local utility or ''wall outlet''.  It can be used to power a battery charger, DC power supply, or on engine auxiliaries like heaters, fans, pumps, etc. directly.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5558,NULL,3583,'Common AC Auxiliaries Breaker',NULL,'This parameter covers designs where several independent AC auxiliary control devices each have their own breakers, but the controlling ECM only receives a single breaker tripped feedback indication if any one of these breakers is tripped.','','','','','','');
