INSERT INTO experimenteditor_spnpgnentry VALUES(5611,NULL,3783,'Intake Manifold Charge Combustion',NULL,'This parameter provides diagnostics on a charge combustion event within the engine intake manifold, which is commonly called spit-back or intake manifold backfire. This combustion event may be caused by factors such as burnt or sticking intake valves, by ignition timing errors in the case of spark ignition engines, and others.  This combustion event may occur without warning at any time on a running engine.  A pressure switch or transducer that is fitted directly into the intake manifold to detect the first rising pulse and cause lockout will provide protection against further engine damage.','','','','','','');
