INSERT INTO experimenteditor_spnpgnentry VALUES(5615,NULL,3824,'Transmission Gear Latch Actuator',NULL,'Actuator for transmission gear latch. This actuator controls an on/off valve that makes the system pressure available to the clutch solenoids when it is on. The actuator allows the transmission to hold a gear (i.e. gear latch) until the vehicle slows down when power is lost to the engine and/or transmission ECUs. With the transmission still in gear, the engine will keep rotating, thus keeping the power steering pumps and such running.','','','','','','');
