INSERT INTO experimenteditor_spnpgnentry VALUES(5753,NULL,4121,'DTCx Total ActiveTime',NULL,'This timer provides the total number of hours the DTCx has been confirmed and active. This is the cumulative time so it the DTCx goes inactive and the confirmed and active again then it must continue to count from its previous value. The timer value is allowed to be erased after 400 days or 9600 hour of operation with the associated DTC being previously active during that period. Each timer is preceded in the data by a DTC (SPN + FMI) with which it is associated. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5754,NULL,4122,'DTCx Total Previously Active Time',NULL,'This timer provides the number of hours the NOx malfunction has been confirmed and previously active. This is the cumulative time during the 400 days or 9600 hours of operation.  Each timer is preceded in the data by the DTC (SPN + FMI) with which it is associated.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5755,NULL,4123,'DTCx Time Until Derate',NULL,'This timer provides the number of hours the NOx malfunction has until the OBD required derate will occur.  Each timer is preceded in the data by a DTC (SPN + FMI) with which it is associated. If the specific DTC is not required by the applicable OBD regulation to have a torque derate then this parameter shall be sent as “not available”. If the DTC is currently previously active then the count shall be sent as 62.5 hours. When the counter reaches zero it shall remain at zero while the malfunction is active.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5756,NULL,4124,'EI-AECD Number',NULL,'The manufacturer specific number for the specific EI-AECD.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5757,NULL,4125,'EI-AECD Engine Hours Timer 1',NULL,'The total engine running hours for the first timer for the EI-AECD.  For EI-AECDs requiring only a single timer, Timer 1 shall be used to report the total engine hours for the EI-AECD.  For EI-AECDs requiring two timer, Timer 1 shall report the total engine hours when the EI-AECD is commanding reduced emission control effectiveness up to but not including 75 percent of the maximum reduced emission control effectiveness.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5758,NULL,4126,'AECD Engine Hours Timer 2',NULL,'The total engine running hours for the second timer for the EI-AECD.  For EI-AECDs requiring only a single timer, Timer 2 shall be reported as \'Not Available\'  For EI-AECDs requiring two timer, Timer 2 shall report the total engine hours when the EI-AECD is commanding reduced emission control effectiveness of 75 percent or more of the maximum reduced emission control effectiveness.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5759,NULL,4133,'Vehicle Non-Roadworthy Component Count',NULL,'Vehicle Non-Roadworthy Component Count provides the sum of the (sub-) system or component non-roadworthiness counts.  (See 5.7.37.1 of J1939-73)  If the sum of all the counts is greater than 250, the value 250 shall be reported.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5760,NULL,4134,'Vehicle Continuous Malfunction Indicator',NULL,'Vehicle Continuous Malfunction Indicator indicates that one or more (sub-) systems or components requires that the Malfunction Indicator (MI) to be steady burning.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5761,NULL,4135,'Vehicle Malfunction Indicator Display Strategy',NULL,'Vehicle Malfunction Indicator Display Strategy indicates if any system is configured to employ a discriminatory MI display.  The value 0b00 indicates that all systems employ a non-discriminatory MI display.  ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5762,NULL,4136,'Vehicle Malfunction Indicator Activation Mode',NULL,'The Vehicle Malfunction Indicator Status provides the most severe form of MI display required by the failure status of any sub-system or component.  For the enumeration shown, the MI Activation Mode is ordered from least severe to most severe.  MI Activation Mode 1 indicates no malfunctions. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5763,NULL,4137,'Vehicle Incomplete Monitor Count',NULL,'System Incomplete Monitor Count provides the number of incomplete diagnostic monitors for a given sub-system or component.  A count of zero means that all monitors are complete and the vehicle is “ready” for inspection.  If the sum exceeds 64 512 counts, then the value 64 512 shall be reported.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5764,NULL,4139,'System Non-Roadworthy Component Count',NULL,'System Non-Roadworthy Component Count provides the number of components (or sub-sub-systems) that a (sub-) system has determined are not roadworthy.  Sub-systems or components that provide System Continuous Malfunction Indicator Status shall provide a minimum count of one, when they report their System Continuous Malfunction Indicator (See 5.7.37.2) as 0b01, System MI is continuous.  If the calculated count for a sub-system is greater than 250, the value 250 shall be reported.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5765,NULL,4140,'System Continuous Malfunction Indicator',NULL,'System Continuous Malfunction Indicator indicates that the system requires its (or the emissions malfunction indicator) to be steady burning.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5766,NULL,4141,'System Malfunction Indicator Display Strategy',NULL,'System Malfunction Indicator Display Strategy indicates whether the system uses a non-discriminatory MI display or a discriminatory MI display as permitted by local regulations.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5767,NULL,4142,'System Malfunction Indicator Activation Mode',NULL,'The System Malfunction Indicator Status provides the form of MI display required by the failure status of the sub-system or component.  For the enumeration shown, the MI Activation Mode is ordered from least severe to most severe.  MI Activation Mode 1 indicates no malfunctions.  ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5768,NULL,4143,'System Incomplete Monitor Count',NULL,'System Incomplete Monitor Count provides the number of incomplete diagnostic monitors for a given sub-system or component.  A count of zero means that all monitors are complete and the vehicle is “ready” for inspection.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5769,NULL,4144,'Global Technical Regulation Description',NULL,'Global Technical Regulation Description provides a textual description of the Global Technical Regulations to which the sub-system or component complies.  Individual components may comply with different regulations.  See J1939-03 regarding reporting descriptions for multiple components.  ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5770,NULL,4145,'System Cumulative Continuous MI Time',NULL,'System Cumulative Continuous MI Time provides the total amount of time that the MI has been demanded to be illuminated during the life of the (sub-) system or component.  ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5771,NULL,4146,'System Greatest B1 Counter',NULL,'System Greatest B1 Counter provides the total amount of time that one or more B1 DTCs have been active. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5772,NULL,4147,'Failure Specific B1 Counter',NULL,'The Failure Specific B1 Counter provides an individual B1 counter, supported by the system.  The counter provides the number of hours the B1 failure has been confirmed and active.  Each counter is preceded in the data by a class B1 failure DTC (SPN + FMI) with which it is associated. ','','','','','','');
