INSERT INTO experimenteditor_spnpgnentry VALUES(5775,NULL,4182,'Generator Output Frequency Adjustment Circuit',NULL,'The Generator Output Frequency Adjustment Circuit is a potentiometric circuit used to regulate the generator frequency. The potentiometer is located on the generator control panel. The diagnostic SPN will be used for out of range faults.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5776,NULL,4183,'Generator Droop Adjustment Circuit',NULL,'The Generator Droop Adjustment Circuit  is a potentiometric circuit used to regulate the generator droop. The potentiometer is located on the generator control panel. The diagnostic SPN will be used for out of range faults.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5777,NULL,4184,'Generator Gain Adjustment Circuit',NULL,'The Generator Gain Adjustment Circuit  is a potentiometric circuit used to regulate the generator gain. The potentiometer is located on the generator control panel. The diagnostic SPN will be used for out of range faults.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5778,NULL,4185,'Overspeed Shutdown Relay Driver',NULL,'The Overspeed Shutdown relay driver drives the overspeed shutdown lamp to indicate the engine has reached overspeed. This SPN is to indicate faults with the overspeed shutdown relay driver circuit.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5779,NULL,4186,'Low Oil Pressure Shutdown Relay Driver',NULL,'The Low Oil Pressure Shutdown relay driver indicates the engine has reached a low oil pressure condition. This SPN is to indicate faults with the Low Oil Pressure Shutdown relay driver circuit.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5780,NULL,4187,'High Engine Temperature Shutdown Relay Driver',NULL,'The High Engine Temperature Shutdown relay driver indicates the engine has reached a high temperature condition. This SPN is to indicate faults with the High Engine Temperature shutdown relay driver circuit.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5781,NULL,4188,'Pre-Low Oil Pressure Indicator Relay Driver',NULL,'The Pre-Low Oil Pressure indicator relay driver indicates that the engine has reached a moderately severe low oil pressure condition. This SPN is to indicate faults with the Pre-Low Oil Pressure indicator relay driver circuit.','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(5782,NULL,4189,'Pre-High Oil Pressure Indicator Relay Driver',NULL,'The Pre-High Oil Pressure indicator relay driver indicates that the engine has reached a moderately severe high oil pressure condition. This SPN is to indicate faults with the Pre-High Oil Pressure indicator relay driver circuit.','','','','','','');
