INSERT INTO experimenteditor_spnpgnentry VALUES(5810,NULL,4244,'Engine Run Relay',NULL,'This is a diagnostic SPN related to the Engine Run Relay.  The Engine Run Relay is a relay used to indicate to external controls (such as switchgear) that the engine is either running or is progressing through the initialization sequence.  This is intended for use with diagnostic FMIs to indicate a problem with the relay, such as an open-circuit condition.','','','','','','');
