INSERT INTO experimenteditor_spnpgnentry VALUES(6197,NULL,5838,'EGR Valve Malfunction',NULL,'Indicates that the diagnostic system has determined that the engine has been operated with an EGR valve malfunction.  This is a Parent SPN that shall be active when any relevant EGR valve DTC is active, per the requirements of Annex XIII, Appendix 2, section 4 of the Euro VI implementing regulation.  The FMI 31, total active time, total previously active time, and time until derate information associated with this SPN shall be reported through DM32. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(6198,NULL,5839,'Diesel Exhaust Fluid Consumption Malfunction',NULL,'Indicates that the diagnostic system has determined that the engine has been operated with a diesel exhaust fluid (reagent) consumption malfunction.  This is a Parent SPN that shall be active when any relevant diesel exhaust fluid (reagent) consumption DTC is potential or active, per the requirements of Annex XIII, Appendix 2, section 4 of the Euro VI implementing regulation.  The FMI 31, total active time, total previously active time, and time until derate information associated with this SPN shall be reported through DM32. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(6199,NULL,5840,'Diesel Exhaust Fluid Dosing Malfunction',NULL,'Indicates that the diagnostic system has determined that the engine has been operated with a diesel exhaust fluid (reagent) dosing malfunction.  This is a Parent SPN that shall be active when any relevant diesel exhaust fluid (reagent) dosing DTC is active, per the requirements of Annex XIII, Appendix 2, section 4 of the Euro VI implementing regulation.  The FMI 31, total active time, total previously active time, and time until derate information associated with this SPN shall be reported through DM32. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(6200,NULL,5841,'Diesel Exhaust Fluid Quality Malfunction',NULL,'Indicates that the diagnostic system has determined that the engine has been operated with a diesel exhaust fluid (reagent) quality malfunction.  This is a Parent SPN that shall be active when any relevant diesel exhaust fluid (reagent) quality DTC is active, per the requirements of Annex XIII, Appendix 2, section 4 of the Euro VI implementing regulation.  The FMI 31, total active time, total previously active time, and time until derate information associated with this SPN shall be reported through DM32. ','','','','','','');
INSERT INTO experimenteditor_spnpgnentry VALUES(6201,NULL,5842,'SCR Monitoring System Malfunction',NULL,'Indicates that the diagnostic system has determined that the engine has been operated with an SCR monitoring system malfunction.  This is a Parent SPN that shall be active when any relevant SCR monitoring system DTC is active, per the requirements of Annex XIII, Appendix 2, section 4 of the Euro VI implementing regulation.  The FMI 31, total active time, total previously active time, and time until derate information associated with this SPN shall be reported through DM32. ','','','','','','');
